INSERT INTO `strains` VALUES (25,75,'Blue Dream','blue-dream','Hybrid','Bd','<p>Blue Dream, a sativa-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> originating in California, has achieved legendary status among West Coast strains. Crossing a <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> <a href=\"http://leafly.com/indica\">indica</a> with the <a href=\"http://leafly.com/sativa\">sativa</a> <a href=\"http://www.leafly.com/sativa/haze\">Haze</a>, Blue Dream balances full-body <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> with gentle cerebral invigoration. Novice and veteran consumers alike enjoy the level effects of Blue Dream, which ease you gently into a calm <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. Some Blue Dream <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> express a more indica-like look and feel, but the sativa-leaning variety remains most prevalent.</p>\n\n<p>With a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> aroma redolent of its Blueberry parent, Blue Dream delivers swift symptom relief without heavy sedative effects. This makes Blue Dream a popular daytime medicine for patients treating <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-nausea\">nausea</a>, and other ailments requiring a <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabinoids-101-what-makes-cannabis-medicine\">high THC strain</a>.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/blue-dream/primary?width=200','https://leafly.blob.core.windows.net/reviews/blue-dream_100x100_2d1b.jpg','https://leafly.blob.core.windows.net/reviews/blue-dream_100x100_66d1.jpg','https://leafly.blob.core.windows.net/reviews/blue-dream_100x100_216a.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/blue-dream/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364278/b/blue-dream__primary_8be1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363496/b/blue-dream__primary_81b0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363424/b/blue-dream__primary_1829.jpg','https://leafly.s3.amazonaws.com/strains/testing/9HJf5cEESdCdXt9h5PF0_blue-dream.png',66.4704,57.7264,57.071,53.6353,42.0002,38.3877,28.9747,28.4376,15.4091,13.0727,27.7328,11.8481,9.02841,15.4091,13.0727,'Moderate'),(26,14971,'Blue Ivy','blue-ivy','Hybrid','Ivy','<p class=\"p1\">You may have 99 problems but Blue Ivy ain&rsquo;t one. Named after the newborn child of musicians&nbsp;Jay-Z and Beyonce,&nbsp;this hybrid&#39;s effects are clearly indica-dominant and of impressive potency, with favorable blueberry undertones.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-ivy_100x100_9b3f.jpg','https://leafly.blob.core.windows.net/reviews/blue-ivy_100x100_e895.jpg','https://leafly.blob.core.windows.net/reviews/blue-ivy_100x100_fd76.jpg','https://leafly.blob.core.windows.net/reviews/blue-ivy_100x100_3bab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/283758/b/blue-ivy__primary_5f62.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/63699/b/blue-ivy_825x550_afe3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/42957/b/blue-ivy_825x550_5c07.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/37964/b/blue-ivy_825x550_038f.jpg',NULL,70.7143,58.5714,57.9464,51.4286,41.7857,52.6786,44.9107,25,25,4.375,27.0536,25,25,25,4.375,NULL),(27,7777,'Blue Diesel','blue-diesel','Hybrid','Bld','<p class=\"p1\">Daughter of indica-dominant <a href=\"http://www.leafly.com/hybrid/blueberry\"><span class=\"s1\">Blueberry</span></a> and sativa-dominant <a href=\"http://www.leafly.com/hybrid/nyc-diesel\"><span class=\"s1\">NYC Diesel</span></a>, Blue Diesel (also known as Blue City Diesel) falls on the slightly indica side with a pleasant,&nbsp;moderate to long-lasting body buzz. Thanks to its Blueberry genetics, this flower emanates a light berry aroma that is smooth, expansive, and fast-acting. This strain is optimal for daytime&nbsp;and comes with little to no fatigue or increased appetite, making it a desirable option for medical marijuana patients. Originally produced by Breeder&rsquo;s Choice, this plant may provide just the relaxation you need.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-diesel_100x100_71b6.jpg','https://leafly.blob.core.windows.net/reviews/blue-diesel_100x100_4747.jpg','https://leafly.blob.core.windows.net/reviews/blue-diesel_100x100_256a.jpg','https://leafly.blob.core.windows.net/reviews/blue-diesel_100x100_1c91.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364396/b/blue-diesel__primary_b8a4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352733/b/blue-diesel__primary_a8e0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350668/b/blue-diesel__primary_7af0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350638/b/blue-diesel__primary_1a46.jpg',NULL,56.6085,55.7818,46.7901,43.9142,32.9164,39.3826,38.2198,29.6307,18.0498,14.4684,29.1395,12.7243,9.70321,18.0498,14.4684,NULL),(28,2278,'Blue Mystic','blue-mystic','Hybrid','Bm','<p class=\"p1\">Blue Mystic is as mysterious as its name indicates, with unknown genetics that definitely contain some Blueberry and possibly some Skunk or Northern Lights. These plants flower between 7 to 9 weeks, with light blue coloring that can make the trichome-covered buds look almost gray. It does have the distinctive Blueberry aroma, but it&rsquo;s fairly subtle compared to other strains, making it a good choice for growers or patients who need discretion. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-mystic_100x100_3d69.jpg','https://leafly.blob.core.windows.net/reviews/blue-mystic_100x100_5175.jpg','https://leafly.blob.core.windows.net/reviews/blue-mystic_100x100_9062.jpg','https://leafly.blob.core.windows.net/reviews/blue-mystic_100x100_a25b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355168/b/blue-mystic__primary_04b9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352364/b/blue-mystic__primary_339b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352428/b/blue-mystic__primary_25a5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349813/b/blue-mystic__primary_3c99.jpg',NULL,51.2586,46.5807,45.4444,44.251,34.3903,42.0923,41.7074,33.8567,21.1205,16.461,42.2756,14.9967,14.9051,21.1205,16.461,NULL),(29,166319,'Blue Afghani','blue-afghani','Indica','Baf','<p>Bred by Jordan of the Islands in Canada, Blue Afghani is an indica-dominant strain that combines genetics from <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"http://leafly.com/indica/afghani\">Afghani</a>. Its stout plants produce dense, resinous buds that fill your nose with a sweet and spicy berry aroma. Next come the powerful full-body effects that keep you anchored in relaxation while pain, anxiety, and stress float away.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-afghani_100x100_4be6.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353103/b/blue-afghani__primary_b950.jpg',NULL,NULL,NULL,NULL,75,50,50,25,25,50,25,25,25,25,50,50,25,25,25,NULL),(30,210,'Pineapple Express','pineapple-express','Hybrid','Pex','<p>Pineapple Express was bred by G13 labs and is the child of <a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> and <a href=\"http://www.leafly.com/sativa/hawaiian\">Hawaiian</a>. The smell has been likened to fresh apple and mango, with a taste of pineapple, pine and cedar. This hard-hitting sativa provides an energetic high up to 2 hours and has a THC content up to 17% with CBD of 0.17%. Pineapple Express is a marijuana strain with light green buds that are dense with thick resin.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/pineapple-express/primary?width=200','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_0868.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_91ab.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_182b.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/pineapple-express/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364875/b/pineapple-express__primary_7376.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364405/b/pineapple-express__primary_6f70.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363517/b/pineapple-express__primary_9c88.jpg',NULL,80.6027,59.5691,58.8221,53.8089,47.7211,37.8567,29.5713,22.178,14.7958,13.1648,28.4675,12.6351,8.98229,14.7958,13.1648,'Moderate'),(31,164879,'Blue Velvet','blue-velvet','Hybrid','Bv','<p>Blue Velvet, also known as Blueberry Thai, is a 50/50 hybrid strain that is named for the lush appearance of its plants. Bred by DJ Short, Blue Velvet is a cross between <a href=\"https://www.leafly.com/sativa/purple-thai\">Purple Thai</a> and <a href=\"http://leafly.com/indica/afghani\">Afghani</a>. Its long branches bloom with large red-purple buds that take on a sweet fruity and floral aroma. Invigorating euphoria blankets the mind while the body finds light relaxation, and its functional effects make it easy to either explore creativity or socialize with friends.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/5/240?color=fcc91d',NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,16.6667,16.6667,16.6667,16.6667,16.6667,16.6667,16.6667,16.6667,16.6667,NULL,NULL,NULL,NULL,16.6667,NULL,NULL),(32,129519,'Blue Knight','blue-knight','Indica','Bkn','<p>Blue Knight is a rare <a href=\"http://leafly.com/indica\">indica</a>-dominant strain with a noble lineage that stems from <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"http://www.leafly.com/indica/kryptonite\">Kryptonite</a> genetics. Hues of royal purple twist with deep blues and vivid greens in a visual display as multifaceted as its <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-vanilla\">vanilla</a> aroma. <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">Earthy</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-woody\">woody</a>, and <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberry</a> flavors are unleashed on the exhale, and the <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> full-body effects that follow are often enough to soothe <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-lack-of-appetite\">stimulate the appetite</a>. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-knight_100x100_9704.jpg','https://leafly.blob.core.windows.net/reviews/blue-knight_100x100_381b.jpg','https://leafly.blob.core.windows.net/reviews/blue-knight_100x100_46e8.jpg','https://leafly.blob.core.windows.net/reviews/blue-knight_100x100_e76d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338216/b/blue-knight__primary_3d58.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326220/b/blue-knight__primary_6376.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323813/b/blue-knight__primary_a28c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311953/b/blue-knight__primary_7f1a.jpg',NULL,76.4881,54.9107,37.5,36.9048,34.0774,37.5,32.2917,31.25,29.1667,19.7917,12.5,8.33333,3.125,29.1667,19.7917,NULL),(33,392,'Blueberry Headband','blueberry-headband','Hybrid','Bh','<p>Blueberry Headband is a hybrid marijuana strain that&#39;s, quite appropriately, a cross between&nbsp;<a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"http://www.leafly.com/hybrid/headband\">Headband</a>. True to its name, this strain has&nbsp;a sweet blueberry taste and smell.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-headband_100x100_bcfd.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-headband_100x100_042c.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-headband_100x100_214f.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-headband_100x100_2177.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361418/b/blueberry-headband__primary_5205.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361386/b/blueberry-headband__primary_e2d4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361354/b/blueberry-headband__primary_0331.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349355/b/blueberry-headband__primary_42e6.jpg',NULL,74.7522,66.629,64.2372,64.1133,41.7475,67.0653,57.4122,55.8393,32.7677,28.6846,58.2741,33.5919,29.8265,32.7677,28.6846,NULL),(34,219,'Blue Train','blue-train','Hybrid','Bt','<p>Imagine a train full of blueberries smashing into your face and that pretty much describes Blue Train. &nbsp;A cross of two great strains,&nbsp;<a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> and <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a>,&nbsp;this strain provides pleasant head effects that are sure to lift your mood.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-train_100x100_bb5f.jpg','https://leafly.blob.core.windows.net/reviews/blue-train_100x100_f586.jpg','https://leafly.blob.core.windows.net/reviews/blue-train_100x100_c45d.jpg','https://leafly.blob.core.windows.net/reviews/blue-train_100x100_0b6d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349077/b/blue-train__primary_9a13.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/302251/b/blue-train__primary_bdbb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/36050/b/blue-train_825x550_e252.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/36049/b/blue-train_825x550_02d8.jpg',NULL,81.7308,73.8248,73.7179,65.812,64.4231,60.2564,45.2991,36.5385,17.735,16.3462,50.7479,23.6111,22.2222,17.735,16.3462,NULL),(35,142095,'Blue Cookies','blue-cookies','Hybrid','Bco','<p>Blue Cookies is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant <a href=\"http://www.leafly.com/explore/category-hybrid\">hybrid</a> cross between two celebrity strains, <a href=\"http://www.leafly.com/hybrid/girl-scout-cookie\">Girl Scout Cookies</a> and <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a>. As the child of these heavyweight champion strains, Blue Cookies delivers a crushing blow of <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoria</a> straight to the head, where it swiftly sinks down to <a href=\"http://www.leafly.com/explore/tags-relaxed\">relax</a> the entire body. <a href=\"http://www.leafly.com/explore/flavors-sweet\">Sweet</a> <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> flavors fuse with <a href=\"http://www.leafly.com/explore/flavors-earthy\">earthy</a> cherry notes in a flavor profile as enticing as the bud&rsquo;s thick coat of frosty resin that stretches over twisting hues of green and purple. Novice consumers should approach Blue Cookies with modesty, but this strain&rsquo;s potency is perfect for hard-to-impress veterans. You may also come across another variation of Blue Cookies, a select Girl Scout Cookies <a href=\"http://www.leafly.com/news/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> that lacks the Blueberry genetics.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-cookies_100x100_49ad.jpg','https://leafly.blob.core.windows.net/reviews/blue-cookies_100x100_0202.jpg','https://leafly.blob.core.windows.net/reviews/blue-cookies_100x100_412b.jpg','https://leafly.blob.core.windows.net/reviews/blue-cookies_100x100_4cb4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364970/b/blue-cookies__primary_c053.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364907/b/blue-cookies__primary_07c2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362604/b/blue-cookies__primary_7423.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353148/b/blue-cookies__primary_126c.jpg',NULL,53.0909,33.0909,28.5455,25.0909,16.5455,25.6364,21.6364,21.0909,17.0909,12.5455,16.5455,12,8.54545,17.0909,12.5455,NULL),(36,155922,'Blue Alien','blue-alien','Indica','Ba','<p>Blue Alien is a powerful, sweet-smelling <a href=\"http://www.leafly.com/explore/category-indica\">indica</a> stain that combines genetics from <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"https://www.leafly.com/indica/alien-kush\">Alien Kush</a>. Like most Blueberry hybrids, Blue Alien takes on a sweet <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> aroma that introduces its dreamy <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoria</a> and full-body calm. Because its effects tend toward the <a href=\"http://www.leafly.com/explore/tags-sleepy\">sleepier</a> side of the spectrum, most consumers prefer Blue Alien in the evening and when pursuing a good night&rsquo;s sleep.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-alien_100x100_c6c2.jpg','https://leafly.blob.core.windows.net/reviews/blue-alien_100x100_97ae.jpg',NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335361/b/blue-alien__primary_91f8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335408/b/blue-alien__primary_983f.jpg',NULL,NULL,NULL,16.6667,16.6667,16.6667,16.6667,NULL,16.6667,16.6667,16.6667,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,115856,'Blue Hash','blue-hash','Hybrid','Bhs','<p>The colorful hues and <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> flavors of <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> blend together with the resin production and heartiness of California <a href=\"http://www.leafly.com/indica/hash-plant\">Hashplant</a> to create Blue Hash, or Blueberry Hash. The aroma is a mixture of fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berries</a> with a <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> finish. Blue Hash produces a powerfully <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> effect that is a great way to unwind at the end of a long day or at night before bedtime. Medical patients will appreciate Blue Hash&rsquo;s ability to combat <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">insomnia</a> and suppress <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-hash_100x100_cb98.jpg','https://leafly.blob.core.windows.net/reviews/blue-hash_100x100_349b.jpg','https://leafly.blob.core.windows.net/reviews/blue-hash_100x100_efe0.jpg','https://leafly.blob.core.windows.net/reviews/blue-hash_100x100_2887.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/322410/b/blue-hash__primary_1bad.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/310732/b/blue-hash__primary_c5e0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/305623/b/blue-hash__primary_a19b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/263181/b/blue-hash__primary_9ca4.jpg',NULL,73.1731,50.0962,43.8462,41.9231,37.7885,46.4423,38.75,36.3462,32.5,31.5385,30.0962,20,20,32.5,31.5385,'Moderate'),(38,133,'Blueberry','blueberry','Indica','Bry','<p>A true A-List cannabis strain. Blueberry&rsquo;s legendary status soared to new heights after claiming the <em>High Times&rsquo;</em> Cannabis Cup 2000 for Best <a href=\"http://www.leafly.com/indica\">Indica</a>. The long history of the stain is traced back to the late 1970s when American breeder DJ Short was working with a variety of exotic <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace strains</a>. However, throughout the decades of Blueberry&rsquo;s cultivation the genetics have been passed around, due in large part to DJ Short working with multiple seed banks and breeders. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> flavors of fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberries</a> combine with <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> effects to produce a long-lasting sense of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. Many medical patients appreciate Blueberry for its ability to suppress <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> and relieve <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>, while connoisseurs and growers admire the strain for its colorful hues and high <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabinoids-101-what-makes-cannabis-medicine\">THC content</a>.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry_100x100_807c.jpg','https://leafly.blob.core.windows.net/reviews/blueberry_100x100_c726.jpg','https://leafly.blob.core.windows.net/reviews/blueberry_100x100_51c5.jpg','https://leafly.blob.core.windows.net/reviews/blueberry_100x100_7b49.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363987/b/blueberry__primary_2308.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363798/b/blueberry__primary_a45b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357964/b/blueberry__primary_4f11.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355915/b/blueberry__primary_d6fe.jpg',NULL,82.5181,71.0327,60.1023,45.5704,38.2848,45.8049,38.3382,32.4269,31.0898,16.2942,30.0326,11.3123,10.0462,31.0898,16.2942,NULL),(39,126096,'Blueberry Yum Yum','blueberry-yum-yum','Hybrid','Byy','<p>Blueberry Yum Yum is a <a href=\"http://leafly.com/hybrid\">hybrid</a> strain whose popularity was ushered in by rap artist Ludacris and his song centered on the strain. While certainly the progeny of the famed <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> indica, its other parent is suspected to have been a <a href=\"http://leafly.com/sativa/durban-poison\">Durban Poison</a> sativa. Because of its parents&rsquo; polarity, Blueberry Yum Yum can express a wide spectrum of effects, but consumers typically report <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a> effects perfect for any time of the day. Though dominated by an unmistakable <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberry</a> aroma, accents of <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-minty\">mint</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> can also be detected on the palate.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-yum-yum_100x100_13df.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-yum-yum_100x100_c4b8.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-yum-yum_100x100_0a9d.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-yum-yum_100x100_87bf.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323802/b/blueberry-yum-yum__primary_e093.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/321999/b/blueberry-yum-yum__primary_cfee.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311310/b/blueberry-yum-yum__primary_97b3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/297747/b/blueberry-yum-yum__primary_db27.jpg',NULL,65.9239,61.0517,60.3684,48.6037,41.2805,67.038,56.2537,55.6001,49.391,38.5027,55.1693,28.0749,28.0749,49.391,38.5027,NULL),(40,159792,'Blue Wreck','blue-wreck','Hybrid','Bwk','<p><span style=\"line-height: 20.7999992370605px;\">Blue Wreck, also called Blueberry Trainwreck, is a hybrid strain primarily led by its sativa influence.</span> A cross between <a href=\"https://www.leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"https://www.leafly.com/hybrid/trainwreck\">Trainwreck</a>, Blue Wreck&rsquo;s flavor is a complex mix of sweet berry, sour fruit, and tangy skunk. Its effects are typically described as clear-headed and active, with a burst of calm euphoria that can help you maintain a positive outlook throughout the day.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.7/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-wreck_100x100_ddcd.jpg','https://leafly.blob.core.windows.net/reviews/blue-wreck_100x100_5bfc.jpg','https://leafly.blob.core.windows.net/reviews/blue-wreck_100x100_8c93.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352994/b/blue-wreck__primary_41c8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338861/b/blue-wreck__primary_158b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338860/b/blue-wreck__primary_411a.jpg',NULL,NULL,66.6667,58.3333,44.0476,44.0476,42.8571,36.9048,22.619,22.619,22.619,21.4286,30.9524,15.4762,14.2857,22.619,21.4286,NULL),(41,1080,'Blueberry Cheesecake','blueberry-cheesecake','Hybrid','Bbc','<p>With a smell distinctly of blueberry cheesecake, this strain was bred from Blueberry and Big Buddha Cheese. Flowers are known to be lime green and dark violet in color with orange hairs and a large coat of crystals.&#160;</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-cheesecake_100x100_e80a.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-cheesecake_100x100_b9e1.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-cheesecake_100x100_a156.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-cheesecake_100x100_29d7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349103/b/blueberry-cheesecake__primary_7471.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/329492/b/blueberry-cheesecake__primary_c4ea.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/286635/b/blueberry-cheesecake__primary_7d7d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/283531/b/blueberry-cheesecake__primary_166b.jpg',NULL,67.8746,56.1639,39.7726,37.602,31.1522,49.4682,29.0836,24.2174,17.4716,16.714,23.214,13.1271,9.27926,17.4716,16.714,NULL),(42,109776,'Blue Heron','blue-heron','Hybrid','Bhn','<p>Blue Heron is an <a href=\"http://leafly.com/indica\">indica</a>-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> bred by Dynasty Seeds that brings <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a>&nbsp;flight to both mind and body. Parented by <a href=\"http://www.leafly.com/hybrid/blue-magoo\">Blue Magoo</a> and <a href=\"http://www.leafly.com/hybrid/huckleberry\">Huckleberry</a>, Blue Heron takes after its Blue Magoo mother in its structure and <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberry</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-rose\">rose</a>, and&nbsp;<a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> aroma. Between 8 and 9 weeks of flowering, Blue Heron buds finish with dark, deep hues of blue and green.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.7/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-heron_100x100_e2a2.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/305292/b/blue-heron__primary_0bb2.jpg',NULL,NULL,NULL,NULL,40,20,20,NULL,NULL,20,20,20,NULL,NULL,20,20,20,NULL,NULL,NULL),(43,97007,'Blues','blues','Hybrid','Bls','<p>Blues, also known as &ldquo;Livers,&rdquo; is a famous <a href=\"http://leafly.com/hybrid\">hybrid</a> strain in the U.K. Its origins are a well-kept secret, but many speculate Blues to be a unique <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> of Sensi Seeds&rsquo; <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk #1</a> from the 80&rsquo;s. Those who have chanced upon this mysterious clone-only strain describe its effects as uplifting, long-lasting, and clear-headed. Blues plants are strong and resilient, growing large buds that give off a sweet berry aroma.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blues_100x100_1d9d.jpg','https://leafly.blob.core.windows.net/reviews/blues_100x100_57d4.jpg',NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347755/b/blues__primary_dc7f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/234156/b/blues__primary_ab74.jpg',NULL,NULL,NULL,75,66.6667,58.3333,58.3333,33.3333,33.3333,33.3333,33.3333,25,25,33.3333,25,25,25,25,NULL),(44,65361,'Blue Diamond','blue-diamond','Hybrid','Bdd','<p class=\"p1\">Blue Diamond is a sativa-leaning hybrid of Diamond OG and <a href=\"http://www.leafly.com/hybrid/blue-dream\"><span class=\"s1\">Blue Dream</span></a> with strong stress-relieving effects. Its OG genetics lend Blue Diamond a dense, compact bud structure while its cerebrally uplifting effects come from the Blue Dream parent. A sweet and hashy aroma reminiscent of blueberry rises from the flowers as you inhale, an experience quickly followed by physical and mental relaxation.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-diamond_100x100_c702.jpg','https://leafly.blob.core.windows.net/reviews/blue-diamond_100x100_aee1.jpg','https://leafly.blob.core.windows.net/reviews/blue-diamond_100x100_44fe.jpg','https://leafly.blob.core.windows.net/reviews/blue-diamond_100x100_d0ac.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350288/b/blue-diamond__primary_b704.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348655/b/blue-diamond__primary_e844.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342347/b/blue-diamond__primary_ab79.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/307501/b/blue-diamond__primary_396c.jpg',NULL,78.8211,68.374,58.9431,44.3902,38.0894,23.4146,15.6504,14.878,14.7561,6.54472,18.2114,10.6504,5.77236,14.7561,6.54472,NULL),(45,147090,'Blue Kripple','blue-kripple','Indica','Bkr','<p>Blue Kripple is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant <a href=\"http://www.leafly.com/explore/category-hybrid\">hybrid</a> bred by Dr. Krippling. This strain brings together the <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxing</a>, therapeutic properties of <a href=\"http://www.leafly.com/hybrid/medicine-man\">Medicine Man</a> and <a href=\"http://www.leafly.com/hybrid/blue-rhino\">Blue Rhino</a>, while the influence of <a href=\"http://www.leafly.com/indica/big-bud\">Big Bud</a> enhances Blue Kripple with dense, oversized <a href=\"http://www.leafly.com/news/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">colas</a> and large yields. The calming indica effects cradle you with full-body relaxation and encourage nighttime use for <a href=\"http://www.leafly.com/explore/symptoms-stress\">stress</a>, <a href=\"http://www.leafly.com/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore/symptoms-insomnia\">insomnia</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3/240?color=fcc91d',NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,207,'Blue Dragon','blue-dragon','Hybrid','Bdr','<p>Blue Dragon is usually so dark purple that it looks black. &nbsp;This weed has aromatic hints of fruity pebbles and grapes.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-dragon_100x100_0531.jpg','https://leafly.blob.core.windows.net/reviews/blue-dragon_100x100_c3c5.jpg','https://leafly.blob.core.windows.net/reviews/blue-dragon_100x100_5ce0.jpg','https://leafly.blob.core.windows.net/reviews/blue-dragon_100x100_8602.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354349/b/blue-dragon__primary_2993.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/294413/b/blue-dragon__primary_fcb9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/247914/b/blue-dragon__primary_c750.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/221748/b/blue-dragon__primary_2186.jpg',NULL,69.6346,59.1667,58.3512,57.1346,38.6185,51.8717,35.3788,30.2897,26.9296,24.1132,20.1025,15.2317,14.5187,26.9296,24.1132,NULL),(47,881,'Blue Crack','blue-crack','Hybrid','Brc','<p class=\"p1\">This sativa-dominant hybrid takes after its iconic parents, 50/50 hybrid <a href=\"http://www.leafly.com/hybrid/blue-dream\"><span class=\"s1\">Blue Dream</span></a> and classic sativa <a href=\"http://www.leafly.com/sativa/green-crack\"><span class=\"s1\">Green Crack</span></a>. Blue Crack reflects a balanced blend of its parents, with an energetic head rush from the Green that is mellowed out and mentally expansive thanks to the Blue, proposing an apt rename of &lsquo;Turquoise&rsquo;. Although dense by appearance, this flower yields soft, airy buds and a sweet, smooth aroma with blueberry undertones. As a high-energy strain with moderate to long-lasting effects, Blue Crack is a popular choice for daytime medicating.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-crack_100x100_4da0.jpg','https://leafly.blob.core.windows.net/reviews/blue-crack_100x100_dece.jpg','https://leafly.blob.core.windows.net/reviews/blue-crack_100x100_ff43.jpg','https://leafly.blob.core.windows.net/reviews/blue-crack_100x100_26f4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354841/b/blue-crack__primary_be71.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323279/b/blue-crack__primary_ecca.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/317002/b/blue-crack__primary_b152.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/312464/b/blue-crack__primary_1f43.jpg',NULL,71.3745,68.2089,64.1504,51.1093,50.9199,31.4935,25.2164,15.855,12.4188,12.1483,19.724,13.2576,9.38853,12.4188,12.1483,NULL),(48,133679,'Disney Blue','disney-blue','Hybrid','Dis','<p>Disney Blue is a mood-lifting <a href=\"http://leafly.com/hybrid\">hybrid</a> strain appropriately named after the &ldquo;happiest place on earth.&rdquo; Bred in Temecula, CA by Greenleaf Genetics Collective, Disney Blue inherits the <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> aroma of <a href=\"http://www.leafly.com/indica/dj-short-blueberry\">DJ Short Blueberry</a> and the blissful, <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects of a <a href=\"http://leafly.com/hybrid/blueberry\">Blue Dream</a> parent sourced from Oaksterdam University. With an intensely flavorful burst of <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruit</a> and&nbsp;<a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry/\">blueberry</a>, this hybrid awakens <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happiness</a> in the mind and tranquility throughout the body.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/disney-blue_100x100_2f9f.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347600/b/disney-blue__primary_cb28.jpg',NULL,NULL,NULL,NULL,150,100,100,50,50,100,100,100,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,59473,'Blue Magoo','blue-magoo','Hybrid','Bmg','<p>Blue Magoo, not to be confused with its lookalike <a href=\"http://www.leafly.com/hybrid/blue-goo\">Blue Goo</a>, is a clone-only hybrid cross between <a href=\"http://www.leafly.com/indica/dj-short-blueberry\">DJ Short Blueberry</a> and Major League Bud (also known as <a href=\"http://www.leafly.com/hybrid/willys-wonder\">William&rsquo;s Wonder</a> F2). A fusion of berry, fruit, and other floral notes make up the aroma and taste of Blue Magoo, resulting in a palate as colorful as its pastel purple and green buds. Blue Magoo is a favorite among patients as it combats a variety of symptoms including pain, nausea, insomnia, anxiety, and appetite loss. This strain delivers a slight sativa kick that helps alleviate the heavy weight of Blue Magoo&rsquo;s indica effects.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-magoo_100x100_86e0.jpg','https://leafly.blob.core.windows.net/reviews/blue-magoo_100x100_af39.jpg','https://leafly.blob.core.windows.net/reviews/blue-magoo_100x100_d72e.jpg','https://leafly.blob.core.windows.net/reviews/blue-magoo_100x100_2268.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358955/b/blue-magoo__primary_d3be.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347082/b/blue-magoo__primary_eef7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339572/b/blue-magoo__primary_8ab5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339571/b/blue-magoo__primary_ac14.jpg',NULL,77.0427,63.467,56.4247,47.6139,45.9862,43.3885,42.5965,41.9801,27.6868,27.4477,21.7194,17.0157,15.7017,27.6868,27.4477,NULL),(50,120815,'Blue Monster','blue-monster','Indica','Bmo','<p>Blue Monster is a powerful combination of <a href=\"http://www.leafly.com/indica/g-13\">G13</a>, <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a>, <a href=\"http://www.leafly.com/hybrid/northern-lights--5\">Northern Lights #5</a>, and a <a href=\"http://www.leafly.com/sativa/mexican\">Mexican</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace</a> strain. Bred by Goldenseed, Blue Monster combines a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> mix of flavors with strong <a href=\"http://www.leafly.com/indica\">indica</a> effects. Its complex aroma of <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berries</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruits</a> exposes the influence of Blueberry and G13 genetics. When grown to its full potential, the forceful <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> of Blue Monster can overwhelm novices with its immediate body sedation and commanding cerebral effects. This monster indica is sure to scare away <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">sleepless nights</a> and body <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pains</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.7/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-monster_100x100_150c.jpg','https://leafly.blob.core.windows.net/reviews/blue-monster_100x100_d649.jpg','https://leafly.blob.core.windows.net/reviews/blue-monster_100x100_e275.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/314347/b/blue-monster__primary_462e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/258123/b/blue-monster__primary_1bdb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/255260/b/blue-monster__primary_90d1.jpg',NULL,NULL,73.3333,53.3333,53.3333,36.6667,20,36.6667,36.6667,33.3333,16.6667,NULL,20,NULL,NULL,16.6667,NULL,NULL),(51,112240,'Blue Kush','blue-kush','Hybrid','Bku','<p>Blue Kush, a <a href=\"http://www.leafly.com/sativa\">sativa</a>-dominant <a href=\"http://www.leafly.com/hybrid\">hybrid</a>, combines the <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> flavors of <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> with the powerful and <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>. With hints of <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a>, and berries, Dinafem Seeds has created a treat for all of the senses. The effects are reported as cerebral, <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, and will leave you feeling anything but blue.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-kush_100x100_afac.jpg','https://leafly.blob.core.windows.net/reviews/blue-kush_100x100_831a.jpg','https://leafly.blob.core.windows.net/reviews/blue-kush_100x100_66c8.jpg','https://leafly.blob.core.windows.net/reviews/blue-kush_100x100_72de.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357101/b/blue-kush__primary_bd7f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/318477/b/blue-kush__primary_1aad.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/318059/b/blue-kush__primary_5272.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/315373/b/blue-kush__primary_7f0b.jpg',NULL,52.1008,43.2773,37.8151,37.395,34.874,27.3109,27.3109,17.2269,17.2269,7.14286,17.2269,10.084,7.14286,17.2269,7.14286,'Easy'),(52,4064,'Blue OG','blue-og','Hybrid','Blg','<p>Blue OG from G13 Labs is a flavorful hybrid following the lineage of <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> F3, <a href=\"http://www.leafly.com/indica/blue-moonshine\">Blue Moonshine</a>, and <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>. These dark, cone-shaped buds characteristic of OG genes emanate notes of berry and citrus, and leave its consumer feeling euphoric and relaxed. Though its effects are cerebrally targeted, Blue OG is known to also tackle pain, relax muscles, and relieve nausea. Growers can expect an eight week flowering period with ideal conditions outdoors.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-og_100x100_ede8.jpg','https://leafly.blob.core.windows.net/reviews/blue-og_100x100_baf9.jpg','https://leafly.blob.core.windows.net/reviews/blue-og_100x100_0729.jpg','https://leafly.blob.core.windows.net/reviews/blue-og_100x100_a5d1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351507/b/blue-og__primary_9b2e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344440/b/blue-og__primary_1bb3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336749/b/blue-og__primary_a6e2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336746/b/blue-og__primary_da75.jpg',NULL,79.9708,61.6572,53.6464,52.838,41.6882,62.1646,51.677,48.5767,34.49,32.8646,44.1649,28.6077,14.5554,34.49,32.8646,NULL),(53,956,'Blue Goo','blue-goo','Hybrid','Bgo','<p class=\"p1\">Blue&nbsp;Goo is a sativa-dominant marijuana hybrid that&#39;s&nbsp;a cross between the famous hybrid <a href=\"http://www.leafly.com/hybrid/blue-dream\"><span class=\"s1\">Blue Dream</span></a> and indica <a href=\"http://www.leafly.com/indica/afgoo\"><span class=\"s1\">Afgoo</span></a>. A moderate to high potency yields uplifting effects that are standard for sativas, but not excessively energetic thanks to Afgoo&rsquo;s contribution as well as the mellow nature of Blue Dream. This strain is appropriate for day or nighttime consumption&nbsp;and is good for treating depression and nausea.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-goo_100x100_9f6b.jpg','https://leafly.blob.core.windows.net/reviews/blue-goo_100x100_e4ac.jpg','https://leafly.blob.core.windows.net/reviews/blue-goo_100x100_26b1.jpg','https://leafly.blob.core.windows.net/reviews/blue-goo_100x100_5b5e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/324877/b/blue-goo__primary_8bc2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/288334/b/blue-goo__primary_619f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/288176/b/blue-goo__primary_4675.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/228075/b/blue-goo__primary_a12d.jpg',NULL,74.1656,63.2788,59.745,57.3248,55.1525,45.7008,32.0378,24.1373,15.026,13.4387,19.0131,9.48773,6.91856,15.026,13.4387,NULL),(54,11125,'Blue Lights','blue-lights','Hybrid','Blt','<p>The fusion of two eminent strains, hybrid <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a> and indica <a href=\"http://www.leafly.com/indica/northern-lights\">Northern Lights</a>, birthed Blue Lights, an indica-dominant hybrid with a noteworthy THC content. This flower emits a blueberry pungency thanks to the Blue Dream influence, and provides a combination of sedative and euphoric long-lasting effects. Although fitting for day or nighttime use, this strain may be the perfect choice for end of the day stress and/or pain relief.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-lights_100x100_b387.jpg','https://leafly.blob.core.windows.net/reviews/blue-lights_100x100_f2f5.jpg','https://leafly.blob.core.windows.net/reviews/blue-lights_100x100_9344.jpg','https://leafly.blob.core.windows.net/reviews/blue-lights_100x100_f1df.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330218/b/blue-lights__primary_1657.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/318186/b/blue-lights__primary_2370.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/247595/b/blue-lights__primary_a257.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/154634/b/blue-lights_825x550_fb3d.jpg',NULL,92.5,81.6667,78.3333,78.3333,56.6667,19.1667,5,1.66667,1.66667,1.66667,3.33333,1.66667,NULL,1.66667,1.66667,NULL),(55,121615,'Alpine Blue','alpine-blue','Hybrid','Apb','<p>Alpine Blue is a 60/40 <a href=\"http://leafly,com/sativa\">sativa</a>-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> that combines <a href=\"http://www.leafly.com/hybrid/blue-mystic\">Blue Mystic</a> and <a href=\"http://www.leafly.com/sativa/power-plant\">Power Plant</a>, who pass on <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> effects alongside a complex aroma of <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberry</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-woody\">woody</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a>. While some <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> tend toward the <a href=\"http://leafly.com/indica\">indica</a> side of the spectrum, even its common sativa expression induces calming full-body effects. Patients typically look to Alpine Blue for daytime relief of <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">mood disorders</a>, <a href=\"http://www.leafly.com/explore#!/explore/conditions-gastrointestinal-disorder\">gastrointestinal pain</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-inflammation\">inflammation</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/alpine-blue_100x100_2747.jpg','https://leafly.blob.core.windows.net/reviews/alpine-blue_100x100_d1e4.jpg','https://leafly.blob.core.windows.net/reviews/alpine-blue_100x100_9f87.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/252245/b/alpine-blue__primary_2091.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/241258/b/alpine-blue__primary_7ff8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/235338/b/alpine-blue__primary_ca89.jpg',NULL,NULL,75,75,75,50,50,75,75,75,75,75,50,50,50,75,75,NULL),(56,154514,'Blue Magic','blue-magic','Sativa','Bmc','<p>Blue Magic is an upbeat <a href=\"http://www.leafly.com/explore/category-sativa\">sativa</a>-dominant strain bred from the famous <a href=\"http://leafly.com/hybrid/blue-dream\">Blue Dream</a>. Its <a href=\"http://www.leafly.com/explore/tags-energetic\">high-energy</a> effects are prefaced by creamy, <a href=\"http://www.leafly.com/explore/flavors-tree-fruit\">fruity</a> flavors reminiscent of its <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> ancestry. Sativa enthusiasts will appreciate the balance of potency and clarity delivered by Blue Magic, whose <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoria</a> offers functionality and <a href=\"http://www.leafly.com/explore/tags-focused\">focus</a> despite an impressive THC profile. While its initial punch is quick to hit, Blue Magic&rsquo;s effects taper down gently and ease you into long-lasting <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxation</a> that extends from the physical exterior to the deep recesses of your mind.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-magic_100x100_205c.jpg','https://leafly.blob.core.windows.net/reviews/blue-magic_100x100_4d5d.jpg',NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347413/b/blue-magic__primary_4bc0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/324694/b/blue-magic__primary_3327.jpg',NULL,NULL,NULL,58.3333,41.6667,33.3333,33.3333,33.3333,8.33333,8.33333,8.33333,8.33333,8.33333,8.33333,8.33333,8.33333,8.33333,8.33333,NULL),(57,63823,'Blue God','blue-god','Indica','Bgd','<p>Blue God, bred by Jordan of the Islands in Canada, is a powerful indica mothered by <a href=\"http://www.leafly.com/indica/god-bud\">God Bud</a> and <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a>. Fulfilling all of our indica expectations, Blue God produces crushing full-body effects ideal for nighttime treatment of pain and sleep disorders. With age, Blue God develops a sweet berry aroma and deep purple leaves freckled in frosty resin. Cultivators of this stout indica suggest growing Blue God as a multi-branch plant in soil, with a flowering period between 55 and 60 days.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-god_100x100_bbfe.jpg','https://leafly.blob.core.windows.net/reviews/blue-god_100x100_cbcb.jpg','https://leafly.blob.core.windows.net/reviews/blue-god_100x100_2224.jpg','https://leafly.blob.core.windows.net/reviews/blue-god_100x100_5fc4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356832/b/blue-god__primary_69e7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353203/b/blue-god__primary_f584.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/304096/b/blue-god__primary_c049.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/265588/b/blue-god__primary_97e1.jpg',NULL,91.9048,66.8095,65.6667,50.9524,25.5238,61.2381,60.8095,47.7143,19.9048,19.8571,27.0476,15.0952,14.2857,19.9048,19.8571,NULL),(58,156079,'Blue Persuasion','blue-persuasion','Hybrid','Bpr','<p>Blue Persuasion is&nbsp;the first of a Signature Series by BUDS Pasco, an indoor hydroponic farm in Washington. It is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant hybrid&nbsp;strain composed of <a href=\"https://www.leafly.com/indica/blueberry\">Blueberry</a>, <a href=\"https://www.leafly.com/indica/northern-lights\">Northern Lights</a>, and <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a> genetics. From Blueberry, Blue Persuasion inherits sweet <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> flavors, <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxing</a> and long-lasting <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoria</a>, and a high THC potential. Its Northern Lights parent is cherished for its resinous buds, fast flowering, and resilience during growth, while White Widow contributes a tendency for heavy resin production and balanced hybrid effects. With a THC content that can stretch to 26%, Blue Persuasion is best saved for late night relaxation and introspection.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d',NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,33.3333,33.3333,33.3333,33.3333,16.6667,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,128015,'Alpha Blue','alpha-blue','Sativa','Abl','<p>Alpha Blue, also known as Dream Diesel (or DD), is a high-flying <a href=\"http://www.leafly.com/sativa\">sativa</a> that combines <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a> and <a href=\"http://www.leafly.com/hybrid/nyc-diesel\">NYC&nbsp;Diesel</a>. In 2011 this compelling blend claimed two 2nd place prizes for a sativa at the <em>High Times&rsquo;</em> Medical Cup in Denver and San Francisco. Its buds are glazed with sugary <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a> and take on hues of deep red and violet. The aroma is a combination of tart <a href=\"http://www.leafly.com/explore#!/explore/flavors-blueberry\">blueberry</a> and sour candy that create a <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> mixture of <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> and <a href=\"http://www.leafly.com/sativa/haze\">Haze</a> upon exhale. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> fragrance of Alpha Blue brings with it <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects that produce a calming, <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a> mood without putting you to <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleep</a>. The cerebral and <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a> buzz is a great tool when coping with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> and <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/alpha-blue_100x100_5803.jpg','https://leafly.blob.core.windows.net/reviews/alpha-blue_100x100_4b4a.jpg','https://leafly.blob.core.windows.net/reviews/alpha-blue_100x100_665e.jpg','https://leafly.blob.core.windows.net/reviews/alpha-blue_100x100_0c33.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341315/b/alpha-blue__primary_d8be.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338419/b/alpha-blue__primary_249f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/337579/b/alpha-blue__primary_f240.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331083/b/alpha-blue__primary_83e9.jpg',NULL,77.5,58.75,52.5,48.75,48.75,28.75,16.25,10,6.25,6.25,28.75,16.25,6.25,6.25,6.25,NULL),(60,259,'Blue Satellite','blue-satellite','Sativa','Blu','<p>Blue Satellite, the sativa offspring of Blueberry Sativa and <a href=\"http://www.leafly.com/hybrid/shishkaberry\">Shishkaberry</a>, is a strongly psychoactive strain with long-lasting effects. The dense, conic buds carry a sour scent redolent of ammonia and induce powerful cerebral effects including euphoria, creativity, and stress relief. Its typically high THC content makes Blue Satellite a preferred daytime strain for appetite loss, nausea, glaucoma, and pain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-satellite_100x100_dbbc.jpg','https://leafly.blob.core.windows.net/reviews/blue-satellite_100x100_78f5.jpg','https://leafly.blob.core.windows.net/reviews/blue-satellite_100x100_088d.jpg','https://leafly.blob.core.windows.net/reviews/blue-satellite_100x100_4790.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352683/b/blue-satellite__primary_5f68.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335481/b/blue-satellite__primary_f8d2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/219215/b/blue-satellite__primary_0b72.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/88210/b/blue-satellite_825x550_755c.jpg',NULL,76.8966,76.0345,72.069,61.7241,38.6207,53.7931,45.1724,20,6.89655,4.31034,28.6207,10,10,6.89655,4.31034,NULL),(61,147091,'Blue Blood','blue-blood','Indica','Bue','<p>Blue Blood from breeder Medicann is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant cross of <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a>. It carries on the potent legacy of OG Kush genetics and adds a <a href=\"http://www.leafly.com/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> flavor to the <a href=\"http://www.leafly.com/explore/flavors-pine\">pine</a> and <a href=\"http://www.leafly.com/explore/flavors-diesel\">diesel</a> undertones. Some Blue Blood <a href=\"http://www.leafly.com/news/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> have proven to show a tendency towards higher <a href=\"http://www.leafly.com/news/cannabis-101/understanding-cannabis-testing\">CBD</a> levels which adds to the already <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxing</a> nature of this strain.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-blood_100x100_2d16.jpg','https://leafly.blob.core.windows.net/reviews/blue-blood_100x100_06e3.jpg',NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347469/b/blue-blood__primary_2528.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/333102/b/blue-blood__primary_91d5.jpg',NULL,NULL,NULL,57.1429,28.5714,28.5714,14.2857,14.2857,14.2857,14.2857,14.2857,14.2857,14.2857,28.5714,14.2857,14.2857,14.2857,14.2857,NULL),(62,103855,'Strawberry Blue','strawberry-blue','Sativa','Sbu','<p>Strawberry Blue is a 75% <a href=\"http://www.leafly.com/sativa\">sativa</a>&nbsp;bred by World of Seeds&nbsp;that crosses <a href=\"http://www.leafly.com/sativa/strawberry\">Strawberry</a> and New Blue Line. These lanky buds are favored for their notable&nbsp;<a href=\"http://www.leafly.com/explore#/explore/flavors-sweet\">sweet</a>, fruity aroma and provide heady effects true to its sativa heritage. Indoor or outdoor grows offer comparable yields, with a flowering time of around 9 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/strawberry-blue_100x100_d0cb.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-blue_100x100_24ba.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-blue_100x100_0a82.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-blue_100x100_482c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353107/b/strawberry-blue__primary_8748.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/317984/b/strawberry-blue__primary_e158.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/318218/b/strawberry-blue__primary_6d05.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/254892/b/strawberry-blue__primary_9c7c.jpg',NULL,73.6111,62.5,43.0556,38.8889,31.9444,55.5556,55.5556,48.6111,12.5,12.5,34.7222,13.8889,12.5,12.5,12.5,NULL),(63,3226,'Blue Moonshine','blue-moonshine','Indica','Blm','<p>A DJ Short creation, Blue Moonshine is a very potent blueberry indica strain that provides a nice body high. As a true indica, Blue Moonshine plants perform as expected, staying short to medium height and usually flowering by 8 weeks. While growing and after it&rsquo;s harvested, these plants have a sharp and fruity smell that brings to mind fermentation (thus the name). The high will hit you like good homebrew.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-moonshine_100x100_1b24.jpg','https://leafly.blob.core.windows.net/reviews/blue-moonshine_100x100_3a54.jpg','https://leafly.blob.core.windows.net/reviews/blue-moonshine_100x100_3deb.jpg','https://leafly.blob.core.windows.net/reviews/blue-moonshine_100x100_7f56.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/321997/b/blue-moonshine__primary_6267.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/302392/b/blue-moonshine__primary_c73d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/287212/b/blue-moonshine__primary_1b91.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/128837/b/blue-moonshine_825x550_9ae9.jpg',NULL,77.4444,64.8333,51.8333,42.3333,41.3333,55.3333,47.2222,31.7222,17,16.6111,25.6111,16.1111,15.1111,17,16.6111,NULL),(64,9099,'Blue Hawaiian','blue-hawaiian','Hybrid','Bhw','<p>The Blue Hawaiian strain is known for being quite a looker; its light green to orange buds are covered in rich orange and red hairs and are coated with sparkly trichomes throughout. Bred from <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> and Hawaiian Kona, Blue Hawaiian is fruity and smooth. Flowers appear at &nbsp;about ten weeks and are described as giving a balanced high that has equal parts of its relaxing indica and uplifting sativa effects.</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-hawaiian_100x100_e729.jpg','https://leafly.blob.core.windows.net/reviews/blue-hawaiian_100x100_83df.jpg','https://leafly.blob.core.windows.net/reviews/blue-hawaiian_100x100_2b46.jpg','https://leafly.blob.core.windows.net/reviews/blue-hawaiian_100x100_a22d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331001/b/blue-hawaiian__primary_5f47.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/297068/b/blue-hawaiian__primary_8f47.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/273392/b/blue-hawaiian__primary_3f7a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/273391/b/blue-hawaiian__primary_0b0a.jpg',NULL,66.7691,55.2185,52.8119,38.778,38.539,36.9261,32.177,29.7448,22.5764,20.9635,40.3268,16.4533,14.6015,22.5764,20.9635,NULL),(65,9,'Blue Cheese','blue-cheese','Indica','Chz','<p>Blue Cheese is an <a href=\"http://leafly.com/indica\">indica</a> cross created by crossing a <a href=\"/hybrid/blueberry\">Blueberry</a> male with an original <a href=\"http://www.leafly.com/hybrid/uk-cheese\">U.K. Cheese</a>&nbsp;(a <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a>) female. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> and savory smells of <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-blue-cheese\">blue cheese</a> combine to create a creamy, unique flavor reminecent of the original&nbsp;<a href=\"http://www.leafly.com/hybrid/cheese\">Cheese</a>.<span style=\"line-height: 20.7999992370605px;\">&nbsp;The heavy indica effects will help you feel <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a> at the end of the day and can provide relief for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-muscle-spasms\">muscle spasms</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_6b9b.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_6273.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_2119.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_a301.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364906/b/blue-cheese__primary_5e61.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364382/b/blue-cheese__primary_c5ef.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363801/b/blue-cheese__primary_0632.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363786/b/blue-cheese__primary_776d.jpg',NULL,84.5558,65.9625,62.7687,52.2808,45.7963,41.9722,31.3168,27.6449,27.1812,18.4358,34.6198,11.5278,11.3248,27.1812,18.4358,'Easy'),(66,1046,'Blue Rhino','blue-rhino','Hybrid','Blr','<p class=\"p1\">Blue Rhino is a potent cross of <a href=\"http://www.leafly.com/hybrid/blueberry\"><span class=\"s1\">Blueberry</span></a> and <a href=\"http://www.leafly.com/hybrid/white-rhino\"><span class=\"s1\">White Rhino</span></a> that has a unique fruity aroma mixed with some skunky harshness. This plant may be of special interest to growers for its large flowers, which will get to their most impressive size when grown outdoors. Patients like this strain for its balanced mix of head and body effects, making it an option for staying focused or wanting to relax, depending on your needs. Blue Rhino also boasts a high THC content and CBD content at over 15% and 1-2%, respectively.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-rhino_100x100_4122.jpg','https://leafly.blob.core.windows.net/reviews/blue-rhino_100x100_e9f1.jpg','https://leafly.blob.core.windows.net/reviews/blue-rhino_100x100_e796.jpg','https://leafly.blob.core.windows.net/reviews/blue-rhino_100x100_407f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356207/b/blue-rhino__primary_ce42.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353688/b/blue-rhino__primary_89f6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330835/b/blue-rhino__primary_de40.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309748/b/blue-rhino__primary_ca69.jpg',NULL,64.9621,64.9621,64.8674,47.4432,33.5227,25.1894,20.6439,15.483,10.2746,9.80114,22.7746,9.80114,6.77083,10.2746,9.80114,NULL),(67,120849,'Blue Frost','blue-frost','Hybrid','Blf','<p>Blue Frost is a <a href=\"http://www.leafly.com/hybrid\">hybrid</a> that balances the genetics of <a href=\"http://www.leafly.com/indica/blue-monster\">Blue Monster</a> and <a href=\"http://www.leafly.com/hybrid/jack-frost\">Jack Frost</a> to create a 60/40 <a href=\"http://www.leafly.com/indica\">indica</a>-dominant cross. Breeder Goldenseed has developed this strain to produce dense buds that show a range of deep violet hues and produces a <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> mixture of aromas. The flavor is an interesting combination of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruity</a> notes with a sharp <a href=\"http://www.leafly.com/explore#!/explore/flavors-cheese\">cheese</a>-like undertone. This hybrid is sure to <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">lift your mood</a> and replace any <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> you may have with <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">smile on your face</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-frost_100x100_7ee2.jpg','https://leafly.blob.core.windows.net/reviews/blue-frost_100x100_4fee.jpg','https://leafly.blob.core.windows.net/reviews/blue-frost_100x100_be11.jpg','https://leafly.blob.core.windows.net/reviews/blue-frost_100x100_a52a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363182/b/blue-frost__primary_2dbe.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356307/b/blue-frost__primary_fef2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/302104/b/blue-frost__primary_9c37.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/288396/b/blue-frost__primary_6d5d.jpg',NULL,83.3333,50,50,38.8889,38.8889,61.1111,44.4444,27.7778,27.7778,16.6667,27.7778,16.6667,16.6667,27.7778,16.6667,NULL),(68,415,'Blue Bayou','blue-bayou','Sativa','Bbu','<p>Blue Bayou can only be described as a comprehensive psychoactive experience. A true sativa, this peppy flower is optimal for a variety of cerebral ailments; patients report mood elevation and increased focus in particular. This strain may be suitable for a variety of applications including creative pursuits, focused work, or introspective exploration.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/Blue-Bayou_100x100_2b0x4ekk.zqd.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/5446/b/blue-bayou_825x550_wrimrkzo.hvo.jpg',NULL,NULL,NULL,NULL,13.6364,13.6364,13.6364,11.3636,2.27273,13.6364,13.6364,2.27273,NULL,NULL,11.3636,2.27273,NULL,NULL,NULL,NULL),(69,43183,'Blue Boy','blue-boy','Hybrid','Bbo','<p>Blue Boy is a cross of popular favorites <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a> and <a href=\"http://www.leafly.com/hybrid/northern-lights--5\">Northern Lights #5</a> that will give you anything but the blues. Originally from Washington state, this sativa-dominant hybrid provides focused, cerebral effects that make it a great choice for daytime use. Its plants are bushy and grow large, and the flowers tend to be large and on the looser, leafier side. Blue Boy is a potent strain with THC levels that often test over 20%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-boy_100x100_9e89.jpg','https://leafly.blob.core.windows.net/reviews/blue-boy_100x100_8b75.jpg','https://leafly.blob.core.windows.net/reviews/blue-boy_100x100_1370.jpg','https://leafly.blob.core.windows.net/reviews/blue-boy_100x100_f762.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364016/b/blue-boy__primary_6cf0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/273708/b/blue-boy__primary_5281.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/259481/b/blue-boy__primary_5891.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/89500/b/blue-boy_825x550_e25c.jpg',NULL,44.0476,41.0714,32.7381,29.7619,18.4524,26.7857,22.619,11.3095,4.16667,NULL,8.33333,4.16667,NULL,4.16667,NULL,NULL),(70,113,'Seattle Blue','seattle-blue','Indica','Sb','<p>The Seattle Blue strain of cannabis provides a strong euphoric body high. &#160;The sweet and fruity taste makes this a very pleasant <a href=\"/indica\">indica</a>.</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/seattle-blue_100x100_d310.jpg','https://leafly.blob.core.windows.net/reviews/seattle-blue_100x100_10fd.jpg','https://leafly.blob.core.windows.net/reviews/seattle-blue_100x100_glzatoin.gfs.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/58514/b/seattle-blue_825x550_728b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/55187/b/seattle-blue_825x550_1f46.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/13610/b/seattle-blue_825x550_xin4axeh.fj0.jpg',NULL,NULL,37.5,28.3333,20.8333,17.5,17.5,33.3333,31.6667,26.6667,12.5,12.5,25,15.8333,12.5,12.5,12.5,NULL),(71,650,'Blue Widow','blue-widow','Hybrid','Bw','<p class=\"p1\">Blue Widow is a favorite strain that provides consumers with both uplifting and calming effects. These flowers will have a strong sweet aroma that may also include sour citrus or pine. The buds can be colorful, with tints of blue and purple, and should have a coat of long orange hairs. Slightly indica-dominant, this Widow plays against type, growing taller than most indicas and providing more mental, heady effects. In higher doses, the blissful relaxation this strain provides may lead to drowsiness and help you get to sleep. A cross between <a href=\"http://www.leafly.com/hybrid/blueberry\"><span class=\"s1\">Blueberry</span></a> and <a href=\"http://www.leafly.com/hybrid/white-widow\"><span class=\"s1\">White Widow</span></a>, Blue Widow&nbsp;is sometimes also called <span class=\"s1\"><a href=\"http://www.leafly.com/hybrid/0bf3f759-186e-4dad-89d0-e0fc7598ac53\">Berry White</a>,&nbsp;</span><span class=\"s1\"><a href=\"http://www.leafly.com/hybrid/white-berry\">White Berry</a>, and&nbsp;<a href=\"http://www.leafly.com/hybrid/blue-venom\">Blue Venom</a>.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_556b.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_a51a.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_d677.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_7419.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360507/b/blue-widow__primary_90c7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355829/b/blue-widow__primary_89e8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355052/b/blue-widow__primary_e785.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352523/b/blue-widow__primary_c069.jpg',NULL,66.9315,62.2112,53.8219,46.6707,34.6319,36.8062,31.6952,22.7394,18.049,14.6057,18.9801,10.114,8.5216,18.049,14.6057,NULL),(72,11154,'Blue Bastard','blue-bastard','Indica','Blb','<p>The descendant of indicas <a href=\"https://www.leafly.com/indica/dj-short-blueberry\">DJ Short Blueberry</a> and <a href=\"http://leafly.com/indica/god-bud\">God Bud</a>, in addition to White family lineage, this indica-dominant hybrid is best known for its pungent blueberry aroma. Thanks to its hybrid makeup, the indica physical effects are strong without inducing sedation, making this strain appropriate for day or nighttime use. Best described as relaxing, Blue Bastard may be just the bud to take the edge off.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-bastard_100x100_f97a.jpg','https://leafly.blob.core.windows.net/reviews/Blue-Bastard_100x100_isz3rtkt.zgc.jpg','https://leafly.blob.core.windows.net/reviews/Blue-Bastard_100x100_nl04thfv.xuu.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323344/b/blue-bastard__primary_26ca.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/5160/b/blue-bastard_825x550_rq0fughb.3ll.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/4228/b/blue-bastard_825x550_roq4jriy.45p.jpg',NULL,NULL,101.974,101.974,59.2105,54.6053,51.9737,59.8684,53.2895,51.3158,50,50,50.6579,6.57895,2.63158,50,50,NULL),(73,154512,'Blue Dynamite','blue-dynamite','Indica','Bdy','<p>Blue Dynamite, bred by Next Generation Seeds in Canada, is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant strain that provides heavy mind-and-body <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxation</a> alongside a <a href=\"http://www.leafly.com/explore/flavors-tree-fruit\">fruity</a>, hashy flavor. This powerhouse indica was bred from a B.C. <a href=\"https://www.leafly.com/sativa/grapefruit\">Grapefruit</a> clone known as <a href=\"https://www.leafly.com/indica/29aca226-23ba-4726-a4ab-f3bf68f2a3c4\">Dynamite</a> and an <a href=\"http://leafly.com/indica/afghani\">Afghani</a>-<a href=\"http://leafly.com/indica/blueberry\">Blueberry</a> hybrid called <a href=\"https://www.leafly.com/hybrid/avalon\">Avalon</a>. Combining the flavorful qualities of Dynamite with the resinous potential Avalon enables, we are left with a potent strain that can budge even the most stubborn cases of <a href=\"http://www.leafly.com/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore/symptoms-nausea\">nausea</a>, and <a href=\"http://www.leafly.com/explore/symptoms-insomnia\">sleeplessness</a>. <em>High Times </em>recognized Blue Dynamite among its Top 10 Strains of 2007, solidifying a reputation that keeps this strain firmly set in the cannabis market.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-dynamite_100x100_f436.jpg','https://leafly.blob.core.windows.net/reviews/blue-dynamite_100x100_ce04.jpg','https://leafly.blob.core.windows.net/reviews/blue-dynamite_100x100_9648.jpg','https://leafly.blob.core.windows.net/reviews/blue-dynamite_100x100_2d0c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353810/b/blue-dynamite__primary_b4f9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353722/b/blue-dynamite__primary_1c9c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353308/b/blue-dynamite__primary_2cda.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347442/b/blue-dynamite__primary_5106.jpg',NULL,70.8333,69.4444,53.4722,34.7222,33.3333,77.0833,64.5833,28.4722,25,17.3611,48.6111,25,11.1111,25,17.3611,'Easy'),(74,95090,'Blue Dot','blue-dot','Sativa','Dot','<p>Blue Dot is an 80% <a href=\"http://www.leafly.com/sativa\">sativa</a>&nbsp;originally bred&nbsp;in Sonoma, CA by a medical patient. Blue Dot is a blend of four predominant&nbsp;strains: <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a>, <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk</a>, <a href=\"http://www.leafly.com/indica/big-bud\">Big Bud</a>, and <a href=\"http://www.leafly.com/hybrid/northern-lights--5\">Northern Lights #5</a>. Its resinous buds offer a <a href=\"http://www.leafly.com/explore#/explore/flavors-sweet\">sweet</a>&nbsp;hashish flavor profile, and can be expected to finish flowering in 9 to 10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-dot_100x100_3ab7.jpg','https://leafly.blob.core.windows.net/reviews/blue-dot_100x100_4a06.jpg','https://leafly.blob.core.windows.net/reviews/blue-dot_100x100_ccc6.jpg','https://leafly.blob.core.windows.net/reviews/blue-dot_100x100_8857.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/322965/b/blue-dot__primary_222f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/293674/b/blue-dot__primary_2ff0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/263889/b/blue-dot__primary_fb8d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/231115/b/blue-dot__primary_7bcf.jpg',NULL,118.75,118.75,95.8333,79.1667,79.1667,91.6667,50,29.1667,29.1667,22.9167,62.5,33.3333,16.6667,29.1667,22.9167,NULL),(75,3115,'Blue Haze','blue-haze','Hybrid','Blz','<p class=\"p1\">Daughter of hybrid <a href=\"http://www.leafly.com/hybrid/blueberry\"><span class=\"s1\">Blueberry</span></a> and sativa <a href=\"http://www.leafly.com/sativa/super-silver-haze\"><span class=\"s1\">Super Silver Haze</span></a> (the only strain to win the International <em>High Times</em> Cannabis Cup three times), this slightly sativa-dominant hybrid is a versatile strain. It has a pleasing taste and scent, and its furry dense buds produce&nbsp;full-bodied effects. Blue Haze is a great candidate for the regular consumer&rsquo;s arsenal as it is appropriate for a broad spectrum of activities and provides the optimal balance between cerebral and physical effects.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-haze_100x100_344e.jpg','https://leafly.blob.core.windows.net/reviews/blue-haze_100x100_70ac.jpg','https://leafly.blob.core.windows.net/reviews/blue-haze_100x100_19ee.jpg','https://leafly.blob.core.windows.net/reviews/blue-haze_100x100_db58.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347738/b/blue-haze__primary_f197.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341429/b/blue-haze__primary_d0c8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340462/b/blue-haze__primary_5a32.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/304117/b/blue-haze__primary_ebda.jpg',NULL,60.1303,51.5756,49.2521,44.2941,37.5777,34.6429,22.7626,15.5126,15.3487,9.98109,15.7206,9.04202,5.30672,15.3487,9.98109,NULL),(76,6067,'Crimea Blue','crimea-blue','Hybrid','Crb','<p>Crimea Blue is a hybrid strain bred by Barney\'s Farm that is a cross between Blueberry and Crimean hash plant. &#160;This short plant completes flowering in 8 to 9 weeks and produces higher than average yields. &#160;&#160;</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/crimea-blue_100x100_7135.jpg','https://leafly.blob.core.windows.net/reviews/crimea-blue_100x100_48fe.jpg','https://leafly.blob.core.windows.net/reviews/crimea-blue_100x100_9115.jpg',NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/329866/b/crimea-blue__primary_38c8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/135930/b/crimea-blue_825x550_bdf0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/17884/b/crimea-blue_825x550_4dcf.jpg',NULL,NULL,100,87.5,67.2619,44.0476,35.7143,61.3095,55.9524,52.381,27.381,25,18.4524,16.6667,8.92857,27.381,25,NULL),(77,64980,'Blue Venom','blue-venom','Hybrid','Bvm','<p>Blue Venom, an intoxicating indica-dominant hybrid by G13 Labs, is a cross between the sweet-tasting <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> and potent <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a>. With a sweet, blueberry aroma inherited from its parent strain, Blue Venom&rsquo;s frosty, dense buds promise a fast-acting and long-lasting experience. Its full-body relaxation eventually progresses into a deep sedation, putting to rest any pain, stress, and sleeplessness.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-venom_100x100_f47c.jpg','https://leafly.blob.core.windows.net/reviews/blue-venom_100x100_1f36.jpg','https://leafly.blob.core.windows.net/reviews/blue-venom_100x100_6c64.jpg','https://leafly.blob.core.windows.net/reviews/blue-venom_100x100_3529.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330195/b/blue-venom__primary_4efc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/297759/b/blue-venom__primary_e4ff.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/270507/b/blue-venom__primary_afc8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/225613/b/blue-venom__primary_5e11.jpg',NULL,78.2143,68.6905,50.0595,47.2024,44.4048,45.8929,27.7381,26.0714,26.0714,18.3333,23.9881,12.0833,10,26.0714,18.3333,NULL),(78,144687,'Blueberry Skunk','blueberry-skunk','Indica','Bsk','<p>Blueberry Skunk is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a>-dominant <a href=\"http://www.leafly.com/explore/category-hybrid\">hybrid</a> of <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> and <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a> genetics. It has a reputation for being potent, flavorful, and relatively easy to grow. The aroma of Blueberry Skunk is a complex mix of <a href=\"http://www.leafly.com/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> flavors that blend with an <a href=\"http://www.leafly.com/explore/flavors-earthy\">earthy</a>, <a href=\"http://www.leafly.com/explore/flavors-skunk\">skunky</a> musk. The effects are led by a long-lasting <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoric</a> buzz that generates <a href=\"http://www.leafly.com/explore/tags-giggly\">giggles</a> as well as the <a href=\"http://www.leafly.com/explore/tags-hungry\">munchies</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-skunk_100x100_47fd.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-skunk_100x100_a79a.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-skunk_100x100_9016.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-skunk_100x100_0969.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361935/b/blueberry-skunk__primary_811c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309356/b/blueberry-skunk__primary_6fb4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309578/b/blueberry-skunk__primary_46f1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/302075/b/blueberry-skunk__primary_d993.jpg',NULL,84.5238,67.8571,66.0714,41.369,35.119,47.619,41.369,37.2024,35.119,30.9524,35.119,16.369,16.369,35.119,30.9524,'Easy'),(79,145359,'Blueberry Lambsbread','blueberry-lambsbread','Hybrid','Byl','<p>Blueberry Lambsbread is an <a href=\"http://www.leafly.com/explore/tags-uplifted\">uplifting</a> <a href=\"http://www.leafly.com/explore/category-hybrid\">hybrid</a> strain that folds together genetics from Jamaican <a href=\"http://www.leafly.com/sativa/lamb-s-bread\">Lamb&rsquo;s Bread</a> and <a href=\"http://leafly.com/indica/blueberry\">Blueberry</a>. Invigorating, <a href=\"http://www.leafly.com/explore/tags-creative\">creative</a> effects are lightly anchored by mellow <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxation</a>, making Blueberry Lambsbread a good choice for day or evening use. <a href=\"http://www.leafly.com/explore/flavors-earthy\">Earthy</a> and <a href=\"http://www.leafly.com/explore/flavors-woody\">woody</a> notes mingle with a <a href=\"http://www.leafly.com/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> aroma passed down from its Blueberry parent.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/0/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-lambsbread_100x100_a6a3.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357041/b/blueberry-lambsbread__primary_08fd.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,97296,'Blue Moon Rocks','blue-moon-rocks','Hybrid','Bmr','<p>Blue Moon Rocks by BOG Seeds is an <a href=\"http://leafly.com/indica\">indica</a>-dominant&nbsp;<a href=\"http://leafly.com/hybrid\">hybrid</a> cross between Blue Moon and BOGBubble. It has a sweet blueberry lavender aroma and calming full-body effects.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-moon-rocks_100x100_0343.jpg','https://leafly.blob.core.windows.net/reviews/blue-moon-rocks_100x100_7fec.jpg','https://leafly.blob.core.windows.net/reviews/blue-moon-rocks_100x100_d196.jpg','https://leafly.blob.core.windows.net/reviews/blue-moon-rocks_100x100_793c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354821/b/blue-moon-rocks__primary_5d4c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355334/b/blue-moon-rocks__primary_fd0d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/332783/b/blue-moon-rocks__primary_a86e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323099/b/blue-moon-rocks__primary_c310.jpg',NULL,69.697,64.9351,60.6061,51.2987,46.5368,32.2511,32.2511,27.4892,27.4892,22.9437,13.8528,9.30736,9.09091,27.4892,22.9437,NULL),(81,293,'Super Blue Dream','super-blue-dream','Hybrid','Sbd','<p><a href=\"http://www.leafly.com/sativa/super-silver-haze\">Super Silver Haze</a> was crossed with <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> to create this fun and potent hybrid. Super Blue Dream is fast-acting and known for creating head-heavy effects. Taking after its sativa heritage, this strain is energizing and great for daytime use. While Super Blue Dream is powerful, it still allows you to focus and get things done. Similar to its relative, <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a>, Super Blue Dream features a&nbsp;sour blueberry aroma. Due to this strain&rsquo;s head-heavy effects, it may not be a good choice for consumers who suffer from headaches. For those who are afflicted with stress or anxiety, however, Super Blue Dream may be a good strain to try.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/super-blue-dream_100x100_4578.jpg','https://leafly.blob.core.windows.net/reviews/super-blue-dream_100x100_58ae.jpg','https://leafly.blob.core.windows.net/reviews/super-blue-dream_100x100_426d.jpg','https://leafly.blob.core.windows.net/reviews/super-blue-dream_100x100_dd57.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364394/b/super-blue-dream__primary_7f50.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360077/b/super-blue-dream__primary_f20f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357037/b/super-blue-dream__primary_6e88.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356011/b/super-blue-dream__primary_0c51.jpg',NULL,52.8706,51.2877,44.0459,42.3994,31.9031,27.1311,19.5573,14.8944,10.2968,6.98357,18.1137,11.8696,6.40845,10.2968,6.98357,NULL),(82,148879,'Bhang Seattle Blue','bhang-seattle-blue','Indica','Bha','<p><a href=\"http://www.leafly.com/indica/seattle-blue\">Seattle Blue</a> by Bhang is an <a href=\"http://www.leafly.com/explore/category-indica\">indica</a> strain that has been processed into a variety of oil-based products compatible with the Bhang Stick portable vaporizer. The oils are free of glycerin, glycol, and additives, and stay true to Seattle Blue&rsquo;s heavily relaxing and euphoric effects.</p>\n\n<p>Bhang&rsquo;s Pure Oil Seattle Blue is a <a href=\"http://www.leafly.com/news/cannabis-101/the-great-wide-world-of-cannabis-concentrates\">CO2 extract</a> made with the experienced user in mind, with a potency that ranges from 50-65% THC. For the novice, Bhang&rsquo;s All Natural Seattle Blue is a coconut oil-infused blend with a potency range of 25-35% THC. Each product is batch tested, so consult the product&rsquo;s label for an exact description of its cannabinoid content.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/0/240?color=fcc91d',NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(83,150867,'Bhang Blue Diesel','bhang-blue-diesel','Hybrid','Bha','<p><a href=\"http://www.leafly.com/hybrid/blue-diesel\">Blue Diesel</a> by Bhang is a <a href=\"http://www.leafly.com/explore/category-hybrid\">hybrid</a> strain that has been processed into a variety of oil-based products compatible with the Bhang Stick portable vaporizer. The oils are free of glycerin, glycol, and additives, and stay true to Blue Diesel&rsquo;s uplifting and euphoric effects.</p>\n\n<p>Bhang&rsquo;s Pure Oil Blue Diesel is a <a href=\"http://www.leafly.com/news/cannabis-101/the-great-wide-world-of-cannabis-concentrates\">CO2 extract</a> made with the experienced user in mind, with a potency that ranges from 50-65% THC. For the novice, Bhang&rsquo;s All Natural Blue Diesel is a coconut oil-infused blend with a potency range of 25-35% THC. Each product is batch tested, so consult the product&rsquo;s label for an exact description of its cannabinoid content.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/0/240?color=fcc91d',NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(84,13,'Sour Diesel','sour-diesel','Sativa','Sd','<p>Sour Diesel, sometimes called Sour D, is an invigorating <a href=\"http://www.leafly.com/sativa\">sativa</a> named after its <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a>, <a href=\"http://www.leafly.com/explore/flavors-diesel\">diesel</a>-like aroma. This fast-acting strain delivers <a href=\"http://www.leafly.com/explore/tags-energetic\">energizing</a>, dreamy cerebral effects that have pushed Sour Diesel to its legendary status. <a href=\"http://www.leafly.com/explore/symptoms-stress\">Stress</a>, <a href=\"http://www.leafly.com/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore/symptoms-depression\">depression</a> fade away in long-lasting relief that makes Sour Diesel a top choice among medical patients.</p>\n\n<p>Its stimulating effects have won Sour Diesel a seat in the sativa category, but its poorly documented origins leave much room for debate. According to growing guru Ed Rosenthal, Sour Diesel originates from <a href=\"http://www.leafly.com/hybrid/mexican-sativa\">Mexican Sativa</a> and <a href=\"http://www.leafly.com/indica/chemo\">Chemo</a>. Other folklore will tell us Sour Diesel descends from <a href=\"http://www.leafly.com/hybrid/chemdawg-91\">Chemdawg 91</a>, <a href=\"http://www.leafly.com/indica/northern-lights\">Northern Lights</a>, and an unknown <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/sour-diesel/primary?width=200','https://leafly.blob.core.windows.net/reviews/sour-diesel_100x100_8493.jpg','https://leafly.blob.core.windows.net/reviews/sour-diesel_100x100_ceb4.jpg','https://leafly.blob.core.windows.net/reviews/sour-diesel_100x100_7ebd.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/sour-diesel/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364309/b/sour-diesel__primary_e24a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363740/b/sour-diesel__primary_0a20.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364019/b/sour-diesel__primary_1fe9.jpg','https://leafly.s3.amazonaws.com/strains/testing/vpiBi0qpSqeL3y2c9nL2_sour-diesel.png',65.5201,55.7616,51.4125,49.3999,45.4927,36.9218,28.8666,22.7103,14.0207,13.3219,25.9814,12.7197,7.08833,14.0207,13.3219,NULL),(85,23,'OG Kush','og-kush','Hybrid','Ogk','<p>OG Kush makes up the genetic backbone of West Coast cannabis varieties, but in spite of its ubiquity, its origins remain a debatable mystery. Popular myth maintains that <a href=\"http://www.leafly.com/hybrid/chemdawg\">Chemdawg</a> and an indica <a href=\"http://www.leafly.com/indica/hindu-kush\">Hindu Kush</a> parented OG Kush, passing on the distinct &ldquo;kush&rdquo; bud structure we see in many strains today. Other theories throw <a href=\"http://www.leafly.com/sativa/lemon-thai\">Lemon Thai</a> genetics into the genetic mix, but no one can say for sure how this iconic strain came into existence. There are many different <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> of OG Kush, some of which include <a href=\"http://www.leafly.com/indica/tahoe-og\">Tahoe OG</a>, <a href=\"http://www.leafly.com/hybrid/sfv-og\">SFV OG</a>, and <a href=\"http://www.leafly.com/hybrid/alpha-og\">Alpha OG</a>.&nbsp;</p>\n\n<p>Whatever its true genetics may be, OG Kush is commonly described as sativa-like in its <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric/\">euphoric</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-happy/\">happy</a> effects that combat <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress/\">stress</a> and <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a>. It has an <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> scent with <a href=\"http://www.leafly.com/explore#!/explore/flavors-woody\">woody</a> undertones, an aroma that has become the signature of OG Kush varieties and descendants. With OG Kush, patients most commonly cite improvements in <a href=\"http://www.leafly.com/explore#!/explore/conditions-migraines\">migraines</a>, <a href=\"http://www.leafly.com/explore#!/explore/conditions-addadhd\">ADD/ADHD</a>, and stress disorders. It has an indoor flowering time of 8 to 9 weeks with moderate yields.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/og-kush_100x100_e9e9.jpg','https://leafly.blob.core.windows.net/reviews/og-kush_100x100_1f27.jpg','https://leafly.blob.core.windows.net/reviews/og-kush_100x100_0534.jpg','https://leafly.blob.core.windows.net/reviews/og-kush_100x100_114d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363795/b/og-kush__primary_f177.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363522/b/og-kush__primary_c84d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362123/b/og-kush__primary_a435.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362090/b/og-kush__primary_5fce.jpg','https://leafly.s3.amazonaws.com/strains/testing/oz5lWFjRMeboRc21p4Zq_og-kush.png',66.6251,65.5714,54.8064,44.7569,39.2955,38.6276,28.6782,27.6767,20.72,15.6526,27.9319,12.9542,10.3033,20.72,15.6526,NULL),(86,32,'Green Crack','green-crack','Sativa','Gc','<p>Don&rsquo;t let the name fool you: this is pure cannabis. Few strains compare to Green Crack&rsquo;s sharp <a href=\"http://www.leafly.com/explore/tags-energetic\">energy</a> and <a href=\"http://www.leafly.com/explore/tags-focused\">focus</a> as it induces an <a href=\"http://www.leafly.com/explore/tags-uplifted\">invigorating</a> mental buzz that keeps you going throughout the day. With a tangy, <a href=\"http://www.leafly.com/explore/flavors-tree-fruit\">fruity</a> flavor redolent of <a href=\"http://www.leafly.com/explore/flavors-mango\">mango</a>, Green Crack is the perfect daytime medication for patients treating <a href=\"http://www.leafly.com/explore/symptoms-fatigue\">fatigue</a>, <a href=\"http://www.leafly.com/explore/symptoms-stress\">stress</a>, and <a href=\"http://www.leafly.com/explore/symptoms-depression\">depression</a>.</p>\n\n<p>Green Crack has branched into two genetic lineages, the most common of which is its <a href=\"http://www.leafly.com/sativa\">sativa</a> line descended from <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk #1</a>. The 75% <a href=\"http://www.leafly.com/indica\">indica</a> variety of Green Crack is said to have come from an <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> strain, and is marked by a tighter bud structure. Because its name perpetuates a negative image of cannabis, some people have taken to calling this strain Cush (with a &lsquo;C&rsquo;) or Green Cush instead.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/green-crack/primary?width=200','https://leafly.blob.core.windows.net/reviews/green-crack_100x100_bd2c.jpg','https://leafly.blob.core.windows.net/reviews/green-crack_100x100_7b91.jpg','https://leafly.blob.core.windows.net/reviews/green-crack_100x100_40ff.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/green-crack/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364690/b/green-crack__primary_d063.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364599/b/green-crack__primary_1495.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364598/b/green-crack__primary_8f9e.jpg','https://leafly.s3.amazonaws.com/strains/testing/5U3khPMFQHKvXTuVwSVl_green-crack.png',72.7677,69.6358,64.6942,54.4947,49.2512,40.8135,33.2305,23.7666,21.1425,17.3526,30.6388,14.7863,9.20258,21.1425,17.3526,'Easy'),(87,11,'Granddaddy Purple','granddaddy-purple','Indica','Gdp','<p>Introduced in 2003 by Ken Estes, Granddaddy Purple (or GDP) is a famous <a href=\"http://www.leafly.com/indica\">indica</a> cross between <a href=\"http://www.leafly.com/indica/purple-urkle\">Purple Urkle</a> and <a href=\"http://www.leafly.com/hybrid/big-bud\">Big Bud</a>. This California staple inherits a complex <a href=\"http://www.leafly.com/explore/flavors-grape\">grape</a> and <a href=\"http://www.leafly.com/explore/flavors-berry\">berry</a> aroma from its Purple Urkle parent, while Big Bud passes on its oversized, compact bud structure. GDP flowers bloom in shades of deep purple, a contrastive backdrop for its snow-like dusting of white crystal resin.</p>\n\n<p>Its potent psychoactive effects are clearly detectable in both mind and body, delivering a fusion of cerebral <a href=\"http://www.leafly.com/explore/tags-euphoric\">euphoria</a> and physical <a href=\"http://www.leafly.com/explore/tags-relaxed\">relaxation</a>. While your thoughts may float in a dreamy buzz, your body is more likely to find itself fixed in one spot for the duration of GDP&rsquo;s effects. Like most heavy indica varieties, Granddaddy Purple is typically pulled off the shelf to treat <a href=\"http://www.leafly.com/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore/symptoms-stress\">stress</a>, <a href=\"http://www.leafly.com/explore/symptoms-insomnia\">insomnia</a>, <a href=\"http://www.leafly.com/explore/symptoms-lack-of-appetite\">appetite loss</a>, and <a href=\"http://www.leafly.com/explore/symptoms-muscle-spasms\">muscle spasms</a>. GDP blesses growers with massive commercial yields which are ready for harvest following a 60 day flowering time indoors.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/granddaddy-purple/primary?width=200','https://leafly.blob.core.windows.net/reviews/granddaddy-purple_100x100_22ed.jpg','https://leafly.blob.core.windows.net/reviews/granddaddy-purple_100x100_e740.jpg','https://leafly.blob.core.windows.net/reviews/granddaddy-purple_100x100_2927.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/granddaddy-purple/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363736/b/granddaddy-purple__primary_70c3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363861/b/granddaddy-purple__primary_3a63.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363735/b/granddaddy-purple__primary_c995.jpg','https://leafly.s3.amazonaws.com/strains/testing/J46XOaKEQGinGkMnBRWq_granddaddy-purple.png',78.151,59.0831,56.0705,51.7113,41.3891,43.1409,37.6938,33.1707,26.8278,19.0246,32.7612,13.0814,9.63477,26.8278,19.0246,NULL),(89,26,'White Widow','white-widow','Hybrid','Ww','<p>Among the most famous strains worldwide is White Widow, a balanced <a href=\"http://leafly.com/hybrid\">hybrid</a> first bred in the Netherlands by Green House Seeds. A cross between a <a href=\"http://www.leafly.com/sativa/south-american\">Brazilian</a> <a href=\"http://leafly.com/sativa\">sativa</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace</a> and a resin-heavy <a href=\"http://www.leafly.com/sativa/south-indian\">South Indian</a> <a href=\"http://leafly.com/indica\">indica</a>, &nbsp;White Widow has blessed every Dutch coffee shop menu since its birth in the 1990s. Its buds are white with crystal resin, warning you of the potent effects to come. A powerful burst of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energy</a> breaks through immediately, stimulating both <a href=\"http://www.leafly.com/explore#!/explore/tags-talkative\">conversation</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a>. White Widow&rsquo;s genetics have given rise to many other legends like <a href=\"http://www.leafly.com/hybrid/white-russian\">White Russian</a>, <a href=\"http://www.leafly.com/hybrid/white-rhino\">White Rhino</a>, and <a href=\"http://www.leafly.com/hybrid/blue-widow\">Blue Widow</a>. Still, many growers prefer cultivation of the original White Widow, which flowers in about 60 days indoors.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/white-widow_100x100_4ec7.jpg','https://leafly.blob.core.windows.net/reviews/white-widow_100x100_1ec6.jpg','https://leafly.blob.core.windows.net/reviews/white-widow_100x100_a8bb.jpg','https://leafly.blob.core.windows.net/reviews/white-widow_100x100_eb90.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365071/b/white-widow__primary_0986.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363722/b/white-widow__primary_881b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363564/b/white-widow__primary_5862.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363277/b/white-widow__primary_3f0e.jpg',NULL,67.5506,58.6871,57.2298,53.911,40.2842,36.4105,28.7361,28.626,14.67,11.7339,24.5655,10.7993,8.64599,14.67,11.7339,'Easy'),(90,31,'Jack Herer','jack-herer','Sativa','Jh','<p>Jack Herer is a <a href=\"http://leafly.com/sativa\">sativa</a>-dominant cannabis strain that has gained as much renown as its namesake, the marijuana activist and author of <em>The Emperor Wears No Clothes</em>. Combining a <a href=\"http://www.leafly.com/sativa/haze\">Haze</a> hybrid with a <a href=\"http://www.leafly.com/hybrid/northern-lights--5\">Northern Lights #5</a> and <a href=\"http://www.leafly.com/hybrid/shiva-skunk\">Shiva Skunk</a> cross, Sensi Seeds created Jack Herer hoping to capture both the cerebral <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">elevation</a> associated with sativas and the heavy resin production of indicas. Its rich genetic background gives rise to several different variations of Jack Herer, each <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> bearing its own unique features and effects. However, consumers typically describe this 55% sativa hybrid as <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">blissful</a>, clear-headed, and <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a>.</p>\n\n<p>Jack Herer was created in the Netherlands in the mid-1990s where it was later distributed by Dutch pharmacies as a recognized medical-grade strain. Since then, the <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a>-scented sativa has taken home numerous awards for its quality and potency. Many breeders have attempted to cultivate this staple strain themselves in sunny or Mediterranean climates, and indoor growers should wait 50 to 70 days for Jack Herer to flower.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/jack-herer/primary?width=200','https://leafly.blob.core.windows.net/reviews/jack-herer_100x100_0217.jpg','https://leafly.blob.core.windows.net/reviews/jack-herer_100x100_4bd1.jpg','https://leafly.blob.core.windows.net/reviews/jack-herer_100x100_a3bf.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/jack-herer/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364817/b/jack-herer__primary_c242.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364614/b/jack-herer__primary_7c60.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364523/b/jack-herer__primary_cf8f.jpg','https://leafly.s3.amazonaws.com/strains/testing/8POgGtTbR9Gwy8mNOYrJ_jack-herer.png',71.2781,66.9153,62.6129,60.3896,53.7476,41.6003,35.4868,25.2274,16.8793,11.8174,31.035,10.1528,10.009,16.8793,11.8174,NULL),(91,33,'Bubba Kush','bubba-kush','Indica','Bk','<p>Bubba Kush is a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://leafly.com/indica\">indica</a> strain with genetics traced back to the <a href=\"http://www.leafly.com/indica/hindu-kush\">Hindu Kush</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace strains</a>. Since finding its way to U.S. shores, the lineage of this nearly pure indica strain becomes more foggy. While some insist Bubba Kush was first bred on the West Coast from <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and landrace genetics, its origins are poorly documented and uncertain. Green House Seeds also cultivates a unique rendition of Bubba Kush using <a href=\"http://www.leafly.com/hybrid/bubble-gum\">Bubble Gum</a> and Kush.&nbsp;</p>\n\n<p>Despite its wide proliferation, Bubba Kush exhibits a distinctive, bulky bud structure with hues that range from forest green to pale purple. Its effects may begin focused in the head, but it isn&rsquo;t long before the buzz reaches the rest of the body. Some might consider couchlock an inevitable consequence of Bubba Kush, making this powerhouse indica a perfect go-to strain for evening <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a>, restful <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleep</a>, or a lazy weekend at home.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/bubba-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/bubba-kush_100x100_1236.jpg','https://leafly.blob.core.windows.net/reviews/bubba-kush_100x100_c75e.jpg','https://leafly.blob.core.windows.net/reviews/bubba-kush_100x100_f5e8.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/bubba-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365169/b/bubba-kush__primary_a6f7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363547/b/bubba-kush__primary_ecca.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363339/b/bubba-kush__primary_5fe6.jpg','https://leafly.s3.amazonaws.com/strains/testing/yfAhlOkR5iSnSTNKgf4s_bubba-kush.png',85.0771,61.6068,59.4779,52.1404,36.1948,43.8638,36.4457,36.2926,26.8314,20.0454,31,13.5093,13.4554,26.8314,20.0454,NULL),(92,1,'AK-47','ak-47','Hybrid','Ak','<p>Don&#39;t let its intense&nbsp;name fool you: AK-47 will leave you <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a> and mellow. This <a href=\"http://www.leafly.com/sativa\">sativa</a>-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> delivers a steady and long-lasting cerebral buzz that keeps you mentally alert and engaged in <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> or <a href=\"http://www.leafly.com/explore#!/explore/tags-talkative\">social</a> activities. AK-47 mixes <a href=\"http://www.leafly.com/sativa/south-american\">Colombian</a>, <a href=\"http://leafly.com/sativa/mexican\">Mexican</a>, <a href=\"http://www.leafly.com/sativa/thai\">Thai</a>, and <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> varieties, bringing together a complex blend of flavors and effects. While AK-47&rsquo;s scent is sour and <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a>, its <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-flowery\">floral</a> notes can only be fully realized in the taste.&nbsp;</p>\n\n<p>Created in 1992 by Serious Seeds, AK-47 has won numerous Cannabis Cup awards around the world for its soaring THC content. For those hoping to fill their gardens with this resinous, <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunky</a> hybrid, growers recommend an indoor environment with either soil or hydroponic setups. AK-47 is easy to grow and has a short indoor flowering time of just 53 to 63 days, while outdoor plants typically finish toward the end of October.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ak-47_100x100_d366.jpg','https://leafly.blob.core.windows.net/reviews/ak-47_100x100_6574.jpg','https://leafly.blob.core.windows.net/reviews/ak-47_100x100_c9bf.jpg','https://leafly.blob.core.windows.net/reviews/ak-47_100x100_ff11.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365104/b/ak-47__primary_0482.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364449/b/ak-47__primary_8376.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364438/b/ak-47__primary_d8e0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363921/b/ak-47__primary_3cbe.jpg',NULL,64.3997,55.066,52.5102,44.5365,37.4971,35.5759,25.4031,24.6384,14.4569,14.4096,23.1113,9.9893,8.80817,14.4569,14.4096,NULL),(93,35,'Trainwreck','trainwreck','Hybrid','Tw','<p>Trainwreck is a mind-bending <a href=\"http://leafly.com/hybrid\">hybrid</a> with potent <a href=\"http://leafly.com/sativa\">sativa</a> effects that hit like a freight train. <a href=\"http://leafly.com/sativa/mexican\">Mexican</a> and <a href=\"http://www.leafly.com/sativa/thai\">Thai</a> sativas were bred with <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> <a href=\"http://leafly.com/indica\">indicas</a> to produce this Northern California staple, passing on a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> aroma. Trainwreck begins its speedy hurtle through the mind with a surge of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>, awakening <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happiness</a>. <a href=\"http://www.leafly.com/explore#!/explore/conditions-migraines\">Migraines</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore#!/explore/conditions-arthritis\">arthritis</a> are mowed down by Trainwreck&rsquo;s high THC content, and many patients also use it for relief of <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a>, <a href=\"http://www.leafly.com/explore#!/explore/conditions-addadhd\">ADD/ADHD</a>, and <a href=\"http://www.leafly.com/knowledge-center/medical-resources/cannabis-and-post-traumatic-stress-disorder-ptsd\">PTSD</a>. Trainwreck flowers finish up in early October outdoors, while indoor gardens are ready for harvest 8 weeks into flowering.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/trainwreck_100x100_2088.jpg','https://leafly.blob.core.windows.net/reviews/trainwreck_100x100_f3c7.jpg','https://leafly.blob.core.windows.net/reviews/trainwreck_100x100_8f99.jpg','https://leafly.blob.core.windows.net/reviews/trainwreck_100x100_ad94.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363991/b/trainwreck__primary_9c32.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362495/b/trainwreck__primary_ebf9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360460/b/trainwreck__primary_d2db.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360144/b/trainwreck__primary_448a.jpg','https://leafly.s3.amazonaws.com/strains/testing/xfn6FgUCSSibJM1mZ0H0_trainwreck.png',61.8491,60.8625,55.7569,51.6866,41.4531,41.6197,28.6421,28.4546,15.5078,15.1616,32.6426,15.5658,11.2028,15.5078,15.1616,NULL),(94,25,'Northern Lights','northern-lights','Indica','Nl','<p><a href=\"http://www.leafly.com/news/products/strain-highlight-northern-lights-the-indica-legend-up-close\">Northern Lights</a> stands among the most famous strains of all time, a pure <a href=\"http://leafly.com/indica\">indica</a> cherished for its resinous buds, fast flowering, and resilience during growth. Itself a descendant of indigenous <a href=\"http://leafly.com/indica/afghani\">Afghani</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace strains</a>, Northern Lights has given rise to famous <a href=\"http://leafly.com/hybrid\">hybrids</a> like <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>, <a href=\"http://www.leafly.com/hybrid/shiva-skunk\">Shiva Skunk</a>, and <a href=\"http://www.leafly.com/sativa/super-silver-haze\">Super Silver Haze</a>. Rumor has it that Northern Lights first sprouted near Seattle, Washington, but was propagated out of Holland after 1985 at what is now Sensi Seeds.</p>\n\n<p>Pungently <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a> aromas radiate from the crystal-coated buds, which sometimes reveal themselves in hues of purple. Northern Lights&rsquo; psychoactive effects settle in firmly throughout the body, <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> muscles and pacifying the mind in dreamy <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. Comfortable laziness allows patients to relieve <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">sleeplessness</a>, while its mellow contentment roots out <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>. Several different Northern Lights <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> circulate the market, but Sensi Seeds recommends a general indoor flowering time of 45 to 50 days.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/northern-lights/primary?width=200','https://leafly.blob.core.windows.net/reviews/northern-lights_100x100_afb5.jpg','https://leafly.blob.core.windows.net/reviews/northern-lights_100x100_314e.jpg','https://leafly.blob.core.windows.net/reviews/northern-lights_100x100_14b4.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/northern-lights/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364618/b/northern-lights__primary_fc1c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364348/b/northern-lights__primary_afac.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363821/b/northern-lights__primary_938e.jpg',NULL,77.4328,59.837,59.5158,48.9048,36.6197,47.4521,36.9341,31.5863,28.6278,16.6015,30.0969,12.0656,10.1079,28.6278,16.6015,NULL),(95,9,'Blue Cheese','blue-cheese','Indica','Chz','<p>Blue Cheese is an <a href=\"http://leafly.com/indica\">indica</a> cross created by crossing a <a href=\"/hybrid/blueberry\">Blueberry</a> male with an original <a href=\"http://www.leafly.com/hybrid/uk-cheese\">U.K. Cheese</a>&nbsp;(a <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a>) female. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> and savory smells of <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-blue-cheese\">blue cheese</a> combine to create a creamy, unique flavor reminecent of the original&nbsp;<a href=\"http://www.leafly.com/hybrid/cheese\">Cheese</a>.<span style=\"line-height: 20.7999992370605px;\">&nbsp;The heavy indica effects will help you feel <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a> at the end of the day and can provide relief for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-muscle-spasms\">muscle spasms</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_6b9b.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_6273.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_2119.jpg','https://leafly.blob.core.windows.net/reviews/blue-cheese_100x100_a301.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364906/b/blue-cheese__primary_5e61.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364382/b/blue-cheese__primary_c5ef.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363801/b/blue-cheese__primary_0632.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363786/b/blue-cheese__primary_776d.jpg',NULL,84.5558,65.9625,62.7687,52.2808,45.7963,41.9722,31.3168,27.6449,27.1812,18.4358,34.6198,11.5278,11.3248,27.1812,18.4358,'Easy'),(96,132,'Headband','headband','Hybrid','Hb','<p>Meet Headband, the love-child of cannabis&rsquo; power couple, <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>. The smooth, creamy smoke is accented by flavors of <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemons</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-diesel\">diesel</a> while the long-lasting effects are great for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> relief, helping you to <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relax</a>, and to combat elevated <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> levels. Many report that the effects create a slight pressure around the crown of their head and feels as though they are wearing a headband. The effects have been known to come on slow, so pace yourself with this potent <a href=\"http://www.leafly.com/hybrid\">hybrid</a>.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/headband/primary?width=200','https://leafly.blob.core.windows.net/reviews/headband_100x100_ea76.jpg','https://leafly.blob.core.windows.net/reviews/headband_100x100_4107.jpg','https://leafly.blob.core.windows.net/reviews/headband_100x100_3d28.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/headband/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363521/b/headband__primary_fc61.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363466/b/headband__primary_ae85.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362352/b/headband__primary_50a7.jpg','https://leafly.s3.amazonaws.com/strains/testing/3NehO9dTMiG40UIjklw6_headband.png',64.0228,63.5187,60.9841,57.4454,37.9994,36.6592,25.2776,23.5004,15.5896,15.2502,26.074,10.4602,9.05553,15.5896,15.2502,NULL),(97,135,'Purple Kush','purple-kush','Indica','Pk','<p>Purple Kush is a pure <a href=\"http://leafly.com/indica\">indica</a> strain that emerged from the Oakland area of California as the result of a <a href=\"http://www.leafly.com/indica/hindu-kush\">Hindu Kush</a> and <a href=\"http://www.leafly.com/indica/purple-afghani\">Purple Afghani</a> cross. Its aroma is subtle and <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> with <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> overtones typical of Kush varieties. <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">Blissful</a>, long-lasting <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a> blankets the mind while physical <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> rids the body of <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">sleeplessness</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>. Purple Kush will grow wide rather than tall, and will be ready for harvest following an 8 week flowering time.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-kush_100x100_c1f3.jpg','https://leafly.blob.core.windows.net/reviews/purple-kush_100x100_2c95.jpg','https://leafly.blob.core.windows.net/reviews/purple-kush_100x100_5441.jpg','https://leafly.blob.core.windows.net/reviews/purple-kush_100x100_2800.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363269/b/purple-kush__primary_39ca.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362925/b/purple-kush__primary_bccb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361868/b/purple-kush__primary_d048.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360490/b/purple-kush__primary_ee5c.jpg','https://leafly.s3.amazonaws.com/strains/testing/0FRudDkkRoySCT4abcCg_purple-kush.png',73.8056,59.3096,59.2895,50.8804,42.7907,46.0209,38.7358,34.0597,30.0474,20.2341,32.4723,14.367,10.5661,30.0474,20.2341,NULL),(98,210,'Pineapple Express','pineapple-express','Hybrid','Pex','<p>Pineapple Express was bred by G13 labs and is the child of <a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> and <a href=\"http://www.leafly.com/sativa/hawaiian\">Hawaiian</a>. The smell has been likened to fresh apple and mango, with a taste of pineapple, pine and cedar. This hard-hitting sativa provides an energetic high up to 2 hours and has a THC content up to 17% with CBD of 0.17%. Pineapple Express is a marijuana strain with light green buds that are dense with thick resin.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/pineapple-express/primary?width=200','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_0868.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_91ab.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-express_100x100_182b.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/pineapple-express/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364875/b/pineapple-express__primary_7376.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364405/b/pineapple-express__primary_6f70.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363517/b/pineapple-express__primary_9c88.jpg',NULL,80.6027,59.5691,58.8221,53.8089,47.7211,37.8567,29.5713,22.178,14.7958,13.1648,28.4675,12.6351,8.98229,14.7958,13.1648,'Moderate'),(99,227,'Alaskan Thunder Fuck','alaskan-thunder-fuck','Sativa','Atf','<p>Alaskan Thunder Fuck is a strong sativa that will have you feeling the effects soon after exhale. &nbsp;Can also be known as Matanuska Thunder Fuck because it originates from the Matanuska Valley in Alaska.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/alaskan-thunder-fuck_100x100_a311.jpg','https://leafly.blob.core.windows.net/reviews/alaskan-thunder-fuck_100x100_1df9.jpg','https://leafly.blob.core.windows.net/reviews/alaskan-thunder-fuck_100x100_4b27.jpg','https://leafly.blob.core.windows.net/reviews/alaskan-thunder-fuck_100x100_8995.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364575/b/alaskan-thunder-fuck__primary_1581.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364716/b/alaskan-thunder-fuck__primary_174b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363248/b/alaskan-thunder-fuck__primary_ae5c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360269/b/alaskan-thunder-fuck__primary_36db.jpg',NULL,75.4203,62.8884,62.4076,56.8899,45.7818,36.0165,29.5339,24.3248,15.523,15.2793,26.3848,15.1702,14.843,15.523,15.2793,NULL),(100,2,'Chemdawg','chemdawg','Hybrid','Cd','<p>Chemdawg has developed quite the name for itself over the years. Between its mysterious origin, ambiguous genetics, and the plethora of successful crosses the strain has produced, Chemdawg has practically secured itself a permanent place in the cannabis hall of fame. The original source of powerhouse strains like <a href=\"http://leafly.com/sativa/sour-diesel\">Sour Diesel</a> and <a href=\"http://leafly.com/hybrid/og-kush\">OG Kush</a>, Chemdawg is known for its distinct, <a href=\"http://www.leafly.com/explore#!/explore/flavors-diesel\">diesel</a>-like aroma. <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">Pungent</a> and sharp, you&rsquo;ll be able to smell this <a href=\"http://leafly.com/hybrid\">hybrid</a> from a mile away.&nbsp;</p>\n\n<p>Cannabis newbies be warned: Chemdawg tends to be very potent. Depending on grow conditions, this strain tends to have THC levels of 15-20%. Consumers can expect to have a very cerebral experience, coupled with a strong heavy-bodied feeling.&nbsp;</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/chemdawg/primary?width=200','https://leafly.blob.core.windows.net/reviews/chemdawg_100x100_ad5b.jpg','https://leafly.blob.core.windows.net/reviews/chemdawg_100x100_595f.jpg','https://leafly.blob.core.windows.net/reviews/chemdawg_100x100_960e.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/chemdawg/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364597/b/chemdawg__primary_63bb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363633/b/chemdawg__primary_5920.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356332/b/chemdawg__primary_b716.jpg','https://leafly.s3.amazonaws.com/strains/testing/oUFIqnrFSkcH8LUp8nqm_chemdawg.png',65.1549,61.9159,57.7089,53.4706,35.0801,36.3962,35.2603,27.0359,13.7595,13.6054,30.1922,10.1299,7.97597,13.7595,13.6054,NULL),(101,52,'Durban Poison','durban-poison','Sativa','Dp','<p>This pure <a href=\"http://www.leafly.com/sativa\">sativa</a> originates from the South African port city of Durban. It has gained notoriety worldwide for its <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> smell and <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects. <a href=\"http://www.leafly.com/sativa/durban-poison\">Durban Poison</a> is the perfect strain to help you stay productive through a busy day, when exploring the outdoors, or to lend a spark of <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a>.</p>\n\n<p>Growers and concentrate enthusiasts will both enjoy the over-sized resin glands which make this strain a quality choice for concentrate extraction. The buds are round and chunky, and leave a thick coating of <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a> on almost all areas of the plant.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/durban-poison/primary?width=200','https://leafly.blob.core.windows.net/reviews/durban-poison_100x100_b0f9.jpg','https://leafly.blob.core.windows.net/reviews/durban-poison_100x100_6792.jpg','https://leafly.blob.core.windows.net/reviews/durban-poison_100x100_f063.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/durban-poison/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364857/b/durban-poison__primary_a039.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365037/b/durban-poison__primary_c705.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364596/b/durban-poison__primary_7ae7.jpg','https://leafly.s3.amazonaws.com/strains/testing/OXz2lmTcR3pDznospvCv_durban-poison.png',67.3239,65.9578,61.3626,55.5456,46.6796,36.6341,27.2483,23.5165,12.9613,10.5595,24.9634,10.9651,9.57454,12.9613,10.5595,'Easy'),(102,6,'Super Silver Haze','super-silver-haze','Sativa','Ss','<p>Super Silver Haze was the first prize winner at the <em>High Times</em> Cannabis Cup in 1997, 1998, and 1999. It also won awards at the<em> High Times</em> Harvest Festival. By crossing the genetics of <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a>, <a href=\"http://www.leafly.com/indica/northern-lights\">Northern Lights</a>, and <a href=\"http://leafly.com/sativa/haze\">Haze</a>, we are left with a beautiful, sticky sativa&nbsp;blend that boasts an <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a>, long-lasting body high. The <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects are a great remedy for high stress levels or when suffering from a <a href=\"http://www.leafly.com/explore#!/explore/symptoms-lack-of-appetite\">lack of appetite</a> or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-nausea\">nausea</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/super-silver-haze/primary?width=200','https://leafly.blob.core.windows.net/reviews/super-silver-haze_100x100_ad34.jpg','https://leafly.blob.core.windows.net/reviews/super-silver-haze_100x100_d064.jpg','https://leafly.blob.core.windows.net/reviews/super-silver-haze_100x100_2387.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/super-silver-haze/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358155/b/super-silver-haze__primary_e20c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357360/b/super-silver-haze__primary_b9a8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356790/b/super-silver-haze__primary_cc6a.jpg',NULL,76.9982,67.1239,66.4184,58.7525,51.4643,44.1142,34.5795,28.2008,18.0138,17.9913,30.4295,14.0994,9.90153,18.0138,17.9913,NULL),(103,1875,'Lemon Haze','lemon-haze','Sativa','Lh','<p>Lemon Haze has been characterized as smelling of fresh peeled lemon slices with a similar taste. Its buds appear to be green and yellow with amber hairs on the trichomes, giving it the yellow tint. This strain&#39;s THC has been measured at about 15-20% with a&nbsp;CBD of 0.38%.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/lemon-haze_100x100_6be4.jpg','https://leafly.blob.core.windows.net/reviews/lemon-haze_100x100_978f.jpg','https://leafly.blob.core.windows.net/reviews/lemon-haze_100x100_e57c.jpg','https://leafly.blob.core.windows.net/reviews/lemon-haze_100x100_4960.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364813/b/lemon-haze__primary_f0a7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364345/b/lemon-haze__primary_88d0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364281/b/lemon-haze__primary_20e2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363615/b/lemon-haze__primary_430b.jpg',NULL,83.2282,65.5261,65.494,54.07,52.4592,35.9554,29.8022,21.1998,13.9002,12.6493,27.2312,13.7299,9.21282,13.9002,12.6493,NULL),(104,292,'Blackberry Kush','blackberry-kush','Indica','Bbk','<p dir=\"ltr\" style=\"line-height:1.15;margin-top:0pt;margin-bottom:0pt;\">This mostly indica strain is a mix of <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> and <a href=\"http://www.leafly.com/hybrid/blackberry\">Blackberry</a> strains and has beautiful dark purple buds with orange hairs. Plants will flower at 7-8 weeks and are not particularly high yielders, but the dense, hard nugs have crystals throughout. Blackberry Kush tends to have a hashy, jet fuel smell and taste that is balanced by sweet berries. Blackberry Kush is often recommended for the treatment of pain thanks to its strong indica body effects.</p>\n\n<p dir=\"ltr\" style=\"line-height:1.15;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/blackberry-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/blackberry-kush_100x100_a7fd.jpg','https://leafly.blob.core.windows.net/reviews/blackberry-kush_100x100_9f55.jpg','https://leafly.blob.core.windows.net/reviews/blackberry-kush_100x100_674d.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/blackberry-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363212/b/blackberry-kush__primary_e0a3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/359053/b/blackberry-kush__primary_1872.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358182/b/blackberry-kush__primary_eae5.jpg',NULL,78.3188,56.8026,52.6028,47.24,36.9534,48.9438,45.4663,43.7863,21.4582,21.1634,36.9678,13.7092,12.1025,21.4582,21.1634,NULL),(105,15,'Strawberry Cough','strawberry-cough','Sativa','Sc','<p>Known for its <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> smell of fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-strawberry\">strawberries</a> and an expanding sensation that can make even the most seasoned consumer cough, Strawberry Cough combines the mysterious Strawberry Fields strain with <a href=\"http://www.leafly.com/sativa/haze\">Haze</a> genetics to create a potent <a href=\"http://www.leafly.com/sativa\">sativa</a> blend. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunky</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> flavors will capture your senses while the cerebral, <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects provide an aura of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a> that is sure to leave a <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">smile</a> on your face. Strawberry Cough is a great solution for managing social <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxieties</a> and to balance yourself in times of elevated <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/strawberry-cough/primary?width=200','https://leafly.blob.core.windows.net/reviews/strawberry-cough_100x100_84e8.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-cough_100x100_1063.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-cough_100x100_cb42.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/strawberry-cough/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365070/b/strawberry-cough__primary_070f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362635/b/strawberry-cough__primary_14c3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361259/b/strawberry-cough__primary_b093.jpg',NULL,77.5462,64.3961,63.3075,49.7906,49.2969,42.0252,33.2545,28.433,14.7599,14.1452,35.1008,12.455,11.0584,14.7599,14.1452,NULL),(106,38,'Grape Ape','grape-ape','Indica','Ga','<p>Grape Ape, propagated by Apothecary Genetics and Barney&rsquo;s Farm, is a mostly <a href=\"http://leafly.com/indica\">indica</a> strain that crosses <a href=\"http://www.leafly.com/hybrid/mendocino-purps\">Mendocino Purps</a>, <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a>, and <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a>. Named for its distinct <a href=\"http://www.leafly.com/explore#!/explore/flavors-grape\">grape</a>-like smell, this indica is known for providing carefree <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> that can help soothe <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>, and <a href=\"http://www.leafly.com/explore#!/explore/tags-anxious\">anxiety</a>. Its dense, compact buds are wreathed in deep purple leaves which darken as this indica reaches full maturation following its 7 to 8 week flowering time.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/grape-ape/primary?width=200','https://leafly.blob.core.windows.net/reviews/grape-ape_100x100_9f1d.jpg','https://leafly.blob.core.windows.net/reviews/grape-ape_100x100_e259.jpg','https://leafly.blob.core.windows.net/reviews/grape-ape_100x100_a1d4.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/grape-ape/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363470/b/grape-ape__primary_1e30.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363533/b/grape-ape__primary_6649.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358618/b/grape-ape__primary_47b6.jpg','https://leafly.s3.amazonaws.com/strains/testing/CK2T2q2dShWQSWp9zArv_grape-ape.png',79.4286,53.1588,50.4342,46.5332,31.1832,43.3793,42.6902,34.4019,24.0949,15.3482,26.4979,11.2137,8.26372,24.0949,15.3482,NULL),(107,117,'Master Kush','master-kush','Indica','Mks','<p>Master Kush is a popular <a href=\"http://leafly.com/indica\">indica</a> cross between <a href=\"http://www.leafly.com/indica/hindu-kush\">Hindu Kush</a> and <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a> that originated in Amsterdam and has remained a coffeeshop staple ever since. During most of the plant&#39;s growth, its aroma is nearly undetectable, but it produces a subtle <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> smell during maturation.&nbsp;With Master Kush, you can anticipate full-body <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> coupled with sharpened sensory awareness that can bring out the best of any activity.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/master-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/master-kush_100x100_25bd.jpg','https://leafly.blob.core.windows.net/reviews/master-kush_100x100_a931.jpg','https://leafly.blob.core.windows.net/reviews/master-kush_100x100_64ad.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/master-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364715/b/master-kush__primary_ace9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364383/b/master-kush__primary_139d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363765/b/master-kush__primary_c024.jpg',NULL,79.933,61.0973,58.1798,49.3646,46.218,44.9871,36.9948,29.8758,27.6478,17.9338,31.415,9.96233,9.94943,27.6478,17.9338,NULL),(108,302,'Cheese','cheese','Hybrid','Che','<p>Named for its sharply sour aroma, Cheese is an indica-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> from the U.K. that has achieved widespread popularity for its unique flavor and consistent potency. With origins that stretch back to the late 1980s, Cheese is said to descend from a <a href=\"http://leafly.com/hybrid/skunk-1\">Skunk #1</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> whose pungent aroma made it stand out. Breeders like Big Buddha Seeds later introduced <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> indica genetics to increase Cheese&rsquo;s <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichome</a> production and yields. The resulting hybrid is now well-known for its <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed/\">relaxed</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-happy/\">happy</a> effects that gently ease you into a blissful&nbsp;state of mind.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/cheese/primary?width=200','https://leafly.blob.core.windows.net/reviews/cheese_100x100_6993.jpg','https://leafly.blob.core.windows.net/reviews/cheese_100x100_83cb.jpg','https://leafly.blob.core.windows.net/reviews/cheese_100x100_515a.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/cheese/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364437/b/cheese__primary_3402.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364300/b/cheese__primary_67b5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361132/b/cheese__primary_8bd7.jpg',NULL,67.0396,66.3143,50.9608,40.9241,33.2482,39.2537,29.535,26.7136,20.938,13.7794,27.8167,9.64231,8.95176,20.938,13.7794,NULL),(109,180,'Super Lemon Haze','super-lemon-haze','Sativa','Slh','<p>A sativa-dominant&nbsp;hybrid of Lemon Skunk and Super Silver Haze and two time Cannabis Cup winner from Green House Seeds. Super Lemon Haze is a kief-caked multi-colored wonder. As the name states this strain has real lemony characteristics. The smell is zesty, citrusy, and a little sweet. As for the taste, it&#39;s everything one would expect from the namesake; tart and sweet like lemonheads candy - not quite as sharp as one might expect. The effects are uniquely energetic and lively, may not be the best strain for those of us that are naturally wound-up tight.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/super-lemon-haze/primary?width=200','https://leafly.blob.core.windows.net/reviews/super-lemon-haze_100x100_5465.jpg','https://leafly.blob.core.windows.net/reviews/super-lemon-haze_100x100_1a7f.jpg','https://leafly.blob.core.windows.net/reviews/super-lemon-haze_100x100_673a.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/super-lemon-haze/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364425/b/super-lemon-haze__primary_7d62.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363730/b/super-lemon-haze__primary_4264.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357131/b/super-lemon-haze__primary_88cf.jpg','https://leafly.s3.amazonaws.com/strains/testing/ZJMB1Q4JQAq4Ha1PAkwx_super-lemon-haze.png',76.5585,71.7739,70.4819,65.805,57.9287,47.7047,35.5737,33.572,16.4823,11.9345,31.1051,10.4922,8.80164,16.4823,11.9345,NULL),(110,47,'Afghan Kush','afghan-kush','Indica','Afk','<p>Afghan Kush&#39;s roots trace back to the <a href=\"http://www.leafly.com/indica/hindu-kush\">Hindu Kush</a> mountain range near the Afghanistan-Pakistan border, but this potent <a href=\"http://www.leafly.com/indica\">indica</a> has since traveled far from its homeland. Revered for its heavy resin content and heavily sedating effects, Afghan Kush is a top choice for anyone looking to <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relax</a> after a long day.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/afghan-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/afghan-kush_100x100_28e3.jpg','https://leafly.blob.core.windows.net/reviews/afghan-kush_100x100_8b0f.jpg','https://leafly.blob.core.windows.net/reviews/afghan-kush_100x100_89bf.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/afghan-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363759/b/afghan-kush__primary_794f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356331/b/afghan-kush__primary_cf7e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353325/b/afghan-kush__primary_a2c3.jpg',NULL,59.5896,53.4313,49.0344,37.6991,35.3729,39.6351,29.6039,27.0471,22.0695,18.2474,24.9232,9.18941,9.07342,22.0695,18.2474,NULL),(111,43,'Maui Waui','maui-waui','Sativa','Mw','<p>Maui Waui (or Maui Wowie) is a classic <a href=\"http://leafly.com/sativa\">sativa</a> whose <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical/\">tropical</a> flavors and stress-relieving qualities will float you straight to the shores of Hawaii where this strain was originally born and raised. Since its beginnings in the island&rsquo;s volcanic soil, Maui Waui has spread across the world to bless us with its sweet <a href=\"http://www.leafly.com/explore#!/explore/flavors-pineapple/\">pineapple</a> flavors and <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">high-energy</a> <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. Lightweight sativa effects allow your mind to drift away to <a href=\"http://www.leafly.com/explore#!/explore/tags-creative/\">creative</a> escapes, while Maui Waui&rsquo;s motivating, active effects may be all you need to get outside and enjoy the sun. This tall, lanky strain is best suited for cultivation in warm, tropical climates that mirror its homeland, but a bright environment and nutrient-rich soil are typically adequate for indoor growth. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/maui-waui_100x100_4e68.jpg','https://leafly.blob.core.windows.net/reviews/maui-waui_100x100_e105.jpg','https://leafly.blob.core.windows.net/reviews/maui-waui_100x100_d279.jpg','https://leafly.blob.core.windows.net/reviews/maui-waui_100x100_7a85.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362514/b/maui-waui__primary_6b84.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358231/b/maui-waui__primary_c23f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358222/b/maui-waui__primary_11b7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356561/b/maui-waui__primary_b2a0.jpg',NULL,79.7464,69.6729,65.2677,57.0427,46.9706,37.5418,30.5475,19.9914,15.3347,11.4598,28.816,11.876,10.5593,15.3347,11.4598,NULL),(112,163,'White Rhino','white-rhino','Indica','Wr','<p>White Rhino is a hybrid of <a href=\"http://leafly.com/hybrid/white-widow\">White Widow</a> and an unknown North American <a href=\"/indica\">indica strain</a>, creating a bushy and stout plant. The buds give off a strong and heady high. The plant&#39;s parentage hails from Afghanistan, Brazil, and India. White Rhino is one of the best types of marijuana for medicinal use since it has such a high THC content.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/white-rhino/primary?width=200','https://leafly.blob.core.windows.net/reviews/white-rhino_100x100_30f6.jpg','https://leafly.blob.core.windows.net/reviews/white-rhino_100x100_bf8c.jpg','https://leafly.blob.core.windows.net/reviews/white-rhino_100x100_c9ad.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/white-rhino/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364311/b/white-rhino__primary_0069.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358480/b/white-rhino__primary_3e5b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358355/b/white-rhino__primary_04a5.jpg',NULL,64.3098,51.1173,41.6474,36.5476,33.9086,33.0678,26.7038,20.1266,18.9186,12.9428,20.4358,8.64867,6.93784,18.9186,12.9428,NULL),(113,21,'LA Confidential','la-confidential','Indica','La','<p>LA Confidential is known as a very popular and successful strain. Its&nbsp;buds have a frosty, lime green appearance&nbsp;and little purple leaves. The taste is smooth and piney, with a classic skunky aroma that does not linger for too long. Overall,&nbsp;LA Confidential is a well-rounded strain that&nbsp;delivers a fast-approaching sensation that is both psychedelic and super calming on the mind and body. For newer patients seeking relief,&nbsp;LA Confidential can both lull you&nbsp;to sleep and treat acute pain.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/la-confidential/primary?width=200','https://leafly.blob.core.windows.net/reviews/la-confidential_100x100_0bf2.jpg','https://leafly.blob.core.windows.net/reviews/la-confidential_100x100_4b54.jpg','https://leafly.blob.core.windows.net/reviews/la-confidential_100x100_5788.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/la-confidential/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358356/b/la-confidential__primary_6b24.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356622/b/la-confidential__primary_dd30.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356512/b/la-confidential__primary_e871.jpg','https://leafly.s3.amazonaws.com/strains/testing/Zc1LA1fZRBt3XH9al9rQ_la-confidential.png',77.2511,65.4328,54.9858,49.4649,47.916,50.54,49.8192,36.8877,28.7241,15.5328,33.438,12.4068,12.2116,28.7241,15.5328,NULL),(114,298,'Chocolope','chocolope','Sativa','Chc','<p>DNA Genetics developed Chocolope by crossing <a href=\"http://www.leafly.com/sativa/chocolate-thai\">Chocolate Thai</a> with <a href=\"http://www.leafly.com/sativa/cannalope-haze\">Cannalope Haze</a> to create their homage to the Chocolate strains of the 1980s. The hefty <a href=\"http://www.leafly.com/sativa\">sativa</a> buds give <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a>, sweet <a href=\"http://www.leafly.com/explore#!/explore/flavors-coffee\">coffee</a> flavors that provide a dreamy, cerebral effect. Consumers report a strong, <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> mental shift that is great when coping with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a> or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/chocolope/primary?width=200','https://leafly.blob.core.windows.net/reviews/chocolope_100x100_de10.jpg','https://leafly.blob.core.windows.net/reviews/chocolope_100x100_0895.jpg','https://leafly.blob.core.windows.net/reviews/chocolope_100x100_a1e1.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/chocolope/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363537/b/chocolope__primary_3af1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361837/b/chocolope__primary_7c15.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344430/b/chocolope__primary_8e7a.jpg',NULL,74.8447,67.8577,63.9043,50.6031,46.9585,49.1131,39.8377,26.7511,19.4673,15.649,34.8488,11.0078,10.4189,19.4673,15.649,'Easy'),(115,2215,'Cherry Pie','cherry-pie','Hybrid','Cp','<p>Cherry Pie&#39;s parents are <a href=\"http://www.leafly.com/indica/granddaddy-purple\">Granddaddy Purple</a> and <a href=\"http://www.leafly.com/sativa/durban-poison\">Durban Poison</a>. With buds that are dense and full of&nbsp;orange hairs and a touch of purple, this strain smells of sweet and sour cherry pie. The effects have&nbsp;been known to come on in minutes and stick around for a couple hours.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cherry-pie_100x100_9ec0.jpg','https://leafly.blob.core.windows.net/reviews/cherry-pie_100x100_03b3.jpg','https://leafly.blob.core.windows.net/reviews/cherry-pie_100x100_00a0.jpg','https://leafly.blob.core.windows.net/reviews/cherry-pie_100x100_fb9f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364443/b/cherry-pie__primary_6818.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363437/b/cherry-pie__primary_d745.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363179/b/cherry-pie__primary_5ef0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362988/b/cherry-pie__primary_6382.jpg','https://leafly.s3.amazonaws.com/strains/testing/fMIqy3lRTOaZAwPvz7jr_cherry-pie.png',63.2887,60.3229,56.6017,46.3141,32.9741,39.745,27.9242,22.5222,15.417,15.1164,21.4026,8.58725,7.55848,15.417,15.1164,NULL),(116,261,'Amnesia Haze','amnesia-haze','Sativa','Amh','<p>With <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> flavors of <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemons</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a>, Amnesia Haze is a perfect strain to start your day with a <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">smile</a>. The <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a> buzz is one you won&rsquo;t soon forget. Its genetics have been traced back to the <a href=\"http://www.leafly.com/indica/south-asian\">South Asian</a> and <a href=\"http://www.leafly.com/sativa/jamaican\">Jamaican</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace</a> strains, and this Cannabis Cup winner (1st place 2004, 1st place Sativa Cup 2012) has since been popularized in the coffee shops of Amsterdam.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/amnesia-haze_100x100_a977.jpg','https://leafly.blob.core.windows.net/reviews/amnesia-haze_100x100_2d00.jpg','https://leafly.blob.core.windows.net/reviews/amnesia-haze_100x100_8b68.jpg','https://leafly.blob.core.windows.net/reviews/amnesia-haze_100x100_900c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364377/b/amnesia-haze__primary_3e17.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361450/b/amnesia-haze__primary_bfef.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353306/b/amnesia-haze__primary_f21a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353520/b/amnesia-haze__primary_14cf.jpg',NULL,69.5455,55.5756,54.0399,41.5994,36.4448,29.6326,23.794,16.5709,12.1112,11.0675,20.4584,6.5533,5.21078,12.1112,11.0675,NULL),(117,34,'Purple Urkle','purple-urkle','Indica','Pu','<p>Purple Urkle&rsquo;s history is as complex as its flavor palate. A California strain, the origins are believed to stem from a select <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> of either <a href=\"http://www.leafly.com/indica/granddaddy-purple\">Granddaddy Purple</a> or <a href=\"http://www.leafly.com/hybrid/mendocino-purps\">Mendocino Purps</a>, while the essence is a blend of <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunk</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a>, and fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-grape\">grapes</a>. Consumers report the <a href=\"http://www.leafly.com/indica\">indica</a> effects to be deeply <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleep-inducing</a>, and a great option for full-body <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain relief</a>. The short onset of effects make it a perfect nighttime strain for those who suffer from <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">insomnia</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-urkle_100x100_62c7.jpg','https://leafly.blob.core.windows.net/reviews/purple-urkle_100x100_0480.jpg','https://leafly.blob.core.windows.net/reviews/purple-urkle_100x100_d02a.jpg','https://leafly.blob.core.windows.net/reviews/purple-urkle_100x100_46f9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364363/b/purple-urkle__primary_c61b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362795/b/purple-urkle__primary_3299.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362510/b/purple-urkle__primary_6b69.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360331/b/purple-urkle__primary_8a39.jpg',NULL,72.6029,63.041,43.2721,40.5402,30.1252,48.3324,41.6484,33.5933,18.6461,15.5796,30.5046,11.3511,10.6486,18.6461,15.5796,NULL),(118,192,'Skywalker','skywalker','Indica','Sky','<p>Skywalker is a well-rounded indica-dominant hybrid that helps patients knock out pain and relax into sleep after a long day of battling the Dark Side. The sativa side of this strain allows for a nice head high as well, but it isn&rsquo;t overly hazy or unfocused. Skywalker was created by Amsterdam&rsquo;s Dutch Passion Seeds to combine the sweet fruity aroma of <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> with the growing strengths of the hardy, high-yielding <a href=\"http://www.leafly.com/indica/mazar-i-sharif\">Mazar</a>. Great for indoor growing, Skywalker plants will stay shorter and bushy, flowering in 8 to 9 weeks. If you&rsquo;re looking for the California Skywalker that has OG genetics, check out <a href=\"http://www.leafly.com/hybrid/skywalker-og\">Skywalker OG</a>.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/skywalker_100x100_4a11.jpg','https://leafly.blob.core.windows.net/reviews/skywalker_100x100_3c3c.jpg','https://leafly.blob.core.windows.net/reviews/skywalker_100x100_9ae0.jpg','https://leafly.blob.core.windows.net/reviews/skywalker_100x100_dbdc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360565/b/skywalker__primary_68ba.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354819/b/skywalker__primary_4dce.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354319/b/skywalker__primary_cd0d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352010/b/skywalker__primary_2c8b.jpg',NULL,71.6347,63.8485,51.9658,45.4377,39.2569,48.1145,42.9862,30.8338,28.0729,20.2175,30.8952,9.79314,9.28897,28.0729,20.2175,NULL),(119,614,'Lemon Kush','lemon-kush','Hybrid','Lk','<p>The general consensus surrounding Lemon Kush is that is a cross between <a href=\"http://www.leafly.com/indica/master-kush\">Master Kush</a> and Lemon Joy. However, breeder specific variations exist. Alien Genetics, for example, explains their Lemon Kush as a <a href=\"http://www.leafly.com/hybrid\">hybrid</a> between <a href=\"http://www.leafly.com/sativa/lemon-g\">Lemon G</a>, a prized strain from Ohio, and an <a href=\"http://www.leafly.com/indica/afghan-kush\">Afghan Kush</a>. The genetics are the only area of dispute as everyone will agree that the <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> flavors of <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> mix exceptionally well with the <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> kush undertones. The light green buds are covered in a white frosting of <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a> and provide <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> effects. Lemon Kush is the perfect solution for when the <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stresses</a> of life have you <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">feeling sour</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/lemon-kush_100x100_099e.jpg','https://leafly.blob.core.windows.net/reviews/lemon-kush_100x100_4592.jpg','https://leafly.blob.core.windows.net/reviews/lemon-kush_100x100_9561.jpg','https://leafly.blob.core.windows.net/reviews/lemon-kush_100x100_f483.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363993/b/lemon-kush__primary_36e7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362486/b/lemon-kush__primary_86b1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362826/b/lemon-kush__primary_34d4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356768/b/lemon-kush__primary_fc55.jpg',NULL,69.5412,62.2712,55.6644,54.6105,40.9875,37.8792,29.3596,25.4013,21.0466,16.3949,31.3473,12.5943,8.22556,21.0466,16.3949,NULL),(121,41,'Purple Haze','purple-haze','Sativa','Ph','<p>Named after Jimi Hendrix&rsquo;s 1967 classic, Purple Haze delivers a dreamy burst of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a> that brings veteran consumers back to their psychedelic heyday. This nostalgic <a href=\"http://leafly.com/sativa\">sativa</a> staple remains cherished for its <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">high-energy</a> cerebral stimulation that awakens <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a> and blissful <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">contentment</a> throughout the day. Purple Haze is believed to have descended from parent strains <a href=\"http://www.leafly.com/sativa/purple-thai\">Purple Thai</a> and <a href=\"http://leafly.com/sativa/haze\">Haze</a>, who pass on a mix of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> flavors underscored by notes of <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> and sharp <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spice</a>. Following her 8 to 9 week flowering time, Purple Haze buds typically acquire vibrant hues of lavender that further justify the naming of this strain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-haze_100x100_0554.jpg','https://leafly.blob.core.windows.net/reviews/purple-haze_100x100_328b.jpg','https://leafly.blob.core.windows.net/reviews/purple-haze_100x100_8655.jpg','https://leafly.blob.core.windows.net/reviews/purple-haze_100x100_4c90.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364517/b/purple-haze__primary_8221.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364234/b/purple-haze__primary_2108.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363856/b/purple-haze__primary_8ab9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363074/b/purple-haze__primary_bbe0.jpg',NULL,61.0277,55.792,53.9493,43.598,39.4632,25.0637,24.6228,20.1032,13.7496,10.3544,21.8499,8.41876,6.91656,13.7496,10.3544,NULL),(122,8509,'Skywalker OG','skywalker-og','Hybrid','Sko','<p>Skywalker OG is a potent indica-dominant hybrid strain that may just take you to a galaxy far, far away. No Sith genetics here&mdash;this plant is a cross between <a href=\"http://www.leafly.com/hybrid/skywalker\">Skywalker</a> and <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and has the strong aroma characteristic to kush strains that includes a spicy herbal scent tinged with jet fuel. This strain makes relaxation your only mission, and some users report strong body effects that include mild tingling and numbness. If pain and physical limitations are the issue, Skywalker OG is here to rescue you. The galaxy also holds a sativa dominant variety of Skywalker that is also often referred to as Skywalker OG or Sativa OG.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/skywalker-og_100x100_1865.jpg','https://leafly.blob.core.windows.net/reviews/skywalker-og_100x100_fa4e.jpg','https://leafly.blob.core.windows.net/reviews/skywalker-og_100x100_b505.jpg','https://leafly.blob.core.windows.net/reviews/skywalker-og_100x100_8ab3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363081/b/skywalker-og__primary_0a37.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362491/b/skywalker-og__primary_4db8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360024/b/skywalker-og__primary_e7db.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358183/b/skywalker-og__primary_09b7.jpg','https://leafly.s3.amazonaws.com/strains/testing/kKeUi1sATnSLvG8NPmmG_skywalker-og.png',83.8564,70.3988,63.9182,51.6117,40.4388,45.9782,40.2133,29.7215,28.8756,18.9867,35.1871,14.9844,14.2643,28.8756,18.9867,NULL),(123,1501,'Death Star','death-star','Indica','Ds','<p><span style=\"line-height: 20.7999992370605px;\">Death Star is the potent cross of&nbsp;</span><a href=\"http://www.leafly.com/indica/sensi-star\" style=\"line-height: 20.7999992370605px;\"><span class=\"s1\">Sensi Star</span></a><span style=\"line-height: 20.7999992370605px;\">&nbsp;and&nbsp;</span><span class=\"s1\" style=\"line-height: 20.7999992370605px;\"><a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>&nbsp;and&nbsp;</span><span style=\"line-height: 20.7999992370605px;\">has the shared sativa and indica effects of its parents. It&nbsp;has a mixed taste that combines sweet, skunk, and fuel aromas into a very potent fragrance that isn&rsquo;t easy to hide. This strain may not have the ability to destroy planets, but it does have quite the powerful buzz. Effects can be slow to onset, but once they do, Death Star takes away all cares and replaces them with a state of relaxed euphoria. Great for daytime or nighttime use, this Ohio native now has fans throughout the galaxy.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/death-star/primary?width=200','https://leafly.blob.core.windows.net/reviews/death-star_100x100_ed1a.jpg','https://leafly.blob.core.windows.net/reviews/death-star_100x100_33d9.jpg','https://leafly.blob.core.windows.net/reviews/death-star_100x100_b40a.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/death-star/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364277/b/death-star__primary_473e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363484/b/death-star__primary_559c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363594/b/death-star__primary_2fba.jpg',NULL,84.2824,69.7316,64.5766,54.4286,41.219,45.5446,43.9534,28.4754,25.2602,23.2401,37.8763,16.7533,15.5253,25.2602,23.2401,NULL),(124,79,'Bubble Gum','bubble-gum','Hybrid','Bg','<p>Originally Bubble Gum was developed by growers in Indiana. &nbsp;From there the genetics moved to New England and eventually Holland. &nbsp;It took many generations to finally produce a stable Bubble Gum with the characteristic sweet smell and euphoric high. &nbsp;Winner of two awards in the Cannabis Cup of &#39;94, 2nd place in &#39;95 and again in &#39;99.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/bubble-gum/primary?width=200','https://leafly.blob.core.windows.net/reviews/bubble-gum_100x100_bdc1.jpg','https://leafly.blob.core.windows.net/reviews/bubble-gum_100x100_b541.jpg','https://leafly.blob.core.windows.net/reviews/bubble-gum_100x100_07a5.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/bubble-gum/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362448/b/bubble-gum__primary_ff74.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361995/b/bubble-gum__primary_eedb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361131/b/bubble-gum__primary_d0b6.jpg',NULL,67.7086,56.5892,53.0847,40.83,37.1791,37.5178,28.5738,24.2514,16.2657,15.9644,25.3446,10.8745,9.66465,16.2657,15.9644,NULL),(126,45,'NYC Diesel','nyc-diesel','Hybrid','Nyc','<p>NYC Diesel by Soma Sacred Seeds is a 60% sativa-dominant cross between a <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a> clone and an <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a>/<a href=\"http://www.leafly.com/sativa/hawaiian\">Hawaiian</a> male. This sativa-leaning strain provides strong cerebral effects that ease into a deep, full-body relaxation over time. A pungent <a href=\"http://www.leafly.com/explore#!/explore/flavors-lime\">lime</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-grapefruit\">grapefruit</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/terpenes-the-flavors-of-cannabis-aromatherapy\">aroma</a> is the mark of a high quality batch, like those that won this strain five Cannabis Cup trophies in the early 2000s. NYC Diesel&rsquo;s happy, talkative qualities make this hybrid a good choice for social activities and many <a href=\"http://www.leafly.com/explore#!/explore/tags-anxious\">anxiety-prone</a> consumers praise it for its paranoia-free effects.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/nyc-diesel/primary?width=200','https://leafly.blob.core.windows.net/reviews/nyc-diesel_100x100_5a5c.jpg','https://leafly.blob.core.windows.net/reviews/nyc-diesel_100x100_5230.jpg','https://leafly.blob.core.windows.net/reviews/nyc-diesel_100x100_9ca0.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/nyc-diesel/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364381/b/nyc-diesel__primary_17c8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353898/b/nyc-diesel__primary_273a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353105/b/nyc-diesel__primary_16cb.jpg',NULL,77.1881,64.8778,62.0163,59.7736,51.3766,46.8988,32.1805,30.5614,18.3267,16.0336,27.2704,13.7539,12.9577,18.3267,16.0336,NULL),(127,200,'Mango Kush','mango-kush','Hybrid','Mgk','<p>The Mango Kush marijuana strain tastes similar to the the actual <a href=\"http://www.leafly.com/explore#!/explore/flavors-mango\">mango</a> fruit, with a distinct kush flavor, and hints of <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> on the exhale. It&#39;s buds are covered with orange <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">pistils</a> and are described as very dense. The plant has an average growth height of 4-5 feet. Flowering is 9-11 weeks and is a favorite with both indoor and outdoor growers. The buds have thick shiny trichomes which are evident when the bud is broken apart. The smell and taste are the same and described as mango and banana. THC content has been measured up to 16% and CBD at 0.3%.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/mango-kush_100x100_fe35.jpg','https://leafly.blob.core.windows.net/reviews/mango-kush_100x100_d47f.jpg','https://leafly.blob.core.windows.net/reviews/mango-kush_100x100_7c72.jpg','https://leafly.blob.core.windows.net/reviews/mango-kush_100x100_a697.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364880/b/mango-kush__primary_6c49.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358171/b/mango-kush__primary_27b3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358295/b/mango-kush__primary_875c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354996/b/mango-kush__primary_8903.jpg',NULL,74.6345,64.5552,47.3054,45.0978,37.4812,34.1329,20.4402,20.0548,13.9898,12.5265,22.9029,10.7463,9.02796,13.9898,12.5265,NULL),(128,30,'Hindu Kush','hindu-kush','Indica','Hk','<p>Hindu Kush is a pure <a href=\"http://leafly.com/indica\">indica</a> strain named after the mountain range stretching 500 miles between Pakistan and Afghanistan where it originated. The harsh climate of its homeland has conditioned this strain to express a thick, protective coat of crystal <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a> cherished by <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-great-wide-world-of-cannabis-concentrates\">hash</a> makers worldwide. With a subtle <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-woody\">sandalwood</a>&nbsp;aroma, Hindu Kush induces a deep sense of calm that helps bring relief to those suffering <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-nausea\">nausea</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress disorders</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/hindu-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/hindu-kush_100x100_c157.jpg','https://leafly.blob.core.windows.net/reviews/hindu-kush_100x100_495c.jpg','https://leafly.blob.core.windows.net/reviews/hindu-kush_100x100_d817.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/hindu-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363079/b/hindu-kush__primary_31bf.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360492/b/hindu-kush__primary_7d5a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355595/b/hindu-kush__primary_6a8b.jpg',NULL,71.4581,51.3359,49.3342,44.4586,33.9709,46.2123,42.0538,31.2048,22.4363,12.5966,30.9093,13.4982,8.70094,22.4363,12.5966,NULL),(129,14,'Cinderella 99','cinderella-99','Hybrid','C99','<p>C-99 is well known for being super potent with a mild citrus or tropical aroma. &nbsp;Cindy is great for daytime use and provides plenty of energy. &nbsp;Be careful not to underestimate her or you may pass out or become paranoid. &nbsp;Cinderella 99 is a sativa-dominant strain and provides all the good sativa benefits. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cinderella-99_100x100_489b.jpg','https://leafly.blob.core.windows.net/reviews/cinderella-99_100x100_8d46.jpg','https://leafly.blob.core.windows.net/reviews/cinderella-99_100x100_60a3.jpg','https://leafly.blob.core.windows.net/reviews/cinderella-99_100x100_9bd2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364407/b/cinderella-99__primary_618d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364373/b/cinderella-99__primary_aea1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356434/b/cinderella-99__primary_c447.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355767/b/cinderella-99__primary_ea48.jpg',NULL,78.1845,66.2324,63.945,59.2272,49.7822,38.0664,34.4581,22.3456,22.1549,12.5958,34.9176,16.0588,14.038,22.1549,12.5958,NULL),(130,905,'Agent Orange','agent-orange','Hybrid','Ago','<p>Don&rsquo;t let the name scare you! The only herbicidal warfare Agent Orange will wage is between the excellence of this strain&#39;s flavors and <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> effects. A well-balanced <a href=\"http://www.leafly.com/hybrid\">hybrid</a> that combines the smooth <a href=\"http://www.leafly.com/hybrid/orange-velvet\">Orange Velvet</a> with the bold <a href=\"http://www.leafly.com/sativa/jack-the-ripper\">Jack the Ripper</a>, Agent Orange will capture your senses. Wonderful smells of <a href=\"http://www.leafly.com/explore#!/explore/flavors-orange\">oranges</a> and fresh-cut <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> fruit will entice you immediately, while the pigments of deep maroon and purple will make this bud stand out in a sea of green. The effects are <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> and motivating, serving as a great mood enhancer if you are feeling lethargic or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depressed</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/agent-orange/primary?width=200','https://leafly.blob.core.windows.net/reviews/agent-orange_100x100_35a6.jpg','https://leafly.blob.core.windows.net/reviews/agent-orange_100x100_e4ed.jpg','https://leafly.blob.core.windows.net/reviews/agent-orange_100x100_422d.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/agent-orange/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362926/b/agent-orange__primary_e5bd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360056/b/agent-orange__primary_1fd5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355328/b/agent-orange__primary_97d0.jpg','https://leafly.s3.amazonaws.com/strains/testing/aLeQ25WkTIaxWvJzewIi_agent-orange.png',66.6853,59.2564,52.8073,45.5223,41.3978,38.3418,31.8728,25.91,16.4771,12.964,28.6672,12.1746,10.0781,16.4771,12.964,NULL),(131,382,'Banana Kush','banana-kush','Hybrid','Bak','<p>This legendary West Coast strain crosses <a href=\"https://www.leafly.com/hybrid/ghost-og\">Ghost OG</a>&nbsp;and <a href=\"http://www.leafly.com/hybrid/skunk-haze\">Skunk Haze</a> to create an <a href=\"http://www.leafly.com/indica\">indica</a>-dominant <a href=\"http://www.leafly.com/hybrid\">hybrid</a> that tastes and smells like a bushel of fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">bananas</a>. Although it leans towards an&nbsp;indica genetically, the effects are balanced by the <a href=\"http://www.leafly.com/sativa/haze\">Haze&rsquo;s</a> mellow <a href=\"http://www.leafly.com/sativa\">sativa</a> buzz that provides a <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a> sense of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. A great choice when dealing with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a>, Banana Kush also helps stimulate your <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> juices and can help you remain <a href=\"http://www.leafly.com/explore#!/explore/tags-talkative\">talkative</a> in social settings.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/banana-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/banana-kush_100x100_ad26.jpg','https://leafly.blob.core.windows.net/reviews/banana-kush_100x100_c566.jpg','https://leafly.blob.core.windows.net/reviews/banana-kush_100x100_ea0b.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/banana-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360623/b/banana-kush__primary_ac06.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358187/b/banana-kush__primary_1152.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356699/b/banana-kush__primary_c78c.jpg','https://leafly.s3.amazonaws.com/strains/testing/9gskToaFRym8CMVK7Im1_banana-kush.png',65.8475,61.9744,50.4084,45.8365,33.5785,40.9098,29.5894,24.6944,18.7031,14.4332,33.1781,13.4802,11.2998,18.7031,14.4332,'Moderate'),(132,112,'Romulan','romulan','Indica','Rom','<p>Romulan, named after the alien Star Trek race, is a powerful indica revered for its potent therapeutic qualities. Though mostly indica, Romulan growers insist sativa genetics have crept in over time, lending it intense cerebral effects. These squat, pine-scented plants produce dense frosty buds that have found their following among connoisseurs in B.C. and the Pacific Northwest. A deep, sedating relaxation makes Romulan a favorite strain for patients treating muscle spasms and nerve damage. Many hybridized variations of Romulan exist, but nearly all can promise a full body calm with heavily intoxicating properties.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/romulan/primary?width=200','https://leafly.blob.core.windows.net/reviews/romulan_100x100_7821.jpg','https://leafly.blob.core.windows.net/reviews/romulan_100x100_4a62.jpg','https://leafly.blob.core.windows.net/reviews/romulan_100x100_f3e7.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/romulan/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363828/b/romulan__primary_b891.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363348/b/romulan__primary_8dd3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348432/b/romulan__primary_5b1c.jpg',NULL,79.162,62.4194,57.2629,56.7489,41.8426,49.2592,45.949,40.0912,31.9056,31.1768,25.434,13.4468,11.3463,31.9056,31.1768,NULL),(133,175,'Dutch Treat','dutch-treat','Hybrid','Dt','<p>Over the years, Dutch Treat has become an essential strain of the Amsterdam coffee shops. The dense, sticky buds have an intense smell of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruits</a> mixed with <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> and eucalyptus trees. The cerebral high comes on quick and leaves consumers feeling <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifted</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> while reducing <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> the mind.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/dutch-treat_100x100_c7a9.jpg','https://leafly.blob.core.windows.net/reviews/dutch-treat_100x100_6688.jpg','https://leafly.blob.core.windows.net/reviews/dutch-treat_100x100_5159.jpg','https://leafly.blob.core.windows.net/reviews/dutch-treat_100x100_64f7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356528/b/dutch-treat__primary_31f1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354812/b/dutch-treat__primary_bc28.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354030/b/dutch-treat__primary_7721.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353078/b/dutch-treat__primary_367b.jpg',NULL,74.1651,68.0362,67.9966,62.1385,37.6283,49.5073,36.628,31.6667,17.6911,14.8524,40.0385,15.2297,10.7653,17.6911,14.8524,NULL),(134,1074,'Golden Goat','golden-goat','Hybrid','Gdg','<p>Golden Goat was created by accident in Topeka, Kansas, when a male <a href=\"http://www.leafly.com/sativa/hawaiian\">Hawaiian</a>-<a href=\"http://www.leafly.com/indica/romulan\">Romulan</a> pollinated Mr. Dank&#39;s <a href=\"http://www.leafly.com/sativa/island-sweet-skunk\">Island Sweet Skunk</a> mother. The strain is often light green and pink in color, which is&nbsp;indicative&nbsp;of its Hawaiian <a href=\"http://www.leafly.com/sativa\">sativa</a> side. The scent is described as being a combination of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, sour, and <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a>, with a <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruit</a> flavor. Effects are strong&nbsp;and felt from head to toe, lasting about 1-2 hours.&nbsp;Flowering time is 9-11 weeks, with a golden appearance closer to harvest. This sativa-dominant hybrid has a THC level of&nbsp;up to 23% and a CBD of 1.07%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/golden-goat/primary?width=200','https://leafly.blob.core.windows.net/reviews/golden-goat_100x100_c01a.jpg','https://leafly.blob.core.windows.net/reviews/golden-goat_100x100_ad0d.jpg','https://leafly.blob.core.windows.net/reviews/golden-goat_100x100_02e8.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/golden-goat/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363063/b/golden-goat__primary_fbfe.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356437/b/golden-goat__primary_4405.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356565/b/golden-goat__primary_e902.jpg','https://leafly.s3.amazonaws.com/strains/testing/ClyUV6RwQGSH5JWCGEgc_golden-goat.png',76.8001,67.2652,59.1961,56.0059,48.8484,43.0679,38.257,24.3027,17.6685,17.2206,32.055,11.8113,11.4672,17.6685,17.2206,NULL),(136,915,'Harlequin','harlequin','Sativa','Har','<p>Harlequin is a 75/25 <a href=\"http://leafly.com/sativa\">sativa</a>-dominant strain renowned for its reliable expression of <a href=\"http://www.leafly.com/news/lifestyle/whats-the-deal-with-these-high-cbd-strains\">CBD</a>. A descendant of <a href=\"http://www.leafly.com/sativa/colombian-gold\">Colombian Gold</a>, <a href=\"http://www.leafly.com/sativa/thai\">Thai</a>, and a Swiss <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace</a> strain, you can depend on Harlequin to provide clear-headed, alert sativa effects. Unlike most high-CBD strains, Harlequin almost always develops a CBD:THC ratio of 5:2, making this strain one of the most effective out there for treatment of <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain/\">pain</a> and <a href=\"http://www.leafly.com/explore/conditions-anxiety\">anxiety</a>, as CBD counteracts THC&rsquo;s paranoia while amplifying its painkilling properties. Flavors can range from <a href=\"http://www.leafly.com/explore/flavors-earthy\">earthy</a> musk to sweet <a href=\"http://www.leafly.com/explore/flavors-mango\">mango</a>, but without a doubt, what draws crowds to Harlequin is its ability to <a href=\"http://www.leafly.com/explore/tags-relaxed\">relax</a> without sedation, and to relieve without intoxication.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/harlequin/primary?width=200','https://leafly.blob.core.windows.net/reviews/harlequin_100x100_95d5.jpg','https://leafly.blob.core.windows.net/reviews/harlequin_100x100_6920.jpg','https://leafly.blob.core.windows.net/reviews/harlequin_100x100_6d9d.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/harlequin/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354196/b/harlequin__primary_1974.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344520/b/harlequin__primary_4640.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/282186/b/harlequin__primary_eb1e.jpg','https://leafly.s3.amazonaws.com/strains/testing/1q0LqBPIRGqcKQhh9FBU_harlequin.png',75.6511,50.5175,43.1306,42.4394,37.9577,77.1825,52.785,31.4431,25.5498,22.6535,42.4394,19.3629,18.7812,25.5498,22.6535,NULL),(137,5636,'Fire OG','fire-og','Hybrid','Fog','<p>Known for being one of the strongest of the OG strains, Fire OG has a strong scent similar to Lemon Pledge and an effect that can last up to 3 hours. With parents of <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and <a href=\"http://www.leafly.com/indica/sfv-og-kush\">San Fernando Valley OG Kush</a> F3, the&nbsp;THC can be up to 20% with a CBD of 0.36%. The plant has frost covered nuggets with red hairs, giving the appearance that it is on fire--where the name Fire OG comes from. Flowering time is generally 9-10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/fire-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/fire-og_100x100_c94e.jpg','https://leafly.blob.core.windows.net/reviews/fire-og_100x100_5705.jpg','https://leafly.blob.core.windows.net/reviews/fire-og_100x100_e264.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/fire-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364810/b/fire-og__primary_ba9a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362251/b/fire-og__primary_e7b3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360783/b/fire-og__primary_6ae1.jpg','https://leafly.s3.amazonaws.com/strains/testing/Xgth1k0eTsqGyFbBVyZw_fire-og.png',80.687,68.8707,61.2604,52.5868,39.5853,39.9134,26.9494,24.6846,23.3116,18.8072,28.442,17.1902,12.9693,23.3116,18.8072,NULL),(138,1482,'Afgoo','afgoo','Indica','Afo','<p>Afgoo, also known as <a href=\"http://www.leafly.com/indica/afgooey\">Afgooey</a>, is a potent <a href=\"http://leafly.com/indica\">indica</a> strain that is believed to descend from an <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> indica and Maui Haze.&nbsp;Its sativa parent may lend Afgoo some <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> qualities, but this strain undoubtedly takes after its indica parent as it primarily delivers <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleepy</a> effects alongside its <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> flavor. Growers hoping to cultivate Afgoo may have a better chance of success indoors, but this indica can also thrive in Mediterranean climates outdoors.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/afgoo_100x100_b32a.jpg','https://leafly.blob.core.windows.net/reviews/afgoo_100x100_0d6a.jpg','https://leafly.blob.core.windows.net/reviews/afgoo_100x100_5465.jpg','https://leafly.blob.core.windows.net/reviews/afgoo_100x100_e577.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361931/b/afgoo__primary_ff93.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352409/b/afgoo__primary_e54b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348526/b/afgoo__primary_1585.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348434/b/afgoo__primary_d20a.jpg',NULL,68.3858,55.7706,43.9811,39.1667,31.5425,39.7235,38.1247,35.2867,15.777,14.5084,29.3228,12.8034,9.79391,15.777,14.5084,'Moderate'),(139,167,'Cotton Candy Kush','cotton-candy-kush','Hybrid','Cck','<p>Named for its soft, fluffy appearance and intense candied aroma, Cotton Candy Kush is a <a href=\"http://www.leafly.com/hybrid\">hybrid</a> that crosses <a href=\"http://www.leafly.com/indica/lavender\">Lavender</a> with <a href=\"http://www.leafly.com/sativa/power-plant\">Power Plant</a>. The result is a <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> palate of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> flavors and a <a href=\"http://www.leafly.com/explore#!/explore/flavors-flowery\">floral</a> scent. The <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> effects will have you feeling like a kid in a candy store, while the <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> powers will keep <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>&nbsp;to&nbsp;a minimum.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cotton-candy-kush_100x100_3577.jpg','https://leafly.blob.core.windows.net/reviews/cotton-candy-kush_100x100_89e2.jpg','https://leafly.blob.core.windows.net/reviews/cotton-candy-kush_100x100_8af5.jpg','https://leafly.blob.core.windows.net/reviews/cotton-candy-kush_100x100_7f43.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360875/b/cotton-candy-kush__primary_4990.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352728/b/cotton-candy-kush__primary_48bb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350577/b/cotton-candy-kush__primary_18cc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349621/b/cotton-candy-kush__primary_60a3.jpg',NULL,75.8299,62.7899,51.5014,49.6552,35.5744,40.7155,34.5074,34.2227,32.527,16.3226,34.7951,11.958,11.5178,32.527,16.3226,NULL),(141,618,'LSD','lsd','Hybrid','Lsd','<p>The LSD strain was bred by Barneys Farm, with a lineage from Mazar and Skunk #1. It is a disease-resistant plant that does well in most growing conditions. The buds form in curved triangles, yielding approximately 600 grams per square meter. Flowering time is approximately 8-9 weeks. This marijuana strain is popular for delivering a vivid and psychedelic experience with a powerful body buzz and cerebral high. The THC content has been measured up to 24% with a CBD of 1.3%.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/lsd/primary?width=200','https://leafly.blob.core.windows.net/reviews/lsd_100x100_67a7.jpg','https://leafly.blob.core.windows.net/reviews/lsd_100x100_ea7a.jpg','https://leafly.blob.core.windows.net/reviews/lsd_100x100_8268.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/lsd/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358351/b/lsd__primary_994f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356428/b/lsd__primary_7a04.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355467/b/lsd__primary_8478.jpg',NULL,62.4474,58.0004,52.8639,51.8021,44.0163,41.1971,30.3354,29.3287,18.5958,13.9823,35.711,15.1694,9.80165,18.5958,13.9823,NULL),(142,6280,'Tangerine Dream','tangerine-dream','Hybrid','Tnd','<p>This winner of the 2010 Cannabis Cup was created by the illustrious Barney&rsquo;s Farm. A strain for connoisseurs, Tangerine Dream is the hybrid daughter of <a href=\"http://www.leafly.com/indica/g-13\">G13</a> and Neville&rsquo;s breeder strain A5. Its ability to knock out pain while increasing energy is what makes Tangerine Dream so special. While too much Tangerine Dream may leave you stuck on the couch, this strain was handcrafted to meet the demands of working medical patients. Uplifting and euphoric, it provides users with mental clarity while deeply relaxing muscles. Tangerine Dream typically flowers in 8 to 10 weeks and features a citrusy aroma.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/tangerine-dream_100x100_8d65.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-dream_100x100_3f61.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-dream_100x100_8a8c.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-dream_100x100_8cb5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362634/b/tangerine-dream__primary_90ab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356463/b/tangerine-dream__primary_a0d6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354850/b/tangerine-dream__primary_9d41.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347853/b/tangerine-dream__primary_5eec.jpg',NULL,76.2484,74.7595,65.3993,62.0099,40.7805,35.8432,30.5224,30.3217,18.4194,18.1857,23.9672,11.8723,11.3667,18.4194,18.1857,NULL),(144,40,'Silver Haze','silver-haze','Sativa','Slv','<p>Silver Haze was the first seed strain to deliver&nbsp;the full-strength Haze experience in a fatter, faster, more compact form. Crossing <a href=\"http://leafly.com/sativa/haze\">Haze</a> with a non-dominant indica <a href=\"http://www.leafly.com/indica/northern-lights\">Northern Lights</a> and <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a>, Silver Haze&nbsp;maintains strong but clear-headed&nbsp;<a href=\"http://leafly.com/sativa\">sativa</a> effects.&nbsp;Introduced by Sensi Seeds, the Silver Haze gets its name from the massive amount of shiny THC glands covering the buds.&nbsp;</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/silver-haze_100x100_175b.jpg','https://leafly.blob.core.windows.net/reviews/silver-haze_100x100_5275.jpg','https://leafly.blob.core.windows.net/reviews/silver-haze_100x100_8a3d.jpg','https://leafly.blob.core.windows.net/reviews/silver-haze_100x100_0648.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360204/b/silver-haze__primary_4c20.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358485/b/silver-haze__primary_7d54.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353811/b/silver-haze__primary_2816.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352537/b/silver-haze__primary_821f.jpg',NULL,72.244,58.2462,55.305,49.4662,36.732,30.9259,24.4227,19.7603,17.0153,11.1656,26.7538,9.04139,8.58388,17.0153,11.1656,'Moderate'),(145,194,'Orange Kush','orange-kush','Indica','Ok','<p>Orange Kush was bred by Green Devil Genetics and is the child of <a href=\"http://www.leafly.com/hybrid/orange-bud\">Orange Bud</a> and <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>. It eases the body into relaxation while lifting moods with a sweet and tangy citrus flavor. This strain is resistant to most pests and mold and has long, dense buds with many orange hairs and trichome crystals.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/orange-kush_100x100_d882.jpg','https://leafly.blob.core.windows.net/reviews/orange-kush_100x100_4eb1.jpg','https://leafly.blob.core.windows.net/reviews/orange-kush_100x100_9796.jpg','https://leafly.blob.core.windows.net/reviews/orange-kush_100x100_cf69.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360172/b/orange-kush__primary_3c5c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344670/b/orange-kush__primary_b75f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342477/b/orange-kush__primary_8dc7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341906/b/orange-kush__primary_a0aa.jpg',NULL,60.8613,52.6771,39.2005,38.1211,28.708,39.5649,27.6609,25.2036,19.4247,17.5237,21.0485,10.2148,6.67739,19.4247,17.5237,NULL),(146,1137,'Pineapple Kush','pineapple-kush','Hybrid','Pak','<p>Pineapple Kush marijuana strain has an aroma of <a href=\"http://www.leafly.com/explore#!/explore/flavors-pineapple\">pineapple</a>&nbsp;with accents of caramel and <a href=\"http://www.leafly.com/explore#!/explore/flavors-butter\">butter</a>. The flavor is described as a subtle <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> pineapple taste with a <a href=\"http://www.leafly.com/explore#!/explore/flavors-minty\">mint</a> undertone. While the breeder of this strain is unknown, its parents are <a href=\"http://www.leafly.com/hybrid/pineapple\">Pineapple</a> and <a href=\"http://www.leafly.com/indica/master-kush\">Master Kush</a>. The buds are brown/green in color and covered with amber crystals. With a THC content of up to 15% and CBD of 0.14%, the buzz is commonly&nbsp;described as cerebral,&nbsp;with a light body sensation.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pineapple-kush_100x100_2d44.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-kush_100x100_1c8a.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-kush_100x100_c4dc.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-kush_100x100_cb7f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362538/b/pineapple-kush__primary_e2ae.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354261/b/pineapple-kush__primary_c423.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351224/b/pineapple-kush__primary_e650.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351044/b/pineapple-kush__primary_6ee7.jpg','https://leafly.s3.amazonaws.com/strains/testing/u5Kcgef4TsK31cv4TcSg_pineapple-kush.png',80.877,78.126,53.2819,47.9829,47.7115,54.4297,44.2325,39.566,29.6898,27.9941,37.576,15.1833,14.6701,29.6898,27.9941,NULL),(147,193,'Lemon Skunk','lemon-skunk','Hybrid','Ls','<p>Lemon Skunk was conceived from two separate <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a> <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotypes</a> that displayed exceptionally zesty <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> traits. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunky</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> flavor draws you in immediately, and the <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a> buzz will shake you out of any funk. DNA Genetics has developed Lemon Skunk as great strain for combating <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/lemon-skunk/primary?width=200','https://leafly.blob.core.windows.net/reviews/lemon-skunk_100x100_2cb6.jpg','https://leafly.blob.core.windows.net/reviews/lemon-skunk_100x100_fcf3.jpg','https://leafly.blob.core.windows.net/reviews/lemon-skunk_100x100_26dd.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/lemon-skunk/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364563/b/lemon-skunk__primary_bb62.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364202/b/lemon-skunk__primary_2eb1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355327/b/lemon-skunk__primary_7c54.jpg',NULL,81.7935,62.4691,61.9141,49.8232,43.5125,42.2535,42.2032,27.2649,19.4928,14.0137,34.7317,15.1032,13.4851,19.4928,14.0137,NULL),(148,1512,'XJ-13','xj-13','Hybrid','X13','<p>XJ-13 is a sativa-dominant strain cherished for both its therapeutic potency and enjoyable euphoric buzz. This hybrid cross of <a href=\"http://www.leafly.com/sativa/jack-herer\">Jack Herer</a> and <a href=\"http://www.leafly.com/hybrid/g13-haze\">G13 Haze</a> induces unencumbered cerebral effects perfect for stimulating creativity and conversation. As if we needed another reason to love this lightweight sativa, XJ-13 consistently exhibits a strong citrus aroma accented by notes of earthy pine. Novice consumers looking for an easy, paranoia-free experience can depend on XJ-13 as a surefire way to relieve stress and mood-related symptoms.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/xj-13_100x100_eac3.jpg','https://leafly.blob.core.windows.net/reviews/xj-13_100x100_ed49.jpg','https://leafly.blob.core.windows.net/reviews/xj-13_100x100_76aa.jpg','https://leafly.blob.core.windows.net/reviews/xj-13_100x100_3b69.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350745/b/xj-13__primary_e390.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341945/b/xj-13__primary_799b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340973/b/xj-13__primary_0b6f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335853/b/xj-13__primary_7fe5.jpg',NULL,80.2358,67.4495,61.2313,60.6032,51.7861,44.7337,35.8626,31.1381,24.2398,13.4306,25.3621,12.9956,8.93681,24.2398,13.4306,NULL),(150,4274,'Island Sweet Skunk','island-sweet-skunk','Sativa','Iss','<p>Island Sweet Skunk, sometimes called Sweet Island Skunk,&nbsp;is a <a href=\"http://leafly.com/sativa\">sativa</a> strain that users enjoy for its <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a> effects. The flavor is most easily described as &ldquo;<a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunk</a>,&rdquo; where <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a> fruit flavors take the lead. Often the fruity aroma is likened to <a href=\"http://www.leafly.com/explore#!/explore/flavors-grapefruit\">grapefruit</a>. Originally bred by Federation Seed Company in Canada, this strain is a descendant of <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk #1</a> and grows tall, straight, high-yielding&nbsp;plants. Some varieties of Island Sweet Skunk have a heightened <a href=\"http://www.leafly.com/news/lifestyle/whats-the-deal-with-these-high-cbd-strains\">CBD</a> content to help patients treating <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-inflammation\">inflammation</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-muscle-spasms\">muscle spasms</a>.&nbsp;Flowering occurs at 7 to 8 weeks and buds will have bright yellow-orange hairs. They will remain loose and fluffy, so make sure they don&rsquo;t get too dried out.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/island-sweet-skunk_100x100_94e2.jpg','https://leafly.blob.core.windows.net/reviews/island-sweet-skunk_100x100_6cfd.jpg','https://leafly.blob.core.windows.net/reviews/island-sweet-skunk_100x100_6965.jpg','https://leafly.blob.core.windows.net/reviews/island-sweet-skunk_100x100_6341.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349843/b/island-sweet-skunk__primary_67b9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335049/b/island-sweet-skunk__primary_0abb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330171/b/island-sweet-skunk__primary_103a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/329299/b/island-sweet-skunk__primary_bb46.jpg','https://leafly.s3.amazonaws.com/strains/testing/JuEn9je3Ru9zKB6nj4Q8_island-sweet-skunk.png',65.2046,58.2561,52.8988,47.1523,46.9442,36.6641,28.2673,28.2492,17.8344,12.9412,26.7289,9.30974,8.36765,17.8344,12.9412,NULL),(151,29,'White Russian','white-russian','Hybrid','Whr','<p>White Russian is a stable cross of <a href=\"/hybrid/ak-47\" title=\"AK-47 Marijuana Strain\">AK-47</a> and <a href=\"/hybrid/white-widow\" title=\"White Widow Cannabis\">White Widow</a>. With such a strong indica background, the plants smell quite strong during both their growth and flowering period. &nbsp;THC levels have been measured as high as 22% in seed comparison tests, making White Russian possibly the strongest plant known. &nbsp;Very strong and long lasting medicinal high, more energetic than sleepy.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/white-russian_100x100_a910.jpg','https://leafly.blob.core.windows.net/reviews/white-russian_100x100_9485.jpg','https://leafly.blob.core.windows.net/reviews/white-russian_100x100_e2b8.jpg','https://leafly.blob.core.windows.net/reviews/white-russian_100x100_bde8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355627/b/white-russian__primary_1323.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355072/b/white-russian__primary_6705.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351198/b/white-russian__primary_83ee.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350903/b/white-russian__primary_2e47.jpg',NULL,65.56,60.021,52.2391,50.7717,49.6383,42.8563,39.2248,36.7678,16.6406,16.037,20.9874,14.3441,12.0175,16.6406,16.037,NULL),(152,234,'Purple Diesel','purple-diesel','Hybrid','Pd','<p>Purple Diesel, bred by Cali Connection, is a wonder among <a href=\"http://www,leafly.com/hybrid\">hybrid</a> strains. While most of the effects are similar to traditional <a href=\"http://www.leafly.com/sativa\">sativas</a> (<a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energizing</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-focused\">focused</a>), Purple D is also an exceptional strain for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain relief</a>. A sneaky cross between <a href=\"http://www.leafly.com/indica/pre-98-bubba-kush\">Pre-98 Bubba Kush</a>&nbsp;and <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>, this strain takes a while to fully kick in. However, once the effects begin to present themselves, users are struck by a type of <a href=\"http://www.leafly.com/explore#!/explore/tags-giggly\">giggly</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> bliss. A favorite among daytime users, Purple Diesel features a sour, <a href=\"http://www.leafly.com/explore#!/explore/flavors-diesel\">fuel</a>-like aroma. For those interested in growing, this strain has an early flowering time of around 8 weeks and features dense buds with deep purple leaves.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-diesel_100x100_597d.jpg','https://leafly.blob.core.windows.net/reviews/purple-diesel_100x100_3ac0.jpg','https://leafly.blob.core.windows.net/reviews/purple-diesel_100x100_70d5.jpg','https://leafly.blob.core.windows.net/reviews/purple-diesel_100x100_2859.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355180/b/purple-diesel__primary_2405.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353355/b/purple-diesel__primary_8c7b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353387/b/purple-diesel__primary_8614.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348402/b/purple-diesel__primary_e63b.jpg',NULL,72.9309,68.0096,61.4289,58.7066,47.8396,38.7962,29.0429,27.8806,17.8818,14.3744,28.8766,13.989,12.4878,17.8818,14.3744,NULL),(153,114,'Sensi Star','sensi-star','Indica','Sen','<p>Sensi Star by Paradise Seeds is a legendary <a href=\"http://leafly.com/indica\">indica</a> strain that is renowned worldwide for its powerful full-body effects and subtle cerebral invigoration. Crystal <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a> sparkle like a constellation of stars against this indica&rsquo;s dark green and purple coloration, reflecting a potency worthy of placement in the 1999, 2000, and 2005 <em>High Times</em> Cannabis Cups. Her stunning results at maturation have also won the hearts of growers who cultivate both indoor and out in either hydroponic or soil methods.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/sensi-star_100x100_3294.jpg','https://leafly.blob.core.windows.net/reviews/sensi-star_100x100_f61a.jpg','https://leafly.blob.core.windows.net/reviews/sensi-star_100x100_4fc7.jpg','https://leafly.blob.core.windows.net/reviews/sensi-star_100x100_feb4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355566/b/sensi-star__primary_bc95.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353159/b/sensi-star__primary_2715.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353339/b/sensi-star__primary_6c2c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353377/b/sensi-star__primary_42fc.jpg',NULL,77.4105,52.9078,52.132,45.872,35.3249,41.2765,39.4529,30.8588,27.2812,24.4794,33.9854,14.7049,6.99271,27.2812,24.4794,NULL),(154,142,'Chernobyl','chernobyl','Hybrid','Cbl','<p>Rated one of the Top 10 Strains of 2010 by High Times, Chernobyl has a unique lime-sherbet smell. Originally bred by TGA Seeds, it is a cross of Train Wreck, Jack the Ripper and Trinity, and is a sativa-dominant strain. She creates a long-lasting cerebral high and has the flavor of lime, with flowering time being 8-9 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/chernobyl/primary?width=200','https://leafly.blob.core.windows.net/reviews/chernobyl_100x100_8485.jpg','https://leafly.blob.core.windows.net/reviews/chernobyl_100x100_904a.jpg','https://leafly.blob.core.windows.net/reviews/chernobyl_100x100_05e7.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/chernobyl/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355922/b/chernobyl__primary_0caa.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354990/b/chernobyl__primary_92d5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353110/b/chernobyl__primary_0fe4.jpg',NULL,61.5915,58.1159,55.5868,41.1799,40.5399,39.715,39.5556,27.5687,18.3736,16.8899,29.321,11.9975,11.6401,18.3736,16.8899,NULL),(156,38991,'Cinex','cinex','Sativa','Cnx','<p>Cinex, a <a href=\"http://www.leafly.com/hybrid\">hybrid</a> of parents <a href=\"http://www.leafly.com/hybrid/cinderella-99\">Cinderella 99</a> and <a href=\"http://www.leafly.com/sativa/vortex\">Vortex</a>, has a mixture of flavors ranging from <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> to <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunk</a>. The effects are clear-headed and <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, perfect for building a positive mindset and stimulating <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energy</a>. Consumers enjoy Cinex for its ability to suppress <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cinex_100x100_2074.jpg','https://leafly.blob.core.windows.net/reviews/cinex_100x100_5e3b.jpg','https://leafly.blob.core.windows.net/reviews/cinex_100x100_e2b4.jpg','https://leafly.blob.core.windows.net/reviews/cinex_100x100_bafb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352897/b/cinex__primary_6a23.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346707/b/cinex__primary_7e2e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346699/b/cinex__primary_c31b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346514/b/cinex__primary_36f2.jpg',NULL,70.4838,63.1934,53.3087,52.9849,52.8299,40.9917,34.8619,34.1913,17.7584,16.5948,31.1465,17.0035,13.5552,17.7584,16.5948,NULL),(157,174,'Juicy Fruit','juicy-fruit','Hybrid','Juf','<p>Also known as Fruity Juice, this cannabis strain was developed by Sensi Seeds. Crossed with pure <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> <a href=\"http://www.leafly.com/indica\">indica</a> and pure <a href=\"http://www.leafly.com/sativa/thai\">Thai</a> <a href=\"http://www.leafly.com/sativa\">sativa</a>, Juicy Fruit&nbsp;is a large-leafed, thick-stemmed&nbsp;plant with colors of green and purple. Once broken up, colors of <a href=\"http://www.leafly.com/explore#!/explore/flavors-lavender\">lavender</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-orange\">orange</a>, and amber-purple float throughout the <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichome</a> heads and into the&nbsp;stems. Flowering time is approximately 7-9 weeks, with a THC level measuring about 15-20%. Smells are described as ranging from tangy and <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, sort of like fruit punch and <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemons</a>, to a blend of pi&ntilde;a&nbsp;colada and <a href=\"http://www.leafly.com/explore#!/explore/flavors-plum\">plums</a>. The effects begin&nbsp;with a <a href=\"http://www.leafly.com/explore#!/explore/tags-dizzy\">dizzy</a>, light-headed feeling and can last up to 3 hours.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/juicy-fruit/primary?width=200','https://leafly.blob.core.windows.net/reviews/juicy-fruit_100x100_bdb5.jpg','https://leafly.blob.core.windows.net/reviews/juicy-fruit_100x100_1850.jpg','https://leafly.blob.core.windows.net/reviews/juicy-fruit_100x100_5791.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/juicy-fruit/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363178/b/juicy-fruit__primary_ca91.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344441/b/juicy-fruit__primary_512d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340460/b/juicy-fruit__primary_d03e.jpg',NULL,66.1625,58.6042,41.5533,41.1748,40.0091,37.5011,29.2723,19.0724,12.977,12.5789,21.5502,8.17461,7.82107,12.977,12.5789,NULL),(158,58162,'Platinum Girl Scout Cookies','platinum-girl-scout-cookies','Hybrid','Pgs','<p>If you thought <a href=\"http://www.leafly.com/hybrid/girl-scout-cookie\">Girl Scout Cookies</a> couldn&rsquo;t get any better, then behold its next evolution, Platinum Girl Scout Cookies. This Cup-winning hybrid -- a cross of <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>, <a href=\"http://www.leafly.com/sativa/durban-poison\">Durban Poison</a>, and a third&nbsp;unknown strain&nbsp;-- fills your nose and lungs with sweet notes of berry and candy, followed by a fruity spiciness. Patients with severe pain, nausea, swelling, migraines, and stress should look no further for relief as symptoms both physical and mood-related melt away instantly. The Platinum Girl Scout Cookies strain flaunts a heavy coat of crystal trichomes over its sage green leaves, assuring its potency to any consumer in doubt.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/platinum-girl-scout-cookies/primary?width=200','https://leafly.blob.core.windows.net/reviews/platinum-girl-scout-cookies_100x100_4a9b.jpg','https://leafly.blob.core.windows.net/reviews/platinum-girl-scout-cookies_100x100_c740.jpg','https://leafly.blob.core.windows.net/reviews/platinum-girl-scout-cookies_100x100_cf00.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/platinum-girl-scout-cookies/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364815/b/platinum-girl-scout-cookies__primary_3de5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363314/b/platinum-girl-scout-cookies__primary_0bbe.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360815/b/platinum-girl-scout-cookies__primary_be83.jpg','https://leafly.s3.amazonaws.com/strains/testing/yhnqQBohRYOUuXvOIQrn_platinum-gsc.png',77.97,67.179,57.8957,50.8525,41.244,38.1606,35.1791,29.1131,22.0231,20.0983,22.735,15.2136,13.6407,22.0231,20.0983,NULL),(159,3407,'Blackberry','blackberry','Hybrid','Bbr','<p dir=\"ltr\" style=\"line-height:1.15;margin-top:0pt;margin-bottom:0pt;\"><strong id=\"docs-internal-guid-6e0a3408-cecf-d433-1754-f30a25a66397\" style=\"font-weight:normal;\">Blackberry is a popular strain known for its balance of an active sativa buzz and the high yields of plants due to its indica side. It was bred in 2009 by Dutch company Nirvana Seeds as a cross between a <a href=\"http://www.leafly.com/hybrid/black-domina\" style=\"text-decoration:none;\">Black Domina</a> clone from the U.S and their own <a href=\"http://www.leafly.com/sativa/raspberry-cough\">Raspberry Cough</a>. Flowering happens between 9 and 11 weeks and plants will have a tight leaf structure and frosty buds. Indoor growing is recommended, but be warned, Blackberry plants are pungent. This strain has strong smoke that can have a fuel smell, but it is dominantly fruity.</strong></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blackberry_100x100_4f2b.jpg','https://leafly.blob.core.windows.net/reviews/blackberry_100x100_4e84.jpg','https://leafly.blob.core.windows.net/reviews/blackberry_100x100_e7c8.jpg','https://leafly.blob.core.windows.net/reviews/blackberry_100x100_23bc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356509/b/blackberry__primary_9a9a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353560/b/blackberry__primary_44fe.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353310/b/blackberry__primary_ec73.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351291/b/blackberry__primary_9c8d.jpg',NULL,84.805,62.1187,49.9242,44.9495,33.1009,38.0056,29.9208,29.8833,23.2259,15.0983,33.6474,15.2477,11.919,23.2259,15.0983,NULL),(160,8,'Snowcap','snowcap','Hybrid','Sno','<p>Another West Cost strain that has developed quite a legacy for itself, Snowcap is a potent <a href=\"http://www.leafly.com/sativa\">sativa</a> with a nice <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemony</a> scent with a hint of <a href=\"http://www.leafly.com/explore#!/explore/flavors-menthol\">menthol</a>. The effects are decidedly cerebral and should trigger <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happiness</a>, and a case of the <a href=\"http://www.leafly.com/explore#!/explore/tags-giggly\">giggles</a>. Believed to be a <a href=\"http://www.leafly.com/hybrid\">hybrid</a> of Humbolt Snow and an unknown <a href=\"http://www.leafly.com/sativa/haze\">Haze</a>, the poorly documented genetic history leaves some mystery surrounding Snowcap. One thing consumers will agree on is the all-around flavor and potency of this robust strain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/snowcap_100x100_7feb.jpg','https://leafly.blob.core.windows.net/reviews/snowcap_100x100_22d3.jpg','https://leafly.blob.core.windows.net/reviews/snowcap_100x100_7236.jpg','https://leafly.blob.core.windows.net/reviews/snowcap_100x100_9bcd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356506/b/snowcap__primary_24dd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346416/b/snowcap__primary_168f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345902/b/snowcap__primary_ae90.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341386/b/snowcap__primary_dd1f.jpg',NULL,74.9772,64.5027,59.3935,54.2743,52.9806,48.0666,32.9976,29.1644,27.8382,21.6246,37.636,17.2957,16.6349,27.8382,21.6246,NULL),(161,160,'Sour OG','sour-og','Hybrid','Sog','<p>Sour OG is a cross of <a href=\"http://leafly.com/sativa/sour-diesel\">Sour Diesel</a> and <a href=\"http://leafly.com/indica/sfv-og-kush\">SFV OG Kush</a>. &nbsp;A very nice weed to smoke, not overly powerful but provides a relaxing yet energetic high. &nbsp;Great for chilling with friends and laughing.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/sour-og_100x100_667d.jpg','https://leafly.blob.core.windows.net/reviews/sour-og_100x100_6661.jpg','https://leafly.blob.core.windows.net/reviews/sour-og_100x100_340d.jpg','https://leafly.blob.core.windows.net/reviews/sour-og_100x100_4ef3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363468/b/sour-og__primary_ded0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363309/b/sour-og__primary_43b5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362573/b/sour-og__primary_3b5c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362092/b/sour-og__primary_11ab.jpg',NULL,60.2163,56.844,46.2461,41.9356,32.4768,38.218,34.8326,28.8533,17.4638,13.4805,30.9487,12.8929,7.81144,17.4638,13.4805,NULL),(162,10703,'Alien OG','alien-og','Hybrid','Ali','<p>Alien OG is a cross between Tahoe OG and Alien Kush. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/alien-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/alien-og_100x100_dbe0.jpg','https://leafly.blob.core.windows.net/reviews/alien-og_100x100_f14d.jpg','https://leafly.blob.core.windows.net/reviews/alien-og_100x100_863e.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/alien-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362484/b/alien-og__primary_3375.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353866/b/alien-og__primary_2db9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353716/b/alien-og__primary_c2fb.jpg','https://leafly.s3.amazonaws.com/strains/testing/WqvSsaOBSdeNAqM2hlUC_alien-og.png',62.4333,61.7892,57.8825,45.2224,35.8566,39.6594,33.5977,29.8965,26.0751,14.4519,27.7647,14.4094,10.2312,26.0751,14.4519,NULL),(163,220,'Sweet Tooth','sweet-tooth','Hybrid','St','<p>Sweet Tooth was awarded 1st place at the High Times Cannabis Cup in 2001, and as you could probably guess from the name, it has a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> smell of <a href=\"http://www.leafly.com/explore#!/explore/flavors-flowery\">flowers</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berries</a> that accompany it. The potent <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">colas</a> of this balanced <a href=\"http://www.leafly.com/hybrid\">hybrid</a> are candy-coated with trichomes, providing <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifted</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> effects that are great for combating <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> and <a href=\"http://www.leafly.com/explore#!/explore/conditions-migraines\">headaches</a>. Bred by Barney&rsquo;s Farm, Sweet Tooth&rsquo;s genetics sprout from mixing <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">landrace</a> strains from <a href=\"http://www.leafly.com/indica/afghani\">Afghanistan</a>, <a href=\"http://www.leafly.com/sativa/hawaiian\">Hawaii</a>, and <a href=\"http://www.leafly.com/indica/nepalese\">Nepal</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/sweet-tooth_100x100_cf94.jpg','https://leafly.blob.core.windows.net/reviews/sweet-tooth_100x100_2c82.jpg','https://leafly.blob.core.windows.net/reviews/sweet-tooth_100x100_3287.jpg','https://leafly.blob.core.windows.net/reviews/sweet-tooth_100x100_49a6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355831/b/sweet-tooth__primary_df2b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353648/b/sweet-tooth__primary_9464.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352916/b/sweet-tooth__primary_35b1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347544/b/sweet-tooth__primary_a40e.jpg',NULL,72.1062,64.6194,56.4002,55.9547,49.6082,36.155,25.2467,19.584,18.8062,12.1719,35.5459,16.6642,12.5268,18.8062,12.1719,NULL),(164,303,'Platinum OG','platinum-og','Indica','Plt','<p>Platinum OG is just as precious as the metal it&rsquo;s named after. With a THC content regularly topping 20%, this indica-dominant hybrid asserts itself as one of the &ldquo;heaviest&rdquo; strains around. Platinum OG is purported to stem from three strains: <a href=\"http://www.leafly.com/hybrid/master-kush\">Master Kush</a>, <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>, and a third unknown parent. Flowers are lime green and plump, with prominent orange hairs and a platinum coating thanks to the abundance of THC crystals. A brief, heady onset settles into a powerful physical sedation suitable for nighttime use and pain, stress, or anxiety relief, making this precious strain a robust healer.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/platinum-og_100x100_d265.jpg','https://leafly.blob.core.windows.net/reviews/platinum-og_100x100_d7b9.jpg','https://leafly.blob.core.windows.net/reviews/platinum-og_100x100_a66b.jpg','https://leafly.blob.core.windows.net/reviews/platinum-og_100x100_23dc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362955/b/platinum-og__primary_7b70.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/359148/b/platinum-og__primary_3d29.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355832/b/platinum-og__primary_caf1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355802/b/platinum-og__primary_3575.jpg',NULL,85.9452,70.2954,59.9874,54.2081,46.4769,43.914,38.9957,36.1526,28.5835,17.3906,35.2212,13.7066,8.60734,28.5835,17.3906,NULL),(165,68,'Fruity Pebbles','fruity-pebbles','Hybrid','Fp','<p>Fruity Pebbles (AKA Fruity Pebbles OG) by Alien Genetics was a limited-time offering from the breeder. This <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/hybrid\">hybrid</a> takes genetics from <a href=\"http://www.leafly.com/hybrid/green-ribbon\">Green Ribbon</a>, <a href=\"http://www.leafly.com/indica/granddaddy-purple\">Granddaddy Purple</a>, <a href=\"http://www.leafly.com/hybrid/tahoe-og\">Tahoe OG</a>, and <a href=\"http://www.leafly.com/indica/alien-kush\">Alien Kush</a> to create a <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> flavor reminiscent of the cereal. The <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> effects will keep you <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a> when you&rsquo;re <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stressed</a> and help you catch some <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleep</a> when faced with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">insomnia</a>. Sit back, <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relax</a>, and pour yourself a bowl of Fruity Pebbles!</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/fruity-pebbles/primary?width=200','https://leafly.blob.core.windows.net/reviews/fruity-pebbles_100x100_9b72.jpg','https://leafly.blob.core.windows.net/reviews/fruity-pebbles_100x100_df4a.jpg','https://leafly.blob.core.windows.net/reviews/fruity-pebbles_100x100_4fbf.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/fruity-pebbles/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364536/b/fruity-pebbles__primary_7e41.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364045/b/fruity-pebbles__primary_d4f0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363757/b/fruity-pebbles__primary_1b5d.jpg',NULL,71.8921,51.2527,51.2122,45.7839,33.8742,26.0949,18.8933,14.4864,11.6523,10.8709,21.0966,8.16869,7.03474,11.6523,10.8709,NULL),(167,36,'Purple Trainwreck','purple-trainwreck','Hybrid','Pt','<p>Purple Trainwreck is a true powerhouse that combines <a href=\"http://www.leafly.com/indica/granddaddy-purple\">Granddaddy Purple</a> with <a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a>. The classic <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> scent of Trainwreck is met with <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a> undertones to create a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-grape\">grape</a>-like flavor. The frosted purple buds are hard to take your eyes off of, while the <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a> effects are sure to lift any <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a> you might be struggling with.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-trainwreck_100x100_f077.jpg','https://leafly.blob.core.windows.net/reviews/purple-trainwreck_100x100_c6eb.jpg','https://leafly.blob.core.windows.net/reviews/purple-trainwreck_100x100_dbe0.jpg','https://leafly.blob.core.windows.net/reviews/purple-trainwreck_100x100_8038.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356013/b/purple-trainwreck__primary_170f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354959/b/purple-trainwreck__primary_786b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353463/b/purple-trainwreck__primary_79af.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349484/b/purple-trainwreck__primary_7c23.jpg',NULL,72.5073,64.9576,61.5471,54.0108,37.2241,45.9767,34.8406,34.6939,25.6303,22.3064,24.3239,11.5696,8.77184,25.6303,22.3064,NULL),(168,184,'Casey Jones','casey-jones','Sativa','Cas','<p>Choo choo! Casey Jones is coming down the track! Casey was a famous engineer who was killed in a train wreck in 1900. More recently, he&#39;s also the name of a Teenage Mutant Ninja Turtles character who&#39;s fond of hockey masks and vigilante justice. However, this Casey Jones is a cross between Oriental Express (<a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> x <a href=\"http://www.leafly.com/sativa/thai\">Thai</a>) and <a href=\"http://www.leafly.com/sativa/east-coast-sour-diesel\">East Coast Sour Diesel</a> that provides an <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> palate with subtle hints of <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a>. Casey Jones produces pleasant <a href=\"http://www.leafly.com/sativa\">sativa</a> effects that are <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> and great for releasing your <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/casey-jones/primary?width=200','https://leafly.blob.core.windows.net/reviews/casey-jones_100x100_f89e.jpg','https://leafly.blob.core.windows.net/reviews/casey-jones_100x100_cb6d.jpg','https://leafly.blob.core.windows.net/reviews/casey-jones_100x100_f3b4.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/casey-jones/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344655/b/casey-jones__primary_cbef.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343566/b/casey-jones__primary_36d9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326861/b/casey-jones__primary_4c63.jpg',NULL,65.5433,64.6235,59.8665,52.8226,48.9249,49.3256,35.4542,27.7629,26.2261,16.4323,20.865,17.6334,12.6078,26.2261,16.4323,'Easy'),(169,395,'Platinum Kush','platinum-kush','Indica','Plk','<p>Platinum Kush marijuana strain has a platinum/silver shade to it due to its many crystals with shades of purple hues and bright orange hairs. The buds are dense and slow burning with a sweet fruity and hashy aroma. With a THC content measuring up to 18% and CBD up to 0.24%, the buzz has been described as a strong cerebral and body numbing one.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/platinum-kush_100x100_912e.jpg','https://leafly.blob.core.windows.net/reviews/platinum-kush_100x100_e236.jpg','https://leafly.blob.core.windows.net/reviews/platinum-kush_100x100_12d2.jpg','https://leafly.blob.core.windows.net/reviews/platinum-kush_100x100_251a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363632/b/platinum-kush__primary_b61c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363442/b/platinum-kush__primary_4afb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361738/b/platinum-kush__primary_fa0d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354885/b/platinum-kush__primary_ada3.jpg',NULL,85.6322,68.6118,62.0984,50.1547,47.2314,47.2314,36.299,29.244,28.8609,22.0601,33.838,14.6644,10.6911,28.8609,22.0601,NULL),(170,4813,'Larry OG','larry-og','Hybrid','Log','<p>Larry OG is yet another member of the famous ocean-grown family. Originally created in Orange County, this indica is a cross between <a href=\"http://www.leafly.com/hybrid/og-kush\" style=\"text-decoration:none;\">OG Kush</a> and <a href=\"http://www.leafly.com/hybrid/sfv-og\" style=\"text-decoration:none;\">SFV OG.</a> Larry OG produces a potent yet easy body buzz that will allow you to relax while getting things done. The effects are happy but not overwhelming. Like other members of the OG family, this strain has a very clean and piney aroma. The nugs tend to be dense and feature distinct burnt orange hairs that are longer than average.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/larry-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/larry-og_100x100_f09e.jpg','https://leafly.blob.core.windows.net/reviews/larry-og_100x100_8177.jpg','https://leafly.blob.core.windows.net/reviews/larry-og_100x100_a3f9.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/larry-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358540/b/larry-og__primary_75ba.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356951/b/larry-og__primary_a22a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357014/b/larry-og__primary_7500.jpg',NULL,75.5371,69.1378,58.0773,49.0439,36.2965,45.9052,35.5051,33.7383,25.3675,22.8801,33.3949,19.7018,10.0525,25.3675,22.8801,NULL),(171,598,'Sour Kush','sour-kush','Hybrid','Sk','<p class=\"p1\">This cross between <a href=\"http://www.leafly.com/sativa/sour-diesel\"><span class=\"s1\">Sour Diesel </span></a>and <a href=\"http://www.leafly.com/hybrid/og-kush\"><span class=\"s1\">OG Kush</span></a> is a winning combination. For those looking for daytime pain relief, Sour Kush might be one of the best choices out there. Providing consumers with an uplifting experience without overwhelming sedative effects, this hybrid is great for day-to-day consumption. Sour Kush is slightly sativa-dominant, igniting a giggly and euphoric feeling. The indica effects, however, present themselves a few minutes after consumption. This strain is extremely pungent, so it&rsquo;s best stored in tightly sealed containers.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/sour-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/sour-kush_100x100_7dc3.jpg','https://leafly.blob.core.windows.net/reviews/sour-kush_100x100_d985.jpg','https://leafly.blob.core.windows.net/reviews/sour-kush_100x100_db7f.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/sour-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363518/b/sour-kush__primary_cec8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352911/b/sour-kush__primary_7a19.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352449/b/sour-kush__primary_85fd.jpg',NULL,82.8541,76.1339,69.0721,60.6676,49.1717,48.6444,43.2816,36.2313,21.2318,18.9464,43.7169,10.2872,9.95118,21.2318,18.9464,NULL),(172,328,'Flo','flo','Hybrid','Flo','<p>This #1 rated Cannabis Cup winner of 1996 is the love child of <a href=\"http://www.leafly.com/sativa/purple-thai\">Purple Thai</a> and an <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> <a href=\"http://www.leafly.com/indica\">Indica</a>, bred by Dutch Passion and later propagated by DJ Short. The plant is described as having pear-shaped buds with purple <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">calyxes</a>. Flo can potentially&nbsp;be harvested multiple times, creating a &quot;flo&quot; of buds. The effects are&nbsp;characterized as light and <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a>, allowing for clarity of thought.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/flo/primary?width=200','https://leafly.blob.core.windows.net/reviews/flo_100x100_abca.jpg','https://leafly.blob.core.windows.net/reviews/flo_100x100_15e5.jpg','https://leafly.blob.core.windows.net/reviews/flo_100x100_e5ee.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/flo/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353549/b/flo__primary_3d76.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351101/b/flo__primary_0871.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342893/b/flo__primary_6fb5.jpg',NULL,72.5513,57.3306,52.341,51.2598,47.7333,51.4459,37.4626,32.9493,23.3675,22.663,29.5674,16.3779,15.8785,23.3675,22.663,NULL),(173,4500,'Critical Mass','critical-mass','Indica','Cm','<p>Critical Mass is a combination of Afghani and Skunk #1 that originated from the breeder Mr. Nice Seed Bank. With a large &quot;critical mass&quot; of production, branches tend to snap from the weight of these dense buds. Flowering time is approximately 6-8 weeks, with a heavy leaf to flower ratio. However, due to the large production of flowering, this strain is susceptible to mold which can be reduced by growing indoors to reduce humidity. THC levels of this strain may reach 19-22%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/critical-mass_100x100_bdbd.jpg','https://leafly.blob.core.windows.net/reviews/critical-mass_100x100_3e42.jpg','https://leafly.blob.core.windows.net/reviews/critical-mass_100x100_09c1.jpg','https://leafly.blob.core.windows.net/reviews/critical-mass_100x100_7b22.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360466/b/critical-mass__primary_67c1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360143/b/critical-mass__primary_8412.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352719/b/critical-mass__primary_c905.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340871/b/critical-mass__primary_4ef2.jpg',NULL,83.1371,62.3748,50.5704,47.1322,38.9015,47.1319,41.5177,28.5459,27.8742,21.8742,28.4703,13.1876,12.5211,27.8742,21.8742,NULL),(174,239,'Pineapple','pineapple','Hybrid','Pin','<p>Pineapple was developed by selecting a phenotype of <a href=\"http://www.leafly.com/hybrid/ed-rosenthal-super-bud\">Ed Rosenthal&rsquo;s Super Bud (ERSB)</a> that expressed predominantly <a href=\"http://www.leafly.com/indica\">indica</a> traits and had intense <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a> flavors. After generations of inbreeding, the strain developed a sturdy structure and more pronounced flavors of <a href=\"http://www.leafly.com/explore#!/explore/flavors-pineapple\">pineapple</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-diesel\">diesel</a>. The buds take on a bulbous shape that, in a way, resemble the fruit. A perfect strain for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress relief</a>, Pineapple will transport you to your <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a> place, leaving you <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifted</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxed</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pineapple_100x100_4b12.jpg','https://leafly.blob.core.windows.net/reviews/pineapple_100x100_265b.jpg','https://leafly.blob.core.windows.net/reviews/pineapple_100x100_78c1.jpg','https://leafly.blob.core.windows.net/reviews/pineapple_100x100_6d0b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/359050/b/pineapple__primary_5185.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354866/b/pineapple__primary_31b1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355149/b/pineapple__primary_0e31.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352473/b/pineapple__primary_1972.jpg',NULL,70.9686,68.8948,68.6488,60.1228,42.7645,48.1845,33.7502,29.9823,17.5414,14.6728,33.2455,8.63042,6.96982,17.5414,14.6728,NULL),(175,908,'Mango','mango','Indica','Mgo','<p>The Mango cannabis strain has been around since the early 1960s. In 1991, it was crossed with <a href=\"http://www.leafly.com/hybrid/kc-33\">KC 33</a> to give us the current Mango strain. Its buds have been known to grow very large, about the size of a softball, and can be up to a foot and a half in length. The foliage turns to a deep red/purple color with a smell and taste of sweet mango. Mango takes 9 to&nbsp;11 weeks to flower&nbsp;and has a THC content of 15-20%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/mango_100x100_e4fa.jpg','https://leafly.blob.core.windows.net/reviews/mango_100x100_31ba.jpg','https://leafly.blob.core.windows.net/reviews/mango_100x100_91f0.jpg','https://leafly.blob.core.windows.net/reviews/mango_100x100_ffd5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355510/b/mango__primary_b725.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347697/b/mango__primary_7a50.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338215/b/mango__primary_f1a6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/324018/b/mango__primary_e0b1.jpg',NULL,76.3439,69.5114,49.3939,47.6005,46.2396,41.7907,29.9627,29.2863,18.0621,17.4484,27.4989,14.7189,10.6785,18.0621,17.4484,NULL),(176,3708,'Kosher Kush','kosher-kush','Indica','Kos','<p>Kosher Kush is the world&#39;s first ever strain to be blessed by a Rabbi.&nbsp;From the vault of DNA&#39;s Reserva Privada seed line, Kosher Kush won the High Times Indica Cup in 2010 and 2011. The strain&nbsp;produces a fantastic smell and medium yields.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/kosher-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/kosher-kush_100x100_bbb6.jpg','https://leafly.blob.core.windows.net/reviews/kosher-kush_100x100_6441.jpg','https://leafly.blob.core.windows.net/reviews/kosher-kush_100x100_a4ea.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/kosher-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364845/b/kosher-kush__primary_4da5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362577/b/kosher-kush__primary_18f8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352969/b/kosher-kush__primary_de17.jpg',NULL,82.7975,64.8141,52.1054,46.5218,37.9291,47.6202,42.8285,41.1753,18.2701,17.9903,26.111,7.63058,6.74257,18.2701,17.9903,'Easy'),(177,130,'Kandy Kush','kandy-kush','Hybrid','Kan','<p>OG Kush crossed with Trainwreck, Kandy Kush won the first ever Western Slope Cannabis Crown in Aspen. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/kandy-kush_100x100_19e4.jpg','https://leafly.blob.core.windows.net/reviews/kandy-kush_100x100_3ada.jpg','https://leafly.blob.core.windows.net/reviews/kandy-kush_100x100_3444.jpg','https://leafly.blob.core.windows.net/reviews/kandy-kush_100x100_9817.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363051/b/kandy-kush__primary_3c3f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362858/b/kandy-kush__primary_9c26.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360461/b/kandy-kush__primary_cecb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358220/b/kandy-kush__primary_b63b.jpg',NULL,69.5461,62.8076,53.2405,51.0017,33.0244,37.9199,36.6594,19.7922,18.8841,18.7022,26.2953,12.5883,10.3642,18.8841,18.7022,NULL),(178,1588,'UK Cheese','uk-cheese','Hybrid','UK ','<p>UK Cheese is a popular <a href=\"http://leafly.com/hybrid\">hybrid</a> strain known for its potent, balanced effects and signature musty <a href=\"http://www.leafly.com/explore#!/explore/flavors-cheese\">cheese</a> smell. The flavor is also unique with notes of <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berries</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a> cheese (one that may just have to be tasted rather than described). This strain is thought to be a specific <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> (same genetics, different end result) of <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk #1</a> that was originally cultivated in the early 1990s by a UK collective group known as &ldquo;Exodus.&rdquo; (As a result, this strain is also known as Exodus Cheese.) UK Cheese became popular for its <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoric</a> head effects combined with its impressive <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a> relief potential. It quickly spread beyond the borders of its British home. Most users experience alert, <a href=\"http://leafly.com/sativa\">sativa</a> effects that allow for mental <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> without <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sedation</a>, but it may hasten bedtime for some. Effects tend to be felt in the head first, generally around the eyes, then spread throughout the entire body, producing muscle relaxation and even some tingly numbness. UK&rsquo;s flowers are on the denser end of the scale and light green with a coat of orange hairs that would make both Prince Charles and Prince William jealous.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/uk-cheese_100x100_e66c.jpg','https://leafly.blob.core.windows.net/reviews/uk-cheese_100x100_61a1.jpg','https://leafly.blob.core.windows.net/reviews/uk-cheese_100x100_2152.jpg','https://leafly.blob.core.windows.net/reviews/uk-cheese_100x100_2f8f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364279/b/uk-cheese__primary_a791.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363507/b/uk-cheese__primary_d632.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356833/b/uk-cheese__primary_ebbd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344820/b/uk-cheese__primary_7bb1.jpg',NULL,67.3719,65.8062,57.104,46.8362,38.684,23.5766,21.4027,18.7565,18.2777,14.3439,20.7298,14.9586,7.4793,18.2777,14.3439,NULL),(179,1778,'Grapefruit','grapefruit','Sativa','Grf','<p>This potent <a href=\"http://www.leafly.com/sativa\">sativa</a> was developed by crossing <a href=\"http://www.leafly.com/hybrid/cinderella-99\">Cinderella 99</a> with a fast-flowering sativa selected for its rich <a href=\"http://www.leafly.com/explore#!/explore/flavors-grapefruit\">grapefruit</a> flavor. The <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> smell of Grapefruit mixes with <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energetic</a> effects to give you a <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a> <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress-reliever</a> that also works well for battling <a href=\"http://www.leafly.com/explore#!/explore/conditions-migraines\">migraine</a> <a href=\"http://www.leafly.com/explore#!/explore/symptoms-headaches\">headaches</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/grapefruit/primary?width=200','https://leafly.blob.core.windows.net/reviews/grapefruit_100x100_2b36.jpg','https://leafly.blob.core.windows.net/reviews/grapefruit_100x100_e0e9.jpg','https://leafly.blob.core.windows.net/reviews/grapefruit_100x100_6c36.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/grapefruit/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362385/b/grapefruit__primary_379a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360491/b/grapefruit__primary_d9bf.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358710/b/grapefruit__primary_fca7.jpg',NULL,81.8547,79.2926,64.3048,54.86,48.1986,50.4705,45.1066,28.3712,25.5812,21.0252,32.0378,13.4819,12.0374,25.5812,21.0252,NULL),(182,1134,'Bruce Banner','bruce-banner','Hybrid','Bnr','<p>Bruce Banner might be best known as the alter-ego of comic book hero The Incredible Hulk, but maybe he wouldn&rsquo;t be such a stressed out ball of anger if he just had some of his namesake strain. This green monster also has hidden strength and features dense nugs that pack the power of very high THC content. It&rsquo;s a powerful strain whose effects come on quickly and strong and then tend to settle into a euphoric and creative buzz. The sativa effects of this strain are most evident and linger mostly in the head, but it does also provide body relaxation and pain relief that make it an appropriate daytime medication for some. Delta9 Labs bred this strain from <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and <a href=\"http://www.leafly.com/hybrid/strawberry-diesel\">Strawberry Diesel</a>, and its heritage can be found in its diesel aroma with sweet undertones. Plants flower at 8 to 10 weeks. This strain does have three main phenotypes, one of which is <a href=\"http://www.leafly.com/hybrid/bruce-banner-3\">Bruce Banner #3.</a></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/bruce-banner/primary?width=200','https://leafly.blob.core.windows.net/reviews/bruce-banner_100x100_456e.jpg','https://leafly.blob.core.windows.net/reviews/bruce-banner_100x100_75fd.jpg','https://leafly.blob.core.windows.net/reviews/bruce-banner_100x100_a268.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/bruce-banner/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363419/b/bruce-banner__primary_0864.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358762/b/bruce-banner__primary_650d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356834/b/bruce-banner__primary_f14d.jpg',NULL,64.016,62.5555,61.5847,49.9506,40.4558,33.0138,29.2496,28.4721,16.8916,16.6571,27.6247,11.4489,9.98848,16.8916,16.6571,NULL),(183,624,'J1','j1','Hybrid','J1','<p>J1 is a high-end <a href=\"http://www.leafly.com/hybrid\">hybrid</a> strain that is gaining widespread popularity. Although a hybrid, the high-energy effects categorize the strain more on the <a href=\"http://www.leafly.com/sativa\">sativa</a> end of the scale. J1 is a cross between two famous sativas, <a href=\"http://www.leafly.com/sativa/skunk-1\" style=\"text-decoration:none;\">Skunk #1</a> and <a href=\"http://www.leafly.com/sativa/jack-herer\" style=\"text-decoration:none;\">Jack Herer</a>, and is best known for its strong, <a href=\"http://www.leafly.com/explore/tags-uplifted\">uplifting</a>, clear-headed buzz that allows for mobility. The flowers are emerald green and frosty with a sweet aroma resembling the unmistakable Jack Herer pungency. This strain&rsquo;s seemingly only flaw is the top-shelf price that tends to come with its exceptional quality.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/j1_100x100_1e99.jpg','https://leafly.blob.core.windows.net/reviews/j1_100x100_0fc2.jpg','https://leafly.blob.core.windows.net/reviews/j1_100x100_849f.jpg','https://leafly.blob.core.windows.net/reviews/j1_100x100_00ed.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358619/b/j1__primary_7d6e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354008/b/j1__primary_523b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353449/b/j1__primary_d6ad.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351123/b/j1__primary_a984.jpg',NULL,86.0941,82.552,79.6151,72.5101,54.6829,49.1279,39.3773,29.0728,19.2441,18.8355,31.2189,18.9295,13.5498,19.2441,18.8355,NULL),(184,49,'Super Skunk','super-skunk','Indica','Ssk','<p>A predominantly <a href=\"http://www.leafly.com/indica\">indica</a> variety, Super Skunk takes its robust flowers from its parent strain <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a>. By backcrossing the legendary Skunk with <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> genetics, Sensi Seeds created a strain with dense, thick buds that are known to be extremely <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a> with a surprisingly <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> taste. This strain produces a bold <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> effect over the body and is a great answer for increased <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a> and body <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pains</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/super-skunk_100x100_816e.jpg','https://leafly.blob.core.windows.net/reviews/super-skunk_100x100_d7dd.jpg','https://leafly.blob.core.windows.net/reviews/super-skunk_100x100_0bfd.jpg','https://leafly.blob.core.windows.net/reviews/super-skunk_100x100_514b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364113/b/super-skunk__primary_68de.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361803/b/super-skunk__primary_11f0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360188/b/super-skunk__primary_1ae0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351511/b/super-skunk__primary_b8f7.jpg',NULL,77.894,62.4709,55.9394,39.9475,39.5281,35.3984,31.6319,29.6841,19.5881,18.2242,29.8595,16.0459,11.9793,19.5881,18.2242,NULL),(185,154,'Super Sour Diesel','super-sour-diesel','Sativa','Ssd','<p>Taking after its popular parents, Super Sour Diesel is one incredible sativa. A potent cross between <a href=\"http://www.leafly.com/sativa/super-silver-haze\">Super Silver Haze</a> and <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>, Super Sour Diesel knocks out stress and pain while fostering creativity and euphoria. In true sativa form, Super Sour Diesel energizes, making it great for daytime use. New users, however, should use caution when trying this strain. Super Sour Diesel produces strong cerebral effects, which may be overpowering to novice MMJ patients. Familiar users will be surprised at this strain&rsquo;s introspective spark. Sociable and fun, the effects of this strain are felt upon first taste. Super Sour Diesel&rsquo;s pungent, fuel-like aroma speaks to the sheer strength of this strain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/super-sour-diesel_100x100_8feb.jpg','https://leafly.blob.core.windows.net/reviews/super-sour-diesel_100x100_adac.jpg','https://leafly.blob.core.windows.net/reviews/super-sour-diesel_100x100_e63e.jpg','https://leafly.blob.core.windows.net/reviews/super-sour-diesel_100x100_68f0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362383/b/super-sour-diesel__primary_48a4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344423/b/super-sour-diesel__primary_9d62.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340946/b/super-sour-diesel__primary_1836.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330982/b/super-sour-diesel__primary_1215.jpg',NULL,54.4179,50.4936,47.956,42.4737,40.1289,34.2709,28.399,27.7066,15.1437,13.6497,24.5012,15.1083,6.83076,15.1437,13.6497,NULL),(186,9379,'Deadhead OG','deadhead-og','Hybrid','Dh','<p>Deadhead OG is bred by The Cali Connection and is a 60/40 hybrid of <a href=\"http://www.leafly.com/hybrid/chemdawg-91\">Chemdawg 91</a>&nbsp;and&nbsp;<a href=\"http://www.leafly.com/indica/sfv-og-kush\">SFV OG Kush</a>. It grows to medium height and typically finishes flowering between 8 and 10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/deadhead-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/deadhead-og_100x100_e698.jpg','https://leafly.blob.core.windows.net/reviews/deadhead-og_100x100_bb03.jpg','https://leafly.blob.core.windows.net/reviews/deadhead-og_100x100_7ecd.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/deadhead-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358458/b/deadhead-og__primary_59fe.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356269/b/deadhead-og__primary_1a92.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353779/b/deadhead-og__primary_788c.jpg',NULL,85.0097,82.4916,73.2662,63.9691,42.9644,69.2874,61.7597,53.6675,39.1521,31.3233,50.1826,30.8031,27.5646,39.1521,31.3233,NULL),(187,1708,'Permafrost','permafrost','Hybrid','Per','<p>Permafrost is a <a href=\"http://leafly.com/sativa\">sativa</a>-dominant <a href=\"http://leafly.com/hybrid\">hybrid</a> named for its frosty coat of crystal trichomes and fresh <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> aroma. While some believe Permafrost to be the love child of <a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> and <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a>, others claim it comes from <a href=\"http://www.leafly.com/sativa/kali-mist\">Kali Mist</a> and Trinity Snow. True to its hybrid genetics, Permafrost&rsquo;s <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a> effects are balanced between mind and body. Larger doses demonstrate the strain&rsquo;s potency:&nbsp;as sensory detail peaks, <a href=\"http://www.leafly.com/explore#!/explore/tags-focused\">attention</a> becomes transfixed, and a full-body calm takes over. For this reason, Permafrost may help patients treating <a href=\"http://www.leafly.com/explore#!/explore/conditions-addadhd\">ADD/ADHD</a> and <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a> symptoms, and others have reported its success in treating <a href=\"http://www.leafly.com/explore#!/explore/conditions-arthritis\">arthritis</a>, <a href=\"http://www.leafly.com/explore#!/explore/conditions-asthma\">asthma</a>, <a href=\"http://www.leafly.com/explore#!/explore/conditions-multiple-sclerosis\">multiple sclerosis</a>, and gastrointestinal disorders.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/permafrost_100x100_2121.jpg','https://leafly.blob.core.windows.net/reviews/permafrost_100x100_2724.jpg','https://leafly.blob.core.windows.net/reviews/permafrost_100x100_df70.jpg','https://leafly.blob.core.windows.net/reviews/permafrost_100x100_6363.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363326/b/permafrost__primary_0691.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362481/b/permafrost__primary_8162.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350477/b/permafrost__primary_2399.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339852/b/permafrost__primary_c88e.jpg',NULL,73.374,69.7154,58.9973,51.1789,47.4797,48.0894,37.981,35.4878,25.2575,22.6016,48.1843,22.1816,12.832,25.2575,22.6016,NULL),(188,156,'Orange Crush','orange-crush','Hybrid','Oc','<p>Orange Crush is a sativa-dominant cannabis strain with a super sweet tangy flavor and aroma.&nbsp;Bred by BC Growers Association with <a href=\"http://www.leafly.com/hybrid/california-orange\">California&nbsp;Orange</a> and <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> for parents, Orange Crush produces a powerful cerebral sensation&nbsp;that can last up to two hours. It has small, dense buds that contain&nbsp;a large amount of trichomes and many orange pistils. Orange Crush&nbsp;has a flowering time of 7-9 weeks and a THC content of up to 15%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/orange-crush/primary?width=200','https://leafly.blob.core.windows.net/reviews/orange-crush_100x100_f692.jpg','https://leafly.blob.core.windows.net/reviews/orange-crush_100x100_4e0b.jpg','https://leafly.blob.core.windows.net/reviews/orange-crush_100x100_6b2b.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/orange-crush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363155/b/orange-crush__primary_d26e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361482/b/orange-crush__primary_319c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356589/b/orange-crush__primary_d29d.jpg',NULL,79.7769,64.2473,60.6554,53.9089,53.5017,43.1303,25.1675,22.2239,20.5414,14.0881,27.152,20.3129,9.44027,20.5414,14.0881,NULL),(189,808,'Space Queen','space-queen','Hybrid','Sq','<p>Space Queen is <a href=\"http://www.leafly.com/indica/romulan\">Romulan</a> crossed with <a href=\"http://www.leafly.com/hybrid/cinderella-99\">Cinderella 99</a>. &nbsp;This weed has a very fruity taste, with a hint of pineapple. &nbsp;A definite head high, very Haze-like in its characteristics.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/space-queen/primary?width=200','https://leafly.blob.core.windows.net/reviews/space-queen_100x100_381a.jpg','https://leafly.blob.core.windows.net/reviews/space-queen_100x100_492a.jpg','https://leafly.blob.core.windows.net/reviews/space-queen_100x100_0f47.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/space-queen/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355700/b/space-queen__primary_b28f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351190/b/space-queen__primary_bf15.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349330/b/space-queen__primary_6239.jpg','https://leafly.s3.amazonaws.com/strains/testing/81TAqDRpSDCLtdSQ31Vv_space-queen.png',80.7421,70.0924,67.0014,56.9865,38.9007,43.4246,37.2346,22.4422,18.6271,17.4632,34.73,12.2035,11.2825,18.6271,17.4632,'Difficult'),(190,88,'Jack the Ripper','jack-the-ripper','Sativa','Jtr','<p>Jack the Ripper is appropriately named for being a &quot;killer&quot; cannabis strain. It&nbsp;has an incredible lemon smell and heavy resin production. The strain produces strong and thought-provoking effects that&nbsp;will creep up on you and leave you feeling meditative.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/jack-the-ripper_100x100_2284.jpg','https://leafly.blob.core.windows.net/reviews/jack-the-ripper_100x100_41fb.jpg','https://leafly.blob.core.windows.net/reviews/jack-the-ripper_100x100_c226.jpg','https://leafly.blob.core.windows.net/reviews/jack-the-ripper_100x100_1b78.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343730/b/jack-the-ripper__primary_c69d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/324919/b/jack-the-ripper__primary_a620.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309646/b/jack-the-ripper__primary_0657.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/304214/b/jack-the-ripper__primary_7c38.jpg',NULL,82.1687,72.1937,66.6308,62.4365,51.7001,41.5484,37.8958,19.2741,13.1418,11.806,30.9971,17.3966,8.97702,13.1418,11.806,NULL),(191,65624,'White Fire OG','white-fire-og','Hybrid','Wif','<p class=\"p1\">White Fire OG, also known as WiFi OG, is a 60% sativa hybrid with uplifting and comfortable cerebrally focused effects. This strain combines the best features of its parent strains: the sour, earthy, diesel aroma of <a href=\"http://www.leafly.com/hybrid/fire-og\">Fire OG</a> and the high resin production of <a href=\"http://www.leafly.com/hybrid/the-white\">The White</a> that leaves the plants covered in a dusty snowfall of crystals. Many phenotypes of White Fire OG exist, some with dense, barrel-like buds and others with pointed, conic formations. Daytime use of this strain won&rsquo;t leave the consumer drowsy, making it a good choice for social and creative activities. White Fire OG is often chosen by patients to treat anxiety and depression, cancer, glaucoma, pain, and appetite loss. Growers of White Fire OG can raise their high-yielding plants outdoors or inside with a 65-day flowering period.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/white-fire-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/white-fire-og_100x100_3155.jpg','https://leafly.blob.core.windows.net/reviews/white-fire-og_100x100_041e.jpg','https://leafly.blob.core.windows.net/reviews/white-fire-og_100x100_21da.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/white-fire-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356272/b/white-fire-og__primary_ee13.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356430/b/white-fire-og__primary_af14.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352547/b/white-fire-og__primary_aa4d.jpg','https://leafly.s3.amazonaws.com/strains/testing/jmxqh4CIRBCOjaCiQlMJ_white-fire.png',73.2883,69.5848,67.333,62.7239,41.8199,42.8842,41.8199,39.6845,20.4267,19.3358,30.5719,14.9487,14.2375,20.4267,19.3358,NULL),(192,3554,'Obama Kush','obama-kush','Indica','Oba','<p>This unique indica appropriately channels the President&rsquo;s famous message of &lsquo;Change&rsquo; as it invigorates and inspires. Daughter of indica <a href=\"http://www.leafly.com/indica/afghani\" style=\"text-decoration:none;\">Afghani</a> and mostly sativa hybrid <a href=\"http://www.leafly.com/hybrid/og-kush\" style=\"text-decoration:none;\">OG Kush</a>, Obama Kush sets itself apart from other indicas through its cerebral stimulation and euphoric rush. This strain is recommended for all levels of patients looking for a balanced experience, as it offers powerful physical effects as well as an intense cerebral uplift that does not stimulate appetite or put you to sleep. The flowers are frosty with a purple hue and reddish hairs, giving off a light aroma.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/obama-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/obama-kush_100x100_5c00.jpg','https://leafly.blob.core.windows.net/reviews/obama-kush_100x100_a2db.jpg','https://leafly.blob.core.windows.net/reviews/obama-kush_100x100_c56d.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/obama-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/359985/b/obama-kush__primary_4cad.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358706/b/obama-kush__primary_56ab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358552/b/obama-kush__primary_911b.jpg',NULL,74.478,46.4561,45.466,32.1662,28.8695,45.0235,41.9529,28.675,22.3068,20.036,21.5054,12.3991,10.3444,22.3068,20.036,NULL),(193,70,'Afghani','afghani','Indica','Afg','<p>Afghani is a heavy <a href=\"http://leafly.com/indica\">indica</a> strain named after its geographic origin, where the <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-cannabis-origin-what-is-a-landrace-strain\">earliest varieties of cannabis</a> are believed to have grown. Breeders worldwide have come to treasure Afghani for its heavy resin production which is passed on genetically. With a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> aroma, Afghani delivers a deep, sedating <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>. Patients most commonly turn to this potent indica to treat <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">insomnia</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress disorders</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/afghani_100x100_60ae.jpg','https://leafly.blob.core.windows.net/reviews/afghani_100x100_add5.jpg','https://leafly.blob.core.windows.net/reviews/afghani_100x100_196a.jpg','https://leafly.blob.core.windows.net/reviews/afghani_100x100_99fb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364379/b/afghani__primary_9122.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358293/b/afghani__primary_d58e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353391/b/afghani__primary_1fb8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347443/b/afghani__primary_91fc.jpg',NULL,76.4679,53.962,49.5823,42.229,36.0173,54.0546,43.9683,36.5036,27.5403,18.6174,34.1271,18.5047,13.9954,27.5403,18.6174,NULL),(194,231,'Vanilla Kush','vanilla-kush','Indica','Van','<p><span style=\"line-height: 20.7999992370605px;\">This indica strain comes from Barney&rsquo;s Farm in Amsterdam and clinched 2nd place overall at the 2009&nbsp;</span><em style=\"line-height: 20.7999992370605px;\">High Times</em><span style=\"line-height: 20.7999992370605px;\">&nbsp;Cannabis Cup for the coffee shop and seed company. Bred from Afghan and Kashmir strains, this Kush beauty is a gift to the senses with her notes of vanilla, lavender, and a hint of citrus. Plants flower in 8 weeks and produce large, soft flowers that are light green with hints of orange. This strain has a high THC content often measuring over 20%, making it a potent choice that might be strong for new users.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/vanilla-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/vanilla-kush_100x100_a73d.jpg','https://leafly.blob.core.windows.net/reviews/vanilla-kush_100x100_1bed.jpg','https://leafly.blob.core.windows.net/reviews/vanilla-kush_100x100_15b8.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/vanilla-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361937/b/vanilla-kush__primary_017b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352332/b/vanilla-kush__primary_c970.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352331/b/vanilla-kush__primary_750a.jpg',NULL,78.6058,64.7874,49.3777,47.3663,46.4599,46.7231,38.7937,35.8428,28.9424,19.1413,44.3278,11.3787,10.2293,28.9424,19.1413,NULL),(195,650,'Blue Widow','blue-widow','Hybrid','Bw','<p class=\"p1\">Blue Widow is a favorite strain that provides consumers with both uplifting and calming effects. These flowers will have a strong sweet aroma that may also include sour citrus or pine. The buds can be colorful, with tints of blue and purple, and should have a coat of long orange hairs. Slightly indica-dominant, this Widow plays against type, growing taller than most indicas and providing more mental, heady effects. In higher doses, the blissful relaxation this strain provides may lead to drowsiness and help you get to sleep. A cross between <a href=\"http://www.leafly.com/hybrid/blueberry\"><span class=\"s1\">Blueberry</span></a> and <a href=\"http://www.leafly.com/hybrid/white-widow\"><span class=\"s1\">White Widow</span></a>, Blue Widow&nbsp;is sometimes also called <span class=\"s1\"><a href=\"http://www.leafly.com/hybrid/0bf3f759-186e-4dad-89d0-e0fc7598ac53\">Berry White</a>,&nbsp;</span><span class=\"s1\"><a href=\"http://www.leafly.com/hybrid/white-berry\">White Berry</a>, and&nbsp;<a href=\"http://www.leafly.com/hybrid/blue-venom\">Blue Venom</a>.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_556b.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_a51a.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_d677.jpg','https://leafly.blob.core.windows.net/reviews/blue-widow_100x100_7419.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360507/b/blue-widow__primary_90c7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355829/b/blue-widow__primary_89e8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355052/b/blue-widow__primary_e785.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352523/b/blue-widow__primary_c069.jpg',NULL,66.9315,62.2112,53.8219,46.6707,34.6319,36.8062,31.6952,22.7394,18.049,14.6057,18.9801,10.114,8.5216,18.049,14.6057,NULL),(196,171,'Jack Frost','jack-frost','Hybrid','Jf','<p>Bred by Goldenseed, Jack Frost was developed over 5 years of persistence in order to improve on the potency and aroma of this strain. Initially with a lineage of Jack Herrer, White Widow and Northern Lights #5, these strains were bred before then introducing Rainbow Kashmiri (now it its third year of exclusive inbreeding). THC content in this strain has been measured up to 22.6%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/jack-frost_100x100_4726.jpg','https://leafly.blob.core.windows.net/reviews/jack-frost_100x100_41f9.jpg','https://leafly.blob.core.windows.net/reviews/jack-frost_100x100_e2f7.jpg','https://leafly.blob.core.windows.net/reviews/jack-frost_100x100_60a3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358553/b/jack-frost__primary_feee.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358447/b/jack-frost__primary_7ee6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357837/b/jack-frost__primary_d06f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353682/b/jack-frost__primary_ffe4.jpg',NULL,89.6467,84.5466,80.8174,68.8229,55.5343,47.0179,37.8693,28.3929,16.9923,15.9664,22.4095,14.0783,9.81269,16.9923,15.9664,NULL),(197,25519,'Holy Grail Kush','holy-grail-kush','Hybrid','Hol','<p>Holy Grail Kush is a newer strain created by seed breeders DNA Genetics and Reserva Privada Colorado. It entered into the Seed Company Hybrids category at the 2011 <em>High Times </em>Cannabis Cup. As the offspring of multi-award winners <a href=\"http://www.leafly.com/hybrid/og-18\">OG #18</a> and <a href=\"http://www.leafly.com/indica/kosher-kush\">Kosher Kush</a>, it&rsquo;s no surprise that Holy Grail Kush came out on top and is said to have nabbed the competition&rsquo;s first-ever perfect score. The plants are easy to grow, with large, dense buds appearing at 9 to 10 weeks. Most of Holy Grail Kush&rsquo;s praise centers around its potency; THC levels have tested at over 20%, but this hybrid produces a more mellow relaxation than the melt-your-face-off indica sensation the name might suggest. The aroma of this plant is pure kush and has a strong spicy citrus smell, both while growing and once harvested, that is uniquely complex.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/holy-grail-kush_100x100_2083.jpg','https://leafly.blob.core.windows.net/reviews/holy-grail-kush_100x100_fe93.jpg','https://leafly.blob.core.windows.net/reviews/holy-grail-kush_100x100_b228.jpg','https://leafly.blob.core.windows.net/reviews/holy-grail-kush_100x100_9994.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355548/b/holy-grail-kush__primary_5c21.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347450/b/holy-grail-kush__primary_24ae.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344625/b/holy-grail-kush__primary_12df.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343178/b/holy-grail-kush__primary_cace.jpg',NULL,69.9291,63.5094,55.8072,49.5695,34.6188,46.0574,34.8567,34.3198,21.4071,20.0404,31.1013,10.2674,9.96035,21.4071,20.0404,NULL),(199,701,'Pre-98 Bubba Kush','pre-98-bubba-kush','Indica','P98','<p>Born in the days of grunge, The Spice Girls, and Y2K, Pre-98 Bubba Kush is a blast from the past. This strain provides consumers with a consistent indica-heavy body sensation, making it a favorite for more than a decade. Pre-98 Bubba Kush is great for those looking for pain relief without feeling overwhelmed or incapacitated. Flowering at around 10 weeks, P-98 features a pungent, musky scent and coffee-like taste. This oldie but goodie might be just the thing when you&rsquo;re looking to relax and unwind at the end of a long day.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/pre-98-bubba-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/pre-98-bubba-kush_100x100_6636.jpg','https://leafly.blob.core.windows.net/reviews/pre-98-bubba-kush_100x100_c36e.jpg','https://leafly.blob.core.windows.net/reviews/pre-98-bubba-kush_100x100_e3c3.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/pre-98-bubba-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364108/b/pre-98-bubba-kush__primary_8e55.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360566/b/pre-98-bubba-kush__primary_7bc9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360719/b/pre-98-bubba-kush__primary_27ac.jpg',NULL,83.4071,60.3982,57.5629,48.1078,34.9266,54.0755,43.0756,42.1751,28.3244,18.454,35.7941,14.0623,12.5078,28.3244,18.454,NULL),(200,10,'MK Ultra','mk-ultra','Indica','Mk','<p>Named after the methods of mental manipulation employed by the CIA&rsquo;s Project MKUltra, this indica-dominant strain stands apart due to its powerful cerebral effects. A cross between&nbsp;mostly-sativa hybrid <a href=\"http://www.leafly.com/hybrid/og-kush\" style=\"text-decoration:none;\">OG Kush</a> and indica <a href=\"http://www.leafly.com/indica/g-13\" style=\"text-decoration:none;\">G-13</a>, this strain is bred by TH Seeds and won 1st place Indica at the<em> High Times</em> Cannabis Cup in 2003 and 2nd place in 2004. Indoor growing is facilitated by the plant&rsquo;s short stature, and its above average yield delivers particularly sticky, dense, pungent flowers. MK Ultra is renowned for its &lsquo;hypnotic&rsquo; effects that are fast-acting and best used when strong medication is desired. As evidenced by its collection of awards, this indica is one of the strongest in the world. It might be best for a day when not getting off the couch would be fine.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/mk-ultra/primary?width=200','https://leafly.blob.core.windows.net/reviews/mk-ultra_100x100_a563.jpg','https://leafly.blob.core.windows.net/reviews/mk-ultra_100x100_c116.jpg','https://leafly.blob.core.windows.net/reviews/mk-ultra_100x100_f880.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/mk-ultra/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349514/b/mk-ultra__primary_0f6e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348592/b/mk-ultra__primary_88b8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336472/b/mk-ultra__primary_5dba.jpg',NULL,84.2435,76.7768,71.7768,68.4405,50.8402,67.4031,61.2478,49.0262,41.2351,37.4633,40.5021,22.1095,19.541,41.2351,37.4633,NULL),(201,5176,'Moby Dick','moby-dick','Sativa','Mdk','<p>Originating in Amsterdam and currently bred by Dinafem Seeds, Moby Dick&rsquo;s high THC content makes it one of the strongest sativas. Winner of &lsquo;Girl of the Year&rsquo; by the cannabis newspaper <em>Soft Secrets</em> in 2010, this strain is a cross between indica-dominant hybrid <a href=\"http://www.leafly.com/hybrid/white-widow\" style=\"text-decoration:none;\">White Widow</a> and sativa <a href=\"http://www.leafly.com/sativa/haze\" style=\"text-decoration:none;\">Haze</a>; the former is known for its power while the latter for its cerebral stimulation, creating a mostly sativa plant that delivers a charged buzz. This strain is also favored for its short flowering period, mold resistance, and high yield, making it a grower favorite. However, the plant does require more attention and care. The aroma is a sweet citrus from the Haze, which dominates the palate with vanilla and eucalyptus tones.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/moby-dick_100x100_fb0a.jpg','https://leafly.blob.core.windows.net/reviews/moby-dick_100x100_8fae.jpg','https://leafly.blob.core.windows.net/reviews/moby-dick_100x100_49e0.jpg','https://leafly.blob.core.windows.net/reviews/moby-dick_100x100_59de.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363252/b/moby-dick__primary_3fc3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355148/b/moby-dick__primary_4088.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347525/b/moby-dick__primary_c983.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346392/b/moby-dick__primary_9322.jpg',NULL,77.3482,66.1763,63.1593,62.9765,62.8088,47.2733,34.1287,30.0639,16.2929,13.8132,29.9494,14.0322,11.9392,16.2929,13.8132,NULL),(202,58159,'Animal Cookies','animal-cookies','Hybrid','Ac','<p>Animal Cookies is the child of the legendary hybrid marijuana strains <a href=\"http://www.leafly.com/hybrid/girl-scout-cookie\">Girl Scout Cookies</a> and <a href=\"http://www.leafly.com/hybrid/fire-og\">Fire OG</a>. This clone-only strain flowers in 9-10 weeks, and grows into dense, frosty green buds tipped with purple. True to its name, Animal Cookies has a sweet, sour aroma with heavy full-body effects that will impress any veteran consumer. This potent medicine might be overkill for mild symptoms, but its ability to obliterate severe pain and insomnia is unprecedented.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/animal-cookies_100x100_9a68.jpg','https://leafly.blob.core.windows.net/reviews/animal-cookies_100x100_dcc3.jpg','https://leafly.blob.core.windows.net/reviews/animal-cookies_100x100_aed2.jpg','https://leafly.blob.core.windows.net/reviews/animal-cookies_100x100_b458.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364322/b/animal-cookies__primary_26c0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364589/b/animal-cookies__primary_d20b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360185/b/animal-cookies__primary_5882.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356911/b/animal-cookies__primary_e706.jpg',NULL,83.6538,76.1218,60.7372,54.1667,38.3013,44.8718,39.2628,36.859,29.1667,20.3526,31.7308,15.8654,15.7051,29.1667,20.3526,NULL),(203,58127,'Amnesia','amnesia','Sativa','Am','<p>Amnesia is typically a sativa-dominant cannaibs strain with some variation between breeders. Skunk, <a href=\"http://www.leafly.com/hybrid/cinderella-99\">Cinderella 99</a>, and <a href=\"http://www.leafly.com/sativa/jack-herer\">Jack Herer</a> are some of Amnesia&rsquo;s genetic forerunners, passing on uplifting, creative, and euphoric effects ideal for treating mood disorders. Growers should expect a 9-10 week flowering period with moderate yields. This strain normally has a high THC and low CBD profile and produces intense psychotropic effects that new consumers should be wary of.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/amnesia_100x100_84de.jpg','https://leafly.blob.core.windows.net/reviews/amnesia_100x100_69c1.jpg','https://leafly.blob.core.windows.net/reviews/amnesia_100x100_03ce.jpg','https://leafly.blob.core.windows.net/reviews/amnesia_100x100_1aa2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363417/b/amnesia__primary_65f5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362254/b/amnesia__primary_5903.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360300/b/amnesia__primary_f693.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/359178/b/amnesia__primary_0a48.jpg',NULL,72.7523,63.6207,50.8349,43.8679,40.0973,26.8238,19.2177,14.5365,12.2452,11.2969,15.6867,11.0434,8.72386,12.2452,11.2969,NULL),(204,24,'Haze','haze','Sativa','H','<p>The illustrious Haze <a href=\"http://leafly.com/sativa\">sativa</a> first took root in Santa Cruz, California during the 1960s where long growing seasons accommodated her lengthy flowering cycle. Since then, Haze has become the proud parent of countless <a href=\"http://leafly.com/hybrid\">hybrids</a> around the globe, passing on its genetics from <a href=\"http://www.leafly.com/sativa/south-american\">Colombia</a>, <a href=\"http://www.leafly.com/sativa/mexican\">Mexico</a>, and&nbsp;<a href=\"http://www.leafly.com/sativa/thai\">Thailand</a>. Although Haze cultivators must wait patiently for Haze flowers to reach full maturation, few strains can match the high-energy, creative buzz provided by this sativa staple. Haze&#39;s aroma is typically characterized by a spicy scent accented by hints of citrus and earthy sweetness.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/haze/primary?width=200','https://leafly.blob.core.windows.net/reviews/haze_100x100_5787.jpg','https://leafly.blob.core.windows.net/reviews/haze_100x100_c11b.jpg','https://leafly.blob.core.windows.net/reviews/haze_100x100_26a0.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/haze/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362735/b/haze__primary_48c1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358291/b/haze__primary_1547.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350968/b/haze__primary_e738.jpg',NULL,74.3726,58.3354,55.1899,52.4703,51.5672,40.0504,25.2071,22.1245,16.1318,14.1047,18.5726,13.128,9.50534,16.1318,14.1047,NULL),(205,4887,'Acapulco Gold','acapulco-gold','Sativa','Aca','<p>One of the most well-known strains, Acapulco Gold has been likened to dinner at a five-star restaurant. The strain&nbsp;comes from the areas in and around Acapulco, Mexico. Its orange hairs resemble a gold nugget, with gold, green, and brown colors of resin collecting on the buds. An aroma of burnt toffee lingers when the bud is broken up.&nbsp;</p>\n\n<p>Acapulco Gold&nbsp;has a reputation for being&nbsp;one of the best cannabis strains ever created, and is becoming more difficult to find due to more growers moving indoors. It is also known to contain approximately 23% of THC.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/acapulco-gold_100x100_c7fe.jpg','https://leafly.blob.core.windows.net/reviews/acapulco-gold_100x100_b17e.jpg','https://leafly.blob.core.windows.net/reviews/acapulco-gold_100x100_f319.jpg','https://leafly.blob.core.windows.net/reviews/acapulco-gold_100x100_7454.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363854/b/acapulco-gold__primary_5e18.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354099/b/acapulco-gold__primary_1b3e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345483/b/acapulco-gold__primary_74d3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344493/b/acapulco-gold__primary_4b9c.jpg',NULL,75.7396,67.4503,60.935,45.2846,44.5607,54.2073,41.5808,37.6163,21.1009,21.023,42.6773,17.9359,15.8988,21.1009,21.023,NULL),(206,379,'Strawberry Kush','strawberry-kush','Hybrid','Stk','<p class=\"p1\">Strong and sweet, Strawberry Kush is one well-rounded lady. Featuring a musky imitation strawberry taste, this strain lives up to its lineage. Typically found as a cross between the sweet <a href=\"http://www.leafly.com/hybrid/strawberry-cough\"><span class=\"s1\">Strawberry Cough </span></a>and the pungent <a href=\"http://www.leafly.com/hybrid/og-kush\"><span class=\"s1\">OG Kush</span></a>, Strawberry Kush is strong but not overpowering. A potent indica for novice consumers, it&rsquo;s a sleepy strain that produces a calming heavy body sensation. The genetics for this strain may vary by dispensary. Some dispensaries carry more hybrid or sativa-dominant versions, which may produce opposite, energizing effects. For growers, Strawberry Kush is available by clone only and typically flowers between 8 and 9 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/strawberry-kush_100x100_102a.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-kush_100x100_336a.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-kush_100x100_487a.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-kush_100x100_2a07.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358671/b/strawberry-kush__primary_91c5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354219/b/strawberry-kush__primary_65f5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351534/b/strawberry-kush__primary_4280.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341077/b/strawberry-kush__primary_6b65.jpg',NULL,61.1167,59.4291,51.3758,40.7998,37.8144,41.7631,28.2822,25.5835,24.1851,23.0734,28.828,5.69416,5.49547,24.1851,23.0734,NULL),(207,2607,'Platinum Bubba Kush','platinum-bubba-kush','Indica','Pbk','<p>Platinum Bubba Kush is a &ldquo;platinum&rdquo; level indica-dominant strain for those who are looking for strong medicine. Best for strong body relaxation, pain relief, sleepiness and appetite stimulation, Pbk is a long-lasting &ldquo;creeper&rdquo; that may take a few minutes to kick in, but you won&rsquo;t miss it once it does. Floral and full of kush spiciness in aroma, the flowers of this strain will have a surprisingly sweet flavor that&rsquo;s a patient favorite. Across between Platinum OG Kush and Bubba Kush, this indica finishes flowering in 8 to 9 weeks.&nbsp;These dense, purple-hued nugs are popular in California and are finding their way to other areas.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/platinum-bubba-kush_100x100_92df.jpg','https://leafly.blob.core.windows.net/reviews/platinum-bubba-kush_100x100_4ed5.jpg','https://leafly.blob.core.windows.net/reviews/platinum-bubba-kush_100x100_7b07.jpg','https://leafly.blob.core.windows.net/reviews/platinum-bubba-kush_100x100_9920.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349807/b/platinum-bubba-kush__primary_59a8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338412/b/platinum-bubba-kush__primary_0dc6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335423/b/platinum-bubba-kush__primary_5662.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/329073/b/platinum-bubba-kush__primary_eec5.jpg',NULL,102.645,84.657,56.7424,56.3062,51.1969,46.3948,38.064,28.8126,25.162,24.5063,34.5825,20.2054,18.6389,25.162,24.5063,NULL),(210,177,'Cherry Kush','cherry-kush','Hybrid','Ck','<p>Cherry Kush is a hybrid strain of cannabis that appropriately smells&nbsp;and tastes like cherry and kush. It produces full-body effects and is generally a favorite among cannabis consumers.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cherry-kush_100x100_545c.jpg','https://leafly.blob.core.windows.net/reviews/cherry-kush_100x100_a5fe.jpg','https://leafly.blob.core.windows.net/reviews/cherry-kush_100x100_132a.jpg','https://leafly.blob.core.windows.net/reviews/cherry-kush_100x100_66fc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365002/b/cherry-kush__primary_1a0f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353047/b/cherry-kush__primary_c5cd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352438/b/cherry-kush__primary_1a56.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336503/b/cherry-kush__primary_5d3d.jpg',NULL,78.7656,73.1516,59.9382,46.5676,41.8458,43.0695,38.4102,28.662,26.2911,15.9982,41.0722,10.7468,6.97676,26.2911,15.9982,NULL),(211,73935,'Ghost Train Haze','ghost-train-haze','Sativa','Gth','<p>First bred by Rare Dankness, Ghost Train Haze is a <a href=\"http://leafly.com/sativa\">sativa</a> cross between <a href=\"http://www.leafly.com/hybrid/ghost-og\">Ghost OG</a> and <a href=\"http://www.leafly.com/sativa/nevils-wreck\">Neville&rsquo;s Wreck</a>. Unlike typical sativas, Ghost Train Haze grows dense buds blanketed in white, crystal-capped trichomes. With a sour <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-flowery\">floral</a> aroma, Ghost Train Haze delivers a potent dose of THC to knock out <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-depression\">depression</a>, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-lack-of-appetite\">appetite loss</a>, but patients prone to <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a> should steer clear of this heavy-hitter. Low doses are conducive to <a href=\"http://www.leafly.com/explore#!/explore/tags-focused\">concentration</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creativity</a>, but you may notice some cerebral haziness as you administer more. Ghost Train Haze is a suitable outdoor strain for warm climates and has a 65 to 80 day flowering time indoors.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/ghost-train-haze/primary?width=200','https://leafly.blob.core.windows.net/reviews/ghost-train-haze_100x100_8cfb.jpg','https://leafly.blob.core.windows.net/reviews/ghost-train-haze_100x100_579b.jpg','https://leafly.blob.core.windows.net/reviews/ghost-train-haze_100x100_59a4.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/ghost-train-haze/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364138/b/ghost-train-haze__primary_3fe4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363639/b/ghost-train-haze__primary_bdc6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362059/b/ghost-train-haze__primary_82f1.jpg',NULL,63.4621,57.6071,56.7852,49.4631,48.7805,38.9433,36.5808,22.0074,19.0682,18.0312,18.1898,13.6218,10.965,19.0682,18.0312,NULL),(212,8618,'God Bud','god-bud','Indica','Gbd','<p>A great strain for small spaces, God Bud doesn&#39;t grow much higher than 3 feet tall. &nbsp;Ideal for indoor growing in a cooler climate.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/god-bud_100x100_1583.jpg','https://leafly.blob.core.windows.net/reviews/god-bud_100x100_3d61.jpg','https://leafly.blob.core.windows.net/reviews/god-bud_100x100_1198.jpg','https://leafly.blob.core.windows.net/reviews/god-bud_100x100_c5cc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356273/b/god-bud__primary_e278.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355231/b/god-bud__primary_14f8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354935/b/god-bud__primary_b442.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347496/b/god-bud__primary_fbc9.jpg',NULL,92.7103,61.3799,54.3362,51.5406,46.8495,56.1027,47.909,43.5994,36.3921,30.533,33.5414,20.6584,13.9599,36.3921,30.533,NULL),(214,2113,'707 Headband','707-headband','Hybrid','707','<p>This strain emerged from the Bay Area of California and that area&rsquo;s telephone area code is the source of its numerical moniker. It&rsquo;s a cross between <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>, <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and <a href=\"http://www.leafly.com/hybrid/master-kush\">Master Kush</a>. 707 Headband plants flower in 9 to 11 weeks and usually have large yields. An indica dominant hybrid, this strain is known to have high THC levels and can be strong, but it&rsquo;s balanced enough to leave most users feeling &ldquo;heady&rdquo; and creative rather than sleepy. Because of this, it&rsquo;s often used to treat tension and anxiety.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/707-headband/primary?width=200','https://leafly.blob.core.windows.net/reviews/707-headband_100x100_6dcc.jpg','https://leafly.blob.core.windows.net/reviews/707-headband_100x100_6593.jpg','https://leafly.blob.core.windows.net/reviews/707-headband_100x100_b0e4.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/707-headband/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341358/b/707-headband__primary_1380.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/315722/b/707-headband__primary_f893.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/305870/b/707-headband__primary_056e.jpg',NULL,64.5901,63.7568,52.4969,45.727,45.5455,56.0065,43.0601,42.4228,23.3636,22.6377,36.481,9.63287,6.88256,23.3636,22.6377,NULL),(215,109,'Ogre','ogre','Indica','Ogr','<p>Ogre has a pungent and lemony scent and provides a strong body high.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ogre_100x100_a5ce.jpg','https://leafly.blob.core.windows.net/reviews/ogre_100x100_7092.jpg','https://leafly.blob.core.windows.net/reviews/ogre_100x100_1fff.jpg','https://leafly.blob.core.windows.net/reviews/ogre_100x100_95a7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354122/b/ogre__primary_5ec0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336277/b/ogre__primary_e8d2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335898/b/ogre__primary_6c4c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330945/b/ogre__primary_bf69.jpg',NULL,82.038,62.6487,58.9405,53.392,37.4043,47.725,43.0861,41.8239,28.1812,21.1774,35.2922,9.50216,8.20005,28.1812,21.1774,NULL),(216,397,'Pure Kush','pure-kush','Indica','Pur','<p>Clear your schedule because Pure Kush is one potent indica. A longtime favorite of pain sufferers, this strain will leave you feeling heavily sedated. Pure Kush&rsquo;s strength begins with its signature &ldquo;kush&rdquo; aroma that is extremely pungent and skunky. Upon first taste, it may have slightly sativa-like effects and create a pleasant pressure in the head and face. These head-heavy sensations are complemented by a relaxing body feeling that gives Pure Kush its reputation of one of the most powerful medical strains.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/pure-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/pure-kush_100x100_7ff4.jpg','https://leafly.blob.core.windows.net/reviews/pure-kush_100x100_ca92.jpg','https://leafly.blob.core.windows.net/reviews/pure-kush_100x100_a8e9.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/pure-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352925/b/pure-kush__primary_b7af.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341080/b/pure-kush__primary_43a1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/313322/b/pure-kush__primary_c394.jpg',NULL,65.0549,63.2784,57.3504,40.2015,37.5214,49.3773,48.9438,44.2369,22.033,12.0696,24.7436,9.86569,9.84127,22.033,12.0696,NULL),(217,186,'Grape God','grape-god','Hybrid','Gg','<p>Grape God is an indica-dominant hybrid that combines&nbsp;<a href=\"http://www.leafly.com/indica/god-bud\">God Bud</a> and <a href=\"http://www.leafly.com/sativa/grapefruit\">Grapefruit</a>&nbsp;genetics. As its name suggests, this strain has a sweet grape aroma with earthy notes that activate on the exhale. Powerful, long-lasting euphoria knocks out stress, leaving your mood elevated and your body relaxed.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/grape-god_100x100_1a53.jpg','https://leafly.blob.core.windows.net/reviews/grape-god_100x100_4112.jpg','https://leafly.blob.core.windows.net/reviews/grape-god_100x100_9191.jpg','https://leafly.blob.core.windows.net/reviews/grape-god_100x100_89c1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355071/b/grape-god__primary_e97b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353807/b/grape-god__primary_6b98.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340944/b/grape-god__primary_60f3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340304/b/grape-god__primary_75a7.jpg',NULL,72.6539,62.3095,57.8372,40.8777,34.8382,53.5616,45.1581,42.9754,26.4764,20.3999,35.1098,14.9762,14.9358,26.4764,20.3999,NULL),(218,256,'SAGE','sage','Hybrid','Sg','<p>S.A.G.E. stands for Sativa Afghani Genetic Equilibrium, it is a well balanced Haze crossed with a robust indica strain. &nbsp;Containing over 20% THC it took 2nd place in the blind test at the 2001 Cannabis Cup. &nbsp;Spicy sandalwood flavor combined with a long lasting and uplifting high make this the plant for those who like the best.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/sage_100x100_1d49.jpg','https://leafly.blob.core.windows.net/reviews/sage_100x100_b381.jpg','https://leafly.blob.core.windows.net/reviews/sage_100x100_9194.jpg','https://leafly.blob.core.windows.net/reviews/sage_100x100_dc8c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336019/b/sage__primary_472b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331065/b/sage__primary_12a3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331216/b/sage__primary_3869.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330186/b/sage__primary_1835.jpg',NULL,60.2066,56.6994,55.4882,46.5039,29.8606,38.698,34.3327,29.9237,16.1603,13.8363,37.3048,17.2635,9.64084,16.1603,13.8363,NULL),(219,59055,'Pink Kush','pink-kush','Hybrid','Pkk','<p>Pink Kush, as coveted as its <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> relative, is an indica-dominant hybrid with powerful body-focused effects. In its exceptional variations, pink hairs burst from bright green buds barely visible under a blanket of sugar-like trichomes, with traces of a sweet vanilla and candy perfume. Even for veteran consumers, the heaviness of this strain could be considered overpowering, and even small doses eliminate pain, insomnia, and appetite loss. Relaxation runs in Pink Kush&rsquo;s indica genes, promoting rest and stress relief without total sedation. Growers have to wait 10 to 11 weeks for Pink Kush&rsquo;s flowering, but high&nbsp;yields of top-shelf buds&nbsp;are worth the wait.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/pink-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/pink-kush_100x100_9cc5.jpg','https://leafly.blob.core.windows.net/reviews/pink-kush_100x100_682a.jpg','https://leafly.blob.core.windows.net/reviews/pink-kush_100x100_db4f.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/pink-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355015/b/pink-kush__primary_fca0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355211/b/pink-kush__primary_7896.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353076/b/pink-kush__primary_4dd2.jpg',NULL,88.2067,64.8133,55.1756,46.7899,46.1428,48.9701,42.0024,38.5283,27.7555,26.0933,22.1609,14.214,12.4679,27.7555,26.0933,NULL),(220,670,'Cat Piss','cat-piss','Sativa','Cat','<p>Don&#39;t let the name scare you, Cat Piss can result in a pleasantly mellow, uplifting cerebral state with a slight body high. Although the name and smell can be a &nbsp;deterrent &nbsp;to patients, most find it is sweet and sour with an underlying spicy taste, and a hint of pine at the exhale. With 8-9 weeks to flower, Cat Piss has a THC level of approximately 11%.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cat-piss_100x100_ba28.jpg','https://leafly.blob.core.windows.net/reviews/cat-piss_100x100_7548.jpg','https://leafly.blob.core.windows.net/reviews/cat-piss_100x100_7df6.jpg','https://leafly.blob.core.windows.net/reviews/cat-piss_100x100_7457.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361359/b/cat-piss__primary_c32b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355978/b/cat-piss__primary_abe0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347329/b/cat-piss__primary_eec2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331633/b/cat-piss__primary_ee39.jpg',NULL,51.0167,47.958,47.8067,37.1688,33.0357,39.7077,29.2396,17.0046,12.5029,10.1404,31.281,11.4351,9.0661,12.5029,10.1404,NULL),(222,42,'Kali Mist','kali-mist','Sativa','Km','<p><span style=\"line-height: 20.7999992370605px;\">Kali Mist is known to deliver clear-headed,&nbsp;</span><a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\" style=\"line-height: 20.7999992370605px;\">energetic</a><span style=\"line-height: 20.7999992370605px;\">&nbsp;effects that can verge on psychedelic at times. Despite having an unknown genetic history, Kali Mist is believed to have originated in the 1990s through crossing two&nbsp;</span><a href=\"http://www.leafly.com/sativa\" style=\"line-height: 20.7999992370605px;\">sativa</a><span style=\"line-height: 20.7999992370605px;\">-dominant&nbsp;</span><a href=\"http://www.leafly.com/hybrid\" style=\"line-height: 20.7999992370605px;\">hybrids</a><span style=\"line-height: 20.7999992370605px;\">. This lightweight sativa is a perfect choice for consumers looking to maintain focus and productivity throughout their day.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/kali-mist/primary?width=200','https://leafly.blob.core.windows.net/reviews/kali-mist_100x100_c592.jpg','https://leafly.blob.core.windows.net/reviews/kali-mist_100x100_64ae.jpg','https://leafly.blob.core.windows.net/reviews/kali-mist_100x100_bac5.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/kali-mist/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357521/b/kali-mist__primary_445a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357644/b/kali-mist__primary_ebe5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352900/b/kali-mist__primary_1ffd.jpg',NULL,72.9829,67.8011,66.8425,64.4808,57.6335,46.2775,40.5015,23.4371,21.0284,14.4929,28.8205,15.2311,10.1044,21.0284,14.4929,NULL),(223,170,'Kryptonite','kryptonite','Indica','Kry','<p>This indica dominant cannabis strain is light green in color with a frosty hue. It has a large amount of trichromes and a THC content up to 25%. Capable of sending users into deep indica medicated state, the high can be almost immediate and long lasting. Flowering time is approximately 8-10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/kryptonite_100x100_4a11.jpg','https://leafly.blob.core.windows.net/reviews/kryptonite_100x100_26c7.jpg','https://leafly.blob.core.windows.net/reviews/kryptonite_100x100_7af4.jpg','https://leafly.blob.core.windows.net/reviews/kryptonite_100x100_ccd9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362091/b/kryptonite__primary_39ff.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360075/b/kryptonite__primary_a311.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358304/b/kryptonite__primary_5720.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358484/b/kryptonite__primary_d322.jpg',NULL,79.1471,56.0798,50.5,42.4356,36.416,41.2465,27.0406,25.7395,22.1246,18.3165,32.6176,5.47059,4.47619,22.1246,18.3165,NULL),(224,27,'Big Bud','big-bud','Indica','Bb','<p>Developed in the USA before being brought to the Netherlands in the 1980s&nbsp;to survive the War on Drugs, Big Bud is a legend&nbsp;among growers for its high yields in the garden. Preserved to this day by Dutch breeder Sensi Seeds, this <a href=\"http://leafly.com/indica\">indica</a>&nbsp;produces massive buds with very few leaves, unmatched by any other cannabis variety. With an <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> and&nbsp;<a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a> aroma, Big Bud delivers&nbsp;deeply <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a>&nbsp;full-body effects true to its&nbsp;indica lineage.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/big-bud_100x100_82f8.jpg','https://leafly.blob.core.windows.net/reviews/big-bud_100x100_33f7.jpg','https://leafly.blob.core.windows.net/reviews/big-bud_100x100_754a.jpg','https://leafly.blob.core.windows.net/reviews/big-bud_100x100_ff06.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353323/b/big-bud__primary_2d3b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347384/b/big-bud__primary_df88.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339672/b/big-bud__primary_3c74.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/307178/b/big-bud__primary_5ec1.jpg',NULL,57.2833,38.65,37.3556,35.7667,28.9694,27.5611,25.1611,22.6889,22.1917,20.7611,27.5917,12.1111,8.35556,22.1917,20.7611,NULL),(225,2170,'Vortex','vortex','Sativa','Vor','<p><span style=\"line-height: 1.6em;\">Vortex by TGA Genetics is a 80/20 </span><a href=\"http://leafly.com/sativa\" style=\"line-height: 1.6em;\">sativa</a><span style=\"line-height: 1.6em;\">-dominant strain whose potency will pull you into&nbsp;a whirling mass of </span><a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\" style=\"line-height: 1.6em;\">euphoria</a><span style=\"line-height: 1.6em;\"> like a cosmic riptide. Its celestial parents </span><a href=\"http://www.leafly.com/hybrid/space-queen\" style=\"line-height: 1.6em;\">Space Queen</a><span style=\"line-height: 1.6em;\"> and </span><a href=\"http://www.leafly.com/hybrid/apollo-13\" style=\"line-height: 1.6em;\">Apollo 13</a><span style=\"line-height: 1.6em;\"> pass on a </span><a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\" style=\"line-height: 1.6em;\">sweet</a><span style=\"line-height: 1.6em;\"> and sour </span><a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\" style=\"line-height: 1.6em;\">lemon</a><span style=\"line-height: 1.6em;\"> aroma accented by notes of </span><a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\" style=\"line-height: 1.6em;\">tropical</a><span style=\"line-height: 1.6em;\"> </span><a href=\"http://www.leafly.com/explore#!/explore/flavors-mango\" style=\"line-height: 1.6em;\">mango</a><span style=\"line-height: 1.6em;\">, while its inherited effects can range from&nbsp;racy and </span><a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\" style=\"line-height: 1.6em;\">energetic</a><span style=\"line-height: 1.6em;\"> to&nbsp;heavy and disorienting. The staggering THC content of Vortex has won this sativa several awards including&nbsp;</span><em style=\"line-height: 1.6em;\">High Times&#39;&nbsp;</em><span style=\"line-height: 1.6em;\">Best Sativa in 2010 and the&nbsp;</span><em style=\"line-height: 1.6em;\">High Times&nbsp;</em><span style=\"line-height: 1.6em;\">&quot;Top 10&quot; in 2007.&nbsp;</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/vortex_100x100_e249.jpg','https://leafly.blob.core.windows.net/reviews/vortex_100x100_b909.jpg','https://leafly.blob.core.windows.net/reviews/vortex_100x100_31f4.jpg','https://leafly.blob.core.windows.net/reviews/vortex_100x100_c606.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347310/b/vortex__primary_6e71.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/319029/b/vortex__primary_7042.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311501/b/vortex__primary_4974.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309810/b/vortex__primary_51bd.jpg',NULL,79.6002,67.3148,66.2602,60.9014,50.461,49.5882,35.6438,26.0588,21.8716,18.6275,27.9072,12.0971,9.80908,21.8716,18.6275,NULL),(226,333,'Power Plant','power-plant','Sativa','Pwp','<p>Power Plant comes from Dutch Passion Seed Company and is derived from powerful South African sativa strains. Thanks to this, these plants have a fast growing time compared to most sativas and will produce either many medium-sized flowers or a few very large buds with smaller &ldquo;popcorn&rdquo; buds&nbsp;between 7 and 9 weeks. These plants are troopers and will do well in almost any grow environment, but its woody, earthy scent is pungent,&nbsp;so indoor growers will have to prepare. Power Plant has a sharp, peppery taste. While many sativas are good choices for a clear-headed buzz, this plant&rsquo;s high THC content makes it powerful. It makes some users happy and creative, though effects may verge on too intoxicating&nbsp;for some.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/power-plant_100x100_7759.jpg','https://leafly.blob.core.windows.net/reviews/power-plant_100x100_e087.jpg','https://leafly.blob.core.windows.net/reviews/power-plant_100x100_a5a9.jpg','https://leafly.blob.core.windows.net/reviews/power-plant_100x100_9673.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350892/b/power-plant__primary_996c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336075/b/power-plant__primary_8675.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/332725/b/power-plant__primary_3376.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323340/b/power-plant__primary_c3c9.jpg',NULL,63.8698,53.2344,51.4053,43.0938,37.1801,31.5097,24.2755,21.6235,11.0428,9.66481,26.7525,12.7433,8.62314,11.0428,9.66481,NULL),(227,14278,'Purple OG Kush','purple-og-kush','Indica','Pok','<p>Have some snacks ready before testing out this extremely potent indica. Providing users with both an intense head and body heavy sensation, Purple OG Kush is one of the more popular medical strains. With a thick aroma of musty berries and pine, the smell and taste of this strain are as strong as the effects themselves. Purple OG Kush may cause you to feel sleepy, cloudy, and unfocused, making this strain perfect for nighttime use. Both new and experienced users should use this strain cautiously, as a little goes a very long way.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-og-kush_100x100_49d0.jpg','https://leafly.blob.core.windows.net/reviews/purple-og-kush_100x100_f1dd.jpg','https://leafly.blob.core.windows.net/reviews/purple-og-kush_100x100_ccf0.jpg','https://leafly.blob.core.windows.net/reviews/purple-og-kush_100x100_61b4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363493/b/purple-og-kush__primary_6fab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350733/b/purple-og-kush__primary_5555.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342252/b/purple-og-kush__primary_4b50.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/334837/b/purple-og-kush__primary_8a2b.jpg',NULL,67.7751,60.8862,60.0273,48.0721,36.3956,37.2529,34.4709,32.7367,22.4652,16.5416,33.5543,12.1946,10.9884,22.4652,16.5416,NULL),(228,169,'Chemdawg 4','chemdawg-4','Hybrid','Cd4','<p class=\"p1\">Part of the prominent line of&nbsp;<a href=\"http://www.leafly.com/hybrid/chemdawg\"><span class=\"s1\">Chemdawg</span></a>&nbsp;strains, Chemdawg 4 is unlike its counterparts as it is <a href=\"http://www.leafly.com/indica/\">indica</a>-dominant. Known to affect users with a head sensation within the first five minutes, the effects can often be full-body.&nbsp;Its smell has been likened to <a href=\"http://www.leafly.com/explore/flavors-citrus\">citrus</a> or even <a href=\"http://www.leafly.com/explore/flavors-pine\">Pine-Sol</a>, with a <a href=\"http://www.leafly.com/explore/flavors-lemon\">lemon</a> flavor.&nbsp;With light-green buds, Chemdawg 4 grows to be a fairly tall plant, reaching up to 7 feet outdoors and 4-5 feet indoors, and its&nbsp;flowering time is 9-10 weeks. It often appears to have a large amount of crystals, with orange hairs growing from the buds.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/chemdawg-4/primary?width=200','https://leafly.blob.core.windows.net/reviews/chemdawg-4_100x100_ab17.jpg','https://leafly.blob.core.windows.net/reviews/chemdawg-4_100x100_5ab4.jpg','https://leafly.blob.core.windows.net/reviews/chemdawg-4_100x100_47b5.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/chemdawg-4/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/310895/b/chemdawg-4__primary_a9a9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/267819/b/chemdawg-4__primary_8256.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/248747/b/chemdawg-4__primary_5f10.jpg','https://leafly.s3.amazonaws.com/strains/testing/AysscJldTViueXuCmBrJ_chemdawg-4.png',77.6303,67.5036,58.8714,41.8699,38.4505,54.89,54.1487,43.1133,26.889,22.5849,33.6203,12.5777,9.63654,26.889,22.5849,NULL),(229,571,'Red Dragon','red-dragon','Hybrid','Red','<p class=\"p1\">Red Dragon is one exotic flower. A Barney&rsquo;s Farm cross between a West Himalayan Kush and Utopia Haze (a Brazilian sativa), this hybrid is a strain for connoisseurs. Featuring a sweet, fruity aroma, Red Dragon offers consumers a truly different cannabis experience. Slightly sativa-dominant, this strain is giggly and upbeat. Great for those suffering from depression or stress, Red Dragon has a very happy and uplifting effect. Unfortunately, this strain may cause some to feel quite paranoid. If you&rsquo;re prone to anxiety, Red Dragon may not be the best strain for you. This hybrid grows best indoors and has a flowering time of 8-10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/red-dragon_100x100_15b1.jpg','https://leafly.blob.core.windows.net/reviews/red-dragon_100x100_3935.jpg','https://leafly.blob.core.windows.net/reviews/red-dragon_100x100_4f6f.jpg','https://leafly.blob.core.windows.net/reviews/red-dragon_100x100_36d9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355811/b/red-dragon__primary_fcb4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350607/b/red-dragon__primary_9f10.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/328050/b/red-dragon__primary_74fc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311053/b/red-dragon__primary_0261.jpg',NULL,57.6565,52.9424,42.1605,40.903,40.7803,29.6344,25.1697,23.2691,19.1612,11.7869,16.9182,8.26483,7.45512,19.1612,11.7869,NULL),(230,1000,'Ice','ice','Hybrid','Ice','<p>Winner of the High Times Cannabis Cup in 1998, Ice is a 50/50 hybrid that provides a powerful and heavy stone that may leave you lazy for hours.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ice_100x100_cbd7.jpg','https://leafly.blob.core.windows.net/reviews/ice_100x100_d087.jpg','https://leafly.blob.core.windows.net/reviews/ice_100x100_d0f2.jpg','https://leafly.blob.core.windows.net/reviews/ice_100x100_4414.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364621/b/ice__primary_1ef4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364620/b/ice__primary_a30c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348470/b/ice__primary_b4d9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347483/b/ice__primary_502a.jpg',NULL,78.7815,63.6632,54.6997,54.1472,47.7202,37.5661,34.7884,26.634,22.051,17.756,37.0604,13.6321,13.173,22.051,17.756,NULL),(232,85359,'Critical Kush','critical-kush','Indica','Cri','<p>Critical Kush from Barney&rsquo;s Farm is a mostly <a href=\"http://leafly.com/indica\">indica</a> strain that blends together two famed cannabis staples, <a href=\"http://www.leafly.com/indica/critical-mass\">Critical Mass</a> and <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>. Aromatic notes of <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthiness</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spice</a> usher in a calming sensation that <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxes</a> the mind and body. Critical Kush pairs a staggeringly high THC content with a moderate dose of <a href=\"http://www.leafly.com/news/lifestyle/whats-the-deal-with-these-high-cbd-strains\">CBD</a>, making this strain a perfect nighttime medication for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">pain</a>, <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>, insomnia, and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-muscle-spasms\">muscle spasms</a>. Growers cultivating this strain indoors will wait 50 to 60 days for Critical Kush to complete its flowering cycle.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/critical-kush_100x100_77cb.jpg','https://leafly.blob.core.windows.net/reviews/critical-kush_100x100_70e2.jpg','https://leafly.blob.core.windows.net/reviews/critical-kush_100x100_7648.jpg','https://leafly.blob.core.windows.net/reviews/critical-kush_100x100_e390.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362489/b/critical-kush__primary_4172.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361610/b/critical-kush__primary_8f43.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360784/b/critical-kush__primary_1a98.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355067/b/critical-kush__primary_cdb1.jpg',NULL,92.5418,68.2618,59.855,59.4697,44.7606,50.3739,47.2489,42.6561,36.7522,31.072,43.1786,15.2985,15.1842,36.7522,31.072,NULL),(233,65424,'Candyland','candyland','Sativa','Cld','<p class=\"p1\">Candyland, a gold medalist of the 2012 KushCon, is a sativa-dominant hybrid bred from <a href=\"http://www.leafly.com/indica/granddaddy-purple\"><span class=\"s1\">Granddaddy Purple</span></a> and Bay <a href=\"http://www.leafly.com/hybrid/platinum-girl-scout-cookies\"><span class=\"s1\">Platinum Cookies</span></a>. Golden hairs weave through Candyland&rsquo;s thick coat of sugar-like trichomes and highlight the compact, camouflage-colored buds. This strain grows well indoors and out, and patients turn to Candyland to relieve pain, muscle tension, and sour moods. Strong sativa genetics give Candyland uplifting and stimulating effects, making it a perfect strain for social gatherings or creative pastimes.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/candyland_100x100_a952.jpg','https://leafly.blob.core.windows.net/reviews/candyland_100x100_4dd6.jpg','https://leafly.blob.core.windows.net/reviews/candyland_100x100_e72b.jpg','https://leafly.blob.core.windows.net/reviews/candyland_100x100_e8d2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363796/b/candyland__primary_f53b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363608/b/candyland__primary_6804.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357230/b/candyland__primary_df28.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356984/b/candyland__primary_8b09.jpg',NULL,82.9791,68.8684,68.5253,67.8268,53.4065,53.1784,38.6981,25.8164,23.1354,18.9086,29.983,12.3705,11.3553,23.1354,18.9086,NULL),(234,3361,'California Orange','california-orange','Hybrid','Cal','<p>California Orange has a pronounced citrus aroma and flavor. &nbsp;A 50/50 hybrid that produces very sticky and dense buds.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/california-orange_100x100_27a7.jpg','https://leafly.blob.core.windows.net/reviews/california-orange_100x100_d44e.jpg','https://leafly.blob.core.windows.net/reviews/california-orange_100x100_0db0.jpg','https://leafly.blob.core.windows.net/reviews/california-orange_100x100_446e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344672/b/california-orange__primary_252c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339313/b/california-orange__primary_d813.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338520/b/california-orange__primary_1f54.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/324823/b/california-orange__primary_9256.jpg',NULL,66.1334,46.2175,45.5675,45.1208,43.6644,33.9549,20.4521,14.0003,13.5536,11.3183,30.3883,8.621,8.40567,13.5536,11.3183,NULL),(235,89682,'Khalifa Kush','khalifa-kush','Hybrid','Kk','<p>Khalifa Kush, or Wiz Khalifa OG, &nbsp;is a <a href=\"http://leafly.com/hybrid\">hybrid</a> that was bred specifically for the rap artist Wiz Khalifa, who claims it descended from an OG strain. The &lsquo;real&rsquo; Khalifa Kush is supposedly unavailable to the public, but those who have acquired strains under this name say that the effects and aromas are similar to that of <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>: sour <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a>, with an <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">active</a> cerebral buzz ideal for morning and daytime use.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.6/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/khalifa-kush_100x100_9360.jpg','https://leafly.blob.core.windows.net/reviews/khalifa-kush_100x100_4390.jpg','https://leafly.blob.core.windows.net/reviews/khalifa-kush_100x100_3987.jpg','https://leafly.blob.core.windows.net/reviews/khalifa-kush_100x100_bd5f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364469/b/khalifa-kush__primary_3b46.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363524/b/khalifa-kush__primary_a7bd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363117/b/khalifa-kush__primary_dfa7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355702/b/khalifa-kush__primary_648c.jpg',NULL,62.4445,54.8563,54.5569,41.9919,27.2115,21.5421,20.0365,16.0851,14.8636,13.4738,21.4933,12.0198,9.27456,14.8636,13.4738,NULL),(236,4425,'Blueberry Diesel','blueberry-diesel','Hybrid','Bbd','<p>Blueberry Diesel is a cross of two favorite strains, <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> and <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>. It is probably best known for its strong blueberry smell with hints of fuel from its Diesel lineage. Blueberry also overwhelms the flavor of these sticky flowers, which should have plenty of trichomes and long orange hairs. Effects tend to be happy and relaxing but not too overwhelming, making this a popular choice for many kinds of patients.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blueberry-diesel_100x100_84ed.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-diesel_100x100_4846.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-diesel_100x100_19ac.jpg','https://leafly.blob.core.windows.net/reviews/blueberry-diesel_100x100_5252.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363472/b/blueberry-diesel__primary_6f6e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/360908/b/blueberry-diesel__primary_75bb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354863/b/blueberry-diesel__primary_146e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352268/b/blueberry-diesel__primary_3a71.jpg',NULL,85.101,75.094,59.9356,45.5381,40.6914,50.2299,44.0282,39.3312,35.9735,35.4754,30.6914,15.007,14.3103,35.9735,35.4754,NULL),(238,5773,'True OG','true-og','Indica','Tru','<p>True OG is a popular indica strain that was originally discovered in Southern California, where the term &ldquo;OG&rdquo; originally meant &ldquo;ocean grown.&rdquo; Bred with genetics from the very popular <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>, True OG is potent enough for mellow, lasting effects combined with a more focused head high. Flowers have a pungent, crisp citrus and evergreen scent. True OG has snagged the 2nd place indica spot in every High Times Medical Cup since 2010.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/true-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/true-og_100x100_7ca8.jpg','https://leafly.blob.core.windows.net/reviews/true-og_100x100_cee4.jpg','https://leafly.blob.core.windows.net/reviews/true-og_100x100_40d4.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/true-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363953/b/true-og__primary_8890.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362859/b/true-og__primary_99f6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350604/b/true-og__primary_6e9a.jpg',NULL,64.2616,59.8268,49.398,41.1412,36.765,42.9807,23.618,22.0566,21.9093,16.4472,25.2138,11.7043,10.3966,21.9093,16.4472,NULL),(239,13536,'Ace of Spades','ace-of-spades','Indica','Ace','<p>Ace of Spades is a creation from TGA Subcool Seeds that takes advantage of the popular sweet and sour combination that never goes out of style. A crossbreed of <a href=\"http://www.leafly.com/indica/black-cherry-soda\">Black Cherry Soda</a> and <a href=\"http://www.leafly.com/hybrid/jack-the-ripper\">Jack the Ripper</a>, this strain has an earthy berry and citrus smell that carries over into the taste with distinctly lemony flavors. Ace of Spades plants grow fast and need a lot of space because they will get both bushy and tall. Flowering occurs at 8 weeks and they are generally large and heavy. These buds are pretty to look at with a range of colors that can include purples, blues, and pinks all coated in orange hairs.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ace-of-spades_100x100_cdff.jpg','https://leafly.blob.core.windows.net/reviews/ace-of-spades_100x100_1d79.jpg','https://leafly.blob.core.windows.net/reviews/ace-of-spades_100x100_eff8.jpg','https://leafly.blob.core.windows.net/reviews/ace-of-spades_100x100_3ff0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353359/b/ace-of-spades__primary_7cdb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338540/b/ace-of-spades__primary_6eab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325073/b/ace-of-spades__primary_04d5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/322090/b/ace-of-spades__primary_ac04.jpg',NULL,63.0258,55.3075,45.2679,42.6488,38.0556,43.1845,32.1825,23.9286,19.9504,13.3532,27.4802,21.3095,12.0437,19.9504,13.3532,NULL),(240,58160,'Ghost OG','ghost-og','Hybrid','Gok','<p>Ghost OG, a&nbsp;phenotype of OG Kush, is loved for its balanced cerebral and body effects. Often described as simultaneously potent and non-intrusive, Ghost OG has won itself Cup awards and renown among consumers. Its strong citrus smell and crystal-covered buds hint at this strain&rsquo;s strong genetics and its ability to annihilate pain, insomnia, depression, and anxiety. Though originating in the Afghanistan-Pakistan mountains, it is rumored that Ghost OG comes from the Florida mother plant Triangle Kush.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ghost-og_100x100_75a7.jpg','https://leafly.blob.core.windows.net/reviews/ghost-og_100x100_a08f.jpg','https://leafly.blob.core.windows.net/reviews/ghost-og_100x100_ef3c.jpg','https://leafly.blob.core.windows.net/reviews/ghost-og_100x100_63ff.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353998/b/ghost-og__primary_0e86.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342324/b/ghost-og__primary_3dea.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335392/b/ghost-og__primary_f649.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/332079/b/ghost-og__primary_db5c.jpg',NULL,89.2647,63.3701,48.4436,47.4142,40.3554,40.8578,38.9828,34.4853,33.1005,23.223,30.2696,14.7181,11.924,33.1005,23.223,NULL),(241,153,'A-10','a-10','Indica','A10','<p>A-10 has an earthy, hashy taste that provides a very heavy body stone. &nbsp;Frequently used to treat insomnia and chronic pain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/a-10_100x100_8019.jpg','https://leafly.blob.core.windows.net/reviews/a-10_100x100_e59b.jpg','https://leafly.blob.core.windows.net/reviews/a-10_100x100_0de4.jpg','https://leafly.blob.core.windows.net/reviews/a-10_100x100_4488.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356460/b/a-10__primary_493d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/321880/b/a-10__primary_88d4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/88654/b/a-10_825x550_77aa.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/83658/b/a-10_825x550_9845.jpg',NULL,23.7597,22.1318,20.3876,16.6667,6.16279,23.7597,16.6667,6.86047,4.88372,2.7907,6.86047,3.60465,0.930233,4.88372,2.7907,NULL),(242,65524,'Blackwater','blackwater','Indica','Bwr','<p class=\"p1\">Blackwater is an indica strain typically bred from <a href=\"http://www.leafly.com/hybrid/mendocino-purps\">Mendo Purps</a> and <a href=\"http://www.leafly.com/hybrid/sfv-og\">San Fernando Valley OG Kush</a>. Its round, compact buds take on a deep purple color and a sweet grape aroma that blends with subtle undertones of lemon and pine. What begins as a mellow and euphoric cerebral experience melts down to the rest of the body in a head-to-toe euphoric calm that relieves stress and anxiety. Patients have also reported its success in treating pain, appetite loss, and multiple sclerosis. This strain is recommended for late-night consumption as it can cause mental cloudiness and detract from productivity. Blackwater has a flowering time of 8 to 10 weeks and produces moderate yields in indoor, outdoor, and greenhouse gardens. The 2014 Los Angeles Cannabis Cup awarded Blackwater 3rd place in the indica category.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/blackwater_100x100_f409.jpg','https://leafly.blob.core.windows.net/reviews/blackwater_100x100_ecd6.jpg','https://leafly.blob.core.windows.net/reviews/blackwater_100x100_1afc.jpg','https://leafly.blob.core.windows.net/reviews/blackwater_100x100_bab7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364846/b/blackwater__primary_f4fb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364842/b/blackwater__primary_2b53.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363268/b/blackwater__primary_da36.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356526/b/blackwater__primary_9f95.jpg',NULL,102.844,65.0617,53.9258,53.91,46.8949,55.2447,49.5643,37.949,29.0962,28.4102,34.0668,16.7791,15.5054,29.0962,28.4102,NULL),(243,826,'Purple Sour Diesel','purple-sour-diesel','Hybrid','Psd','<p>Purple Sour Diesel is a fast-acting, heavy-hitting hybrid. A cross between a sativa, <a href=\"http://www.leafly.com/sativa/sour-diesel\" style=\"text-decoration:none;\">Sour Diesel</a>, and an indica, <a href=\"http://www.leafly.com/indica/purple-kush\" style=\"text-decoration:none;\">Purple Kush</a>, Purple Sour Diesel embodies the full force of both strains. Great for nighttime smoking, this strain has a quick onset and a distinctly medicated feel. Featuring heavy head effects and a slight body high, Purple Sour Diesel will energize your mind while leaving you physically relaxed. This strain features a sour, fruity aroma similar to sour grapes.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/purple-sour-diesel_100x100_25e0.jpg','https://leafly.blob.core.windows.net/reviews/purple-sour-diesel_100x100_56de.jpg','https://leafly.blob.core.windows.net/reviews/purple-sour-diesel_100x100_1317.jpg','https://leafly.blob.core.windows.net/reviews/purple-sour-diesel_100x100_c2c3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364914/b/purple-sour-diesel__primary_be8f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353622/b/purple-sour-diesel__primary_2ed4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353209/b/purple-sour-diesel__primary_1093.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353112/b/purple-sour-diesel__primary_6bef.jpg',NULL,65.9305,65.8589,47.8145,44.3607,41.2719,44.7494,37.9217,28.7863,27.9019,23.5204,34.4758,17.3666,14.1432,27.9019,23.5204,NULL),(244,2849,'Strawberry Diesel','strawberry-diesel','Hybrid','Swd','<p class=\"p1\">This cross between <a href=\"http://www.leafly.com/hybrid/nyc-diesel\"><span class=\"s1\">NYC Diesel</span></a> and <a href=\"http://www.leafly.com/hybrid/strawberry-cough\"><span class=\"s1\">Strawberry Cough</span></a> is a true hybrid. Providing consumers with a well-balanced experience, Strawberry Diesel relaxes your muscles while creating an energizing, clear-headed sensation. If you&rsquo;re looking for help with insomnia and would like to get things done, Strawberry Diesel may be your perfect match. Great for both daytime and nighttime use, this strain is incredibly versatile. Novice consumers should be cautious with it, however, as it is fast-acting and intense. Great for indoor growing, Strawberry Diesel tends to flower between 9 and 10 weeks. Taking after both of its parents, this strain also features a fruity scent while providing a thick, diesel-like taste.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/strawberry-diesel_100x100_9d17.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-diesel_100x100_84e1.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-diesel_100x100_4de0.jpg','https://leafly.blob.core.windows.net/reviews/strawberry-diesel_100x100_f360.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348656/b/strawberry-diesel__primary_163a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347792/b/strawberry-diesel__primary_1a9a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326224/b/strawberry-diesel__primary_6b03.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323242/b/strawberry-diesel__primary_d6c4.jpg',NULL,76.4126,60.308,44.8562,40.0859,36.8413,46.4767,32.8773,20.6655,17.2195,16.7149,28.4565,15.8139,12.3599,17.2195,16.7149,NULL),(245,978,'Black Domina','black-domina','Indica','Bdm','<p>Working with four prime examples of Cannabis <a href=\"http://www.leafly.com/hybrid/afghanica\">Afghanica</a> led Sensi Seeds to blend the world&#39;s finest <a href=\"http://leafly.com/indica\">indica</a> genetics into a rapid-flowering, crystal-coated <a href=\"http://leafly.com/hybrid\">hybrid</a>: Black Domina. Combining desirable features from the <a href=\"http://www.leafly.com/indica/northern-lights\">Northern Lights</a>, <a href=\"http://www.leafly.com/indica/ortega\">Ortega</a>, <a href=\"http://www.leafly.com/indica/hash-plant\">Hash Plant</a>, and <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> SA&nbsp;has made this strain equally suited to the needs of commercial growers, connoisseurs,&nbsp;and first-time cultivators. Black Domina delivers a <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">spicy</a>&nbsp;<a href=\"http://www.leafly.com/explore#!/explore/flavors-pepper\">pepper</a> aroma alongside overwhelming <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleepiness</a>, making this strain&nbsp;ideal for late night use.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/black-domina/primary?width=200','https://leafly.blob.core.windows.net/reviews/black-domina_100x100_f050.jpg','https://leafly.blob.core.windows.net/reviews/black-domina_100x100_e81c.jpg','https://leafly.blob.core.windows.net/reviews/black-domina_100x100_d908.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/black-domina/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/320234/b/black-domina__primary_81f2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/299915/b/black-domina__primary_5346.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/298863/b/black-domina__primary_d91c.jpg',NULL,77.6876,75.084,53.2335,50.5739,29.9412,65.8315,62.1641,61.1002,34.1405,27.2256,37.8639,20.1008,12.654,34.1405,27.2256,'Easy'),(246,127,'Mendocino Purps','mendocino-purps','Hybrid','Mp','<p>Mendocino Purps, or Mendo Purps, or even just The Purps, comes out of Mendocino County in Northern California. Winning one of the Top Ten slots in High Times&#39; Strains of the Year in 2007, Mendocino Purps began as a clone-only plant, but BC Bud Depot developed a stable cross to make The Purps seeds available. This cannabis strain&nbsp;grows well&nbsp;both in and outdoors. It can grow 3-4 feet at harvest indoors and 6-8 feet outdoors. Flowering time for this strain is 8-9 weeks.&nbsp;It has medium-thick leaves and green hues&nbsp;that turn more purple as the plant ripens. The taste has been likened to a caramel coffee and woodsy pine.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/mendocino-purps/primary?width=200','https://leafly.blob.core.windows.net/reviews/mendocino-purps_100x100_7448.jpg','https://leafly.blob.core.windows.net/reviews/mendocino-purps_100x100_1681.jpg','https://leafly.blob.core.windows.net/reviews/mendocino-purps_100x100_52ed.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/mendocino-purps/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356987/b/mendocino-purps__primary_8f5b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355009/b/mendocino-purps__primary_3857.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344494/b/mendocino-purps__primary_192d.jpg',NULL,72.6564,69.7165,43.733,43.2674,40.7303,34.7824,32.3865,28.076,26.1404,22.4472,40.5681,16.6562,13.4181,26.1404,22.4472,NULL),(247,6009,'Diamond OG','diamond-og','Indica','Dg','<p>Diamond OG is a precious gem of a strain that patients love for its potent and long-lasting effects. A true indica, this strain induces full-body relaxation that nixes pain and muscle spasms&nbsp;before settling into an overall laziness. It can leave you mentally euphoric in smaller doses, but it&rsquo;s definitely not one for times when work or even wakefulness needs to happen. Diamond OG is the result of an unknown strain crossed with <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a> and has the familiar OG aroma of citrus-pine supported by fuel undertones. These sparkling nugs will be condensed and have a strong odor; they&rsquo;re definitely a beauty to show off.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/diamond-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/diamond-og_100x100_f644.jpg','https://leafly.blob.core.windows.net/reviews/diamond-og_100x100_fbfa.jpg','https://leafly.blob.core.windows.net/reviews/diamond-og_100x100_49c3.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/diamond-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354880/b/diamond-og__primary_561b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338235/b/diamond-og__primary_768d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/337930/b/diamond-og__primary_f3bf.jpg',NULL,83.4556,78.9382,54.8263,51.4961,35.3282,40.222,37.5579,35.4151,21.5154,16.2452,26.6795,20.0869,9.16988,21.5154,16.2452,NULL),(248,281,'Querkle','querkle','Indica','Que','<p>Purple Urkle crossed with Space Queen produces this indica/sativa&nbsp;80/20 marijuana variety. Querkle has a fruity grape &amp; berry scent.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/querkle/primary?width=200','https://leafly.blob.core.windows.net/reviews/querkle_100x100_73bd.jpg','https://leafly.blob.core.windows.net/reviews/querkle_100x100_41df.jpg','https://leafly.blob.core.windows.net/reviews/querkle_100x100_35e4.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/querkle/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340113/b/querkle__primary_a5a7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339645/b/querkle__primary_6290.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/318614/b/querkle__primary_2171.jpg',NULL,62.6941,58.1893,45.1538,42.0415,35.202,47.2181,45.1028,27.0283,23.0733,22.9232,29.0233,18.481,12.433,23.0733,22.9232,NULL),(249,1841,'Shishkaberry','shishkaberry','Indica','Shi','<p>Shiskaberry, or &ldquo;Kish,&rdquo; is an indica-dominant hybrid that came about from crossing <a href=\"http://www.leafly.com/indica/dj-short-blueberry\">DJ Short Blueberry</a> with an unknown <a href=\"http://www.leafly.com/indica/afghani\">Afghani</a> strain. This plant will mature in 8 to 9 weeks and should yield a fairly high amount of flowers. Shiskaberry&rsquo;s buds have a fruit and berry aroma and will be painted with shades of purple. Its initial head buzz is happy and good for finishing things up or being social, but once its indica side kicks in, lazy is the word.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/shishkaberry_100x100_1d7f.jpg','https://leafly.blob.core.windows.net/reviews/shishkaberry_100x100_0f1b.jpg','https://leafly.blob.core.windows.net/reviews/shishkaberry_100x100_e5f1.jpg','https://leafly.blob.core.windows.net/reviews/shishkaberry_100x100_8cb6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358292/b/shishkaberry__primary_307d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/357770/b/shishkaberry__primary_eb74.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/334833/b/shishkaberry__primary_d0d7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/332719/b/shishkaberry__primary_35ca.jpg',NULL,68.98,61.163,50.9867,39.5477,34.2306,37.3714,34.2373,25.1885,23.5787,19.3592,35.7616,9.21951,7.96341,23.5787,19.3592,NULL),(250,317,'Black Widow','black-widow','Hybrid','Blw','<p>The evil sister of <a href=\"/hybrid/white-widow\">White Widow</a>, the Black Widow strain maintains the family reputation for high natural THC levels. Bred by Mr. Nice Seed Bank, Black Widow is a nice balanced hybrid marijuana strain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/black-widow_100x100_3ec0.jpg','https://leafly.blob.core.windows.net/reviews/black-widow_100x100_a58b.jpg','https://leafly.blob.core.windows.net/reviews/black-widow_100x100_555b.jpg','https://leafly.blob.core.windows.net/reviews/black-widow_100x100_7c43.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356394/b/black-widow__primary_d049.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353226/b/black-widow__primary_84ba.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353038/b/black-widow__primary_25b1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341675/b/black-widow__primary_a8bf.jpg',NULL,53.2343,47.401,45.9653,45.0825,36.3449,33.7789,33.4158,21.0809,20.7178,20.7178,17.764,11.3036,8.82838,20.7178,20.7178,NULL),(251,4214,'Cheese Quake','cheese-quake','Indica','Cq','<p>Cheese Quake by TGA Subcool Seeds is a 60/40 indica-dominant cross between&nbsp;<a href=\"http://www.leafly.com/hybrid/cheese\">Cheese</a> and <a href=\"http://www.leafly.com/indica/querkle\">Querkle</a>. &nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cheese-quake_100x100_e472.jpg','https://leafly.blob.core.windows.net/reviews/cheese-quake_100x100_27e2.jpg','https://leafly.blob.core.windows.net/reviews/cheese-quake_100x100_f201.jpg','https://leafly.blob.core.windows.net/reviews/cheese-quake_100x100_ebb9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326192/b/cheese-quake__primary_c7e3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326037/b/cheese-quake__primary_24de.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325910/b/cheese-quake__primary_6ed2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325756/b/cheese-quake__primary_cb34.jpg',NULL,70.4293,70.4141,55.0286,48.8238,28.3775,41.9347,36.0537,34.5492,28.1047,16.6673,36.3444,22.7352,13.966,28.1047,16.6673,NULL),(252,7378,'Pure Power Plant','pure-power-plant','Hybrid','Ppp','<p>If you&rsquo;re searching for a potent sativa, Pure Power Plant may be the strain for you. Featuring a musky, citrus smell, this strain is fairly pungent and skunk-like. Great for daytime, Pure Power Plant produces a clear-headed sensation while causing a pleasant, gentle pressure in the face and head. As this strain is not a pure sativa, however, some indica effects shine through, especially after heavy use. Too much Pure Power Plant may put you to sleep or leave you stuck on the couch. This strain is easy to grow both indoors and outdoors. Known for its high yields, PPP typically flowers in 8-10 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pure-power-plant_100x100_a3d9.jpg','https://leafly.blob.core.windows.net/reviews/pure-power-plant_100x100_c0eb.jpg','https://leafly.blob.core.windows.net/reviews/pure-power-plant_100x100_fe34.jpg','https://leafly.blob.core.windows.net/reviews/pure-power-plant_100x100_e6be.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358860/b/pure-power-plant__primary_a714.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356400/b/pure-power-plant__primary_0c48.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349680/b/pure-power-plant__primary_e7f7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/337355/b/pure-power-plant__primary_c088.jpg',NULL,53.6364,45.3788,44.5707,42.2475,42.197,41.4394,23.8131,18.9646,10.8838,8.63636,25.1768,13.1566,6.9697,10.8838,8.63636,NULL),(253,400,'Diablo','diablo','Indica','Dia','<p>With lineage from <a href=\"http://www.leafly.com/sativa/grapefruit\">Grapefruit</a>, <a href=\"http://www.leafly.com/hybrid/blueberry\">Blueberry</a> and South African Sativa, there is a sweet flavor to the Diablo cannabis strain. This indica&nbsp;has a purple hue,&nbsp;fruity and&nbsp;spicy flavors, and&nbsp;a&nbsp;THC content that tends to fall&nbsp;between&nbsp;15-20%. Diablo&nbsp;has&nbsp;an indoor&nbsp;flowering time of 6-7 weeks&nbsp;and took&nbsp;second place at the 2002&nbsp;BC Harvest Cup in the outdoor category.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/diablo_100x100_6f5e.jpg','https://leafly.blob.core.windows.net/reviews/diablo_100x100_e315.jpg','https://leafly.blob.core.windows.net/reviews/diablo_100x100_c7b3.jpg','https://leafly.blob.core.windows.net/reviews/diablo_100x100_b011.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363313/b/diablo__primary_7b99.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363278/b/diablo__primary_363a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344731/b/diablo__primary_7033.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343536/b/diablo__primary_1ec1.jpg',NULL,85.9244,76.9152,51.6905,33.0235,31.8744,54.2033,31.5679,28.6415,21.6062,18.9709,36.9433,21.2436,20.1073,21.6062,18.9709,NULL),(254,166,'Dream Queen','dream-queen','Hybrid','Dq','<p>With a THC level up to 15% and CBD of 0.49%, Dream Queen takes on the best of her parents, Blue Dream and Space Queen. With an aroma of bubblegum and slight hints of mango and pineapple, Dream Queen will provide a good cerebral high.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/dream-queen_100x100_b1e9.jpg','https://leafly.blob.core.windows.net/reviews/dream-queen_100x100_299f.jpg','https://leafly.blob.core.windows.net/reviews/dream-queen_100x100_650f.jpg','https://leafly.blob.core.windows.net/reviews/dream-queen_100x100_34f9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352718/b/dream-queen__primary_8f4f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352459/b/dream-queen__primary_0539.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347276/b/dream-queen__primary_74f9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345104/b/dream-queen__primary_0a43.jpg',NULL,85.2924,83.4755,65.3668,59.7156,49.7807,61.0845,54.8644,41.038,36.1749,31.5883,34.7581,20.6021,20.2552,36.1749,31.5883,NULL),(255,60913,'Jean Guy','jean-guy','Hybrid','Jg','<p>Jean Guy, said to be a <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-genotypes-and-phenotypes-what-makes-a-strain-unique\">phenotype</a> of <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a>,&nbsp;is a <a href=\"http://www.leafly.com/sativa\">sativa</a>-dominant hybrid&nbsp;from Canada with intensely cerebral effects and a sour <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a> smell. Frosted dark green leaves hide pastel buds loaded with golden crystal <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabis-anatomy-the-parts-of-the-plant\">trichomes</a>. Hints of <a href=\"http://www.leafly.com/explore#!/explore/flavors-lemon\">lemon</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> come through in Jean Guy&rsquo;s flavor, providing a gentle launch into jolting sativa effects. Its <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energizing</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> qualities makes Jean Guy a perfect strain to start the day with, although scattered and distracting thoughts may interfere with productivity. Jean Guy is a reputable source of relief for <a href=\"http://www.leafly.com/explore#!/explore/conditions-fibromyalgia\">fibromyalgia</a> and <a href=\"http://www.leafly.com/explore#!/explore/conditions-cancer\">cancer</a> symptoms, but patients prone to <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a> may want to dose with caution due to its typically high <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/cannabinoids-101-what-makes-cannabis-medicine\">THC</a> content.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/jean-guy/primary?width=200','https://leafly.blob.core.windows.net/reviews/jean-guy_100x100_58d7.jpg','https://leafly.blob.core.windows.net/reviews/jean-guy_100x100_2407.jpg','https://leafly.blob.core.windows.net/reviews/jean-guy_100x100_03df.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/jean-guy/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351118/b/jean-guy__primary_57c6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347291/b/jean-guy__primary_25c1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/312301/b/jean-guy__primary_3904.jpg',NULL,66.0817,65.2644,52.2596,48.1216,45.1614,38.9114,28.1387,24.7596,21.8441,16.59,27.081,16.59,16.2775,21.8441,16.59,NULL),(256,40175,'Presidential OG','presidential-og','Indica','Prs','<p>Presidential OG by Royal Queen Seeds is an <a href=\"http://leafly.com/indica\">indica</a> cross between <a href=\"http://www.leafly.com/hybrid/bubble-gum\">Bubble Gum</a> and <a href=\"http://leafly.com/hybrid/og-kush\">OG Kush</a>&nbsp;that&nbsp;definitely knows how to get your attention with its intense <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus\">citrus</a>-<a href=\"http://www.leafly.com/explore#!/explore/flavors-pine\">pine</a> smell. As far as taste goes,&nbsp;it maintains the pine flavor and heads into more <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> terrain. Almost purely indica, this strain hits hard and fast with a <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sedative</a>&nbsp;effect that make this a popular choice for those dealing with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">insomnia</a> or <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress</a>.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/presidential-og_100x100_c18e.jpg','https://leafly.blob.core.windows.net/reviews/presidential-og_100x100_274d.jpg','https://leafly.blob.core.windows.net/reviews/presidential-og_100x100_1d02.jpg','https://leafly.blob.core.windows.net/reviews/presidential-og_100x100_85b6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364786/b/presidential-og__primary_722f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364973/b/presidential-og__primary_7c7d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363469/b/presidential-og__primary_173f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336661/b/presidential-og__primary_d85d.jpg',NULL,87.8958,75.5417,57.8958,42.125,40.4792,56.6458,53.5417,45.5833,21.5,21.125,33.7292,16.2292,13.875,21.5,21.125,NULL),(257,46961,'Tangie','tangie','Sativa','Tg','<p>Tangie is another fantastic offering from DNA Genetics in Amsterdam that has quickly gained popularity in its home and is spreading elsewhere. This strain is a remake of sorts of the popular version of <a href=\"http://www.leafly.com/hybrid/tangerine-dream\">Tangerine Dream</a> that was sought-after in the 1990s. The genetics on this strain are a cross of <a href=\"http://www.leafly.com/hybrid/california-orange\">California Orange</a> and a <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk</a> hybrid, and its citrus heritage is the most evident in its refreshing tangerine aroma. As a plant, Tangie grows best outside, producing sticky buds that provide euphoric yet relaxed effects.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/tangie_100x100_6b56.jpg','https://leafly.blob.core.windows.net/reviews/tangie_100x100_f891.jpg','https://leafly.blob.core.windows.net/reviews/tangie_100x100_789a.jpg','https://leafly.blob.core.windows.net/reviews/tangie_100x100_2b09.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353378/b/tangie__primary_9fe4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350326/b/tangie__primary_0b4b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347883/b/tangie__primary_902b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344651/b/tangie__primary_4fdc.jpg',NULL,71.0785,70.7218,65.9584,65.4317,58.8691,39.7182,27.2533,16.5149,16.4358,13.9736,21.805,11.8306,8.10891,16.4358,13.9736,NULL),(258,48,'Jack Flash','jack-flash','Hybrid','Jal','<p>To create Jack Flash, Sensi Seeds started out with their <a href=\"http://www.leafly.com/sativa/jack-herer\">Jack Herer</a>&#39;s gene&nbsp;pool and then crossed it with <a href=\"http://www.leafly.com/indica/super-skunk\">Super Skunk</a> and <a href=\"http://leafly.com/sativa/haze\">Haze</a>. Jack Flash offers an earthy citrus aroma, impressive yields, and the active cerebral legacy of her Jack Herer parent. This <a href=\"http://leafly.com/hybrid\">hybrid</a> gets its name from its&nbsp;lightning-fast onset which may prove useful to patients needing immediate symptom relief.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/jack-flash/primary?width=200','https://leafly.blob.core.windows.net/reviews/jack-flash_100x100_739b.jpg','https://leafly.blob.core.windows.net/reviews/jack-flash_100x100_420a.jpg','https://leafly.blob.core.windows.net/reviews/jack-flash_100x100_0af5.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/jack-flash/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352973/b/jack-flash__primary_ae26.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351346/b/jack-flash__primary_2492.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341458/b/jack-flash__primary_b599.jpg',NULL,70.4696,60.1798,57.5676,48.555,46.8973,44.5808,28.7247,25.4879,25.015,14.5467,28.0862,4.98039,4,25.015,14.5467,NULL),(259,3110,'Banana OG','banana-og','Hybrid','Bng','<p>Banana OG is a cross between OG Kush and the Banana cannabis strain.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/banana-og_100x100_63bd.jpg','https://leafly.blob.core.windows.net/reviews/banana-og_100x100_e6cb.jpg','https://leafly.blob.core.windows.net/reviews/banana-og_100x100_ad44.jpg','https://leafly.blob.core.windows.net/reviews/banana-og_100x100_2ac7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363600/b/banana-og__primary_5977.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351180/b/banana-og__primary_0b83.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347289/b/banana-og__primary_21e6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345006/b/banana-og__primary_6af4.jpg',NULL,62.2979,57.1491,45.3678,42.3827,31.0021,40.6241,33.2316,23.3902,20.1533,19.9765,16.334,11.2451,10.2563,20.1533,19.9765,NULL),(260,17395,'The White','the-white','Hybrid','Twt','<p>A mostly-indica hybrid with 60 day flowering times, The White strain is a 2009 IC420 cup winner. &nbsp;Named for the color of the buds when ripe, she is not related to <a href=\"http://www.leafly.com/hybrid/white-widow\">White Widow</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/the-white/primary?width=200','https://leafly.blob.core.windows.net/reviews/the-white_100x100_f5b8.jpg','https://leafly.blob.core.windows.net/reviews/the-white_100x100_e165.jpg','https://leafly.blob.core.windows.net/reviews/the-white_100x100_dbfc.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/the-white/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352947/b/the-white__primary_2ada.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344637/b/the-white__primary_5bf1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343535/b/the-white__primary_1d65.jpg','https://leafly.s3.amazonaws.com/strains/testing/R8VabtoTpukaNCAMedQg_the-white.png',75.9335,56.6615,54.0044,48.5158,40.6921,47.4361,33.3871,31.3541,30.3074,20.1054,33.0913,12.1525,12.1525,30.3074,20.1054,NULL),(261,646,'Fucking Incredible','fucking-incredible','Indica','Fck','<p>Fucking Incredible is a pure indica strain and was created by combining the genetics of two magnificent indicas back in 1990. Seven generations of stabilization breeding gave us the present day version.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/fucking-incredible/primary?width=200','https://leafly.blob.core.windows.net/reviews/fucking-incredible_100x100_96e8.jpg','https://leafly.blob.core.windows.net/reviews/fucking-incredible_100x100_0157.jpg','https://leafly.blob.core.windows.net/reviews/fucking-incredible_100x100_85c8.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/fucking-incredible/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/334828/b/fucking-incredible__primary_774e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/334827/b/fucking-incredible__primary_b83c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311948/b/fucking-incredible__primary_2b35.jpg',NULL,69.7411,51.1878,36.7518,18.7476,18.7354,52.1813,44.2188,25.8915,20.9653,20.9435,27.0841,24.5895,22.5782,20.9653,20.9435,NULL),(262,401,'Orange Bud','orange-bud','Hybrid','Orb','<p>First bred in 1980s by Dutch Passion, Orange Bud cannabis strain is a combination of two members of the 100% <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a> family. It is one of the more potent and most simplistic strains to cultivate, with buds that are dense with a large amount THC crystals. With bright orange hairs coating the surface, this strain has scents of orange and nectarines with a flowering time of 8-9 weeks. Orange Bud&#39;s THC content has been measured up to 16.5% and grows well both indoors and out.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/orange-bud_100x100_b028.jpg','https://leafly.blob.core.windows.net/reviews/orange-bud_100x100_3ab4.jpg','https://leafly.blob.core.windows.net/reviews/orange-bud_100x100_bf7c.jpg','https://leafly.blob.core.windows.net/reviews/orange-bud_100x100_153d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363084/b/orange-bud__primary_85da.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341771/b/orange-bud__primary_348d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/338124/b/orange-bud__primary_4ced.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330164/b/orange-bud__primary_7a58.jpg',NULL,81.8651,50.7738,49.9008,47.7183,47.5198,37.0833,24.623,19.3849,11.9246,11.5873,24.623,5.79365,5.55556,11.9246,11.5873,NULL),(263,959,'Nebula','nebula','Hybrid','Neb','<p>The Nebula marijuana strain was bred by Paradise Seeds in 1996. Its name means &quot;Starcloud&quot; and it has been known to &quot;twinkle&quot; with THC coating, with a head and body buzz described as intense and almost psychedelic. The buds have been known to smell and taste like honey, and flowering time is a minimum of 9 weeks. Nebula has won many awards, including 3rd place in the sativa category at the High Times Cannabis Cup in 1999 and 2nd place in 2005. It also took 3rd place at the Highlife Cup in 2004 in the Hydro category, and 1st place at the Copa La Bella Flor Spain in 2005.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/nebula_100x100_a9bf.jpg','https://leafly.blob.core.windows.net/reviews/nebula_100x100_3082.jpg','https://leafly.blob.core.windows.net/reviews/nebula_100x100_0869.jpg','https://leafly.blob.core.windows.net/reviews/nebula_100x100_d4c9.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350317/b/nebula__primary_844a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/309752/b/nebula__primary_0e20.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/287084/b/nebula__primary_979e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/283501/b/nebula__primary_96ad.jpg',NULL,71.4588,66.5555,58.6228,55.839,46.6682,44.5151,31.2784,15.5888,14.5833,10.0781,28.0888,10.0445,10.0445,14.5833,10.0781,NULL),(264,1342,'DJ Short Blueberry','dj-short-blueberry','Indica','Dsb','<p>This Blueberry is a dense and stout plant with red, purple and blue hues. &nbsp;The finished product has a very fruity aroma and taste of blueberry. &nbsp;The high is euphoric and long lasting.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/dj-short-blueberry_100x100_ba41.jpg','https://leafly.blob.core.windows.net/reviews/dj-short-blueberry_100x100_b6fd.jpg','https://leafly.blob.core.windows.net/reviews/dj-short-blueberry_100x100_776d.jpg','https://leafly.blob.core.windows.net/reviews/dj-short-blueberry_100x100_166f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/306666/b/dj-short-blueberry__primary_cdba.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/285558/b/dj-short-blueberry__primary_ae55.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/281109/b/dj-short-blueberry__primary_11b0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/279620/b/dj-short-blueberry__primary_b722.jpg',NULL,97.1287,80.9007,74.5729,58.6263,46.1633,64.9541,64.6529,57.4585,38.7024,23.4421,44.0895,30.9895,29.7008,38.7024,23.4421,NULL),(265,889,'Cannalope Haze','cannalope-haze','Sativa','Cah','<p>Like the name suggests, Cannalope Haze is a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> mix of <a href=\"http://www.leafly.com/explore#!/explore/flavors-tropical\">tropical</a>, melon, and&nbsp;<a href=\"http://www.leafly.com/explore#!/explore/flavors-flowery\">floral</a> flavors. Almost a pure <a href=\"http://www.leafly.com/sativa\">sativa</a> that crosses Haze Brothers&nbsp;Original <a href=\"http://www.leafly.com/sativa/haze\">Haze</a> and a <a href=\"http://www.leafly.com/sativa/mexican\">Mexican</a> landrace, this strain is a great solution for <a href=\"http://www.leafly.com/explore#!/explore/symptoms-fatigue\">fatigue</a> and when struggling with <a href=\"http://www.leafly.com/explore#!/explore/symptoms-lack-of-appetite\">appetite loss</a>. The smooth taste and hefty resin production make it great for producing <a href=\"http://www.leafly.com/knowledge-center/cannabis-101/the-great-wide-world-of-cannabis-concentrates\">concentrates</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cannalope-haze_100x100_e910.jpg','https://leafly.blob.core.windows.net/reviews/cannalope-haze_100x100_7d89.jpg','https://leafly.blob.core.windows.net/reviews/cannalope-haze_100x100_424d.jpg','https://leafly.blob.core.windows.net/reviews/cannalope-haze_100x100_9ba1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363416/b/cannalope-haze__primary_b5e3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358308/b/cannalope-haze__primary_9736.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/314220/b/cannalope-haze__primary_149b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/314314/b/cannalope-haze__primary_edc2.jpg',NULL,68.7444,58.8848,54.1889,47.2129,39.2008,43.8298,34.0556,21.3551,16.1672,9.349,45.9187,13.6605,8.49673,16.1672,9.349,NULL),(266,218,'Chocolate Kush','chocolate-kush','Sativa','Cok','<p>This sativa-dominant strain is from the lineage of <a href=\"http://www.leafly.com/sativa/chocolope\">Chocolope</a> (multiple Cannabis Cup winner) and <a href=\"http://www.leafly.com/indica/kosher-kush\">Kosher Kush</a>. Kosher Kush has been the front runner in each Cannabis event it has competed in and has been published by High Times as the 7th overall strongest strain in the world. Also known as Chocolope Kush, the buds on Chocolate Kush are dense and dark colored with a large amount of white crystals. It is known to have the aroma of vanilla mixed with chocolate. The high is described as a heavy cerebral one, and has a THC content of up to 14% along with a CBD of approximately 1%. Flowering time is about 9 weeks.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/chocolate-kush_100x100_5267.jpg','https://leafly.blob.core.windows.net/reviews/chocolate-kush_100x100_a5f2.jpg','https://leafly.blob.core.windows.net/reviews/chocolate-kush_100x100_3ba4.jpg','https://leafly.blob.core.windows.net/reviews/chocolate-kush_100x100_ad9e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362930/b/chocolate-kush__primary_87c4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350546/b/chocolate-kush__primary_daa3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350363/b/chocolate-kush__primary_553c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344669/b/chocolate-kush__primary_55fe.jpg',NULL,63.2333,56.5396,52.1948,45.6807,45.0651,38.7426,32.1177,30.1247,29.991,18.9562,26.216,9.23712,8.73222,29.991,18.9562,NULL),(267,58095,'3 Kings','3-kings','Hybrid','3k','<p><span style=\"line-height: 1.6em;\">The 3 Kings marijuana strain, a holy trinity of <a href=\"http://www.leafly.com/hybrid/headband\">Headband</a>, <a href=\"http://www.leafly.com/sativa/sour-diesel\">Sour Diesel</a>, and <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>, is a sativa-dominant hybrid and genetic masterpiece. Sour tanginess reek from the sage green buds, and its frosty coat gives you a fair warning of the 3 Kings&rsquo; potency. Medical patients will appreciate the versatility of this strain&rsquo;s medicinal effects as it relieves pain, stress, and nausea without heavy sedation.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/3-kings_100x100_3c6e.jpg','https://leafly.blob.core.windows.net/reviews/3-kings_100x100_c058.jpg','https://leafly.blob.core.windows.net/reviews/3-kings_100x100_3b56.jpg','https://leafly.blob.core.windows.net/reviews/3-kings_100x100_8869.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363631/b/3-kings__primary_f665.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350581/b/3-kings__primary_4e55.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348558/b/3-kings__primary_a59c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345267/b/3-kings__primary_a46c.jpg',NULL,59.3932,55.0048,48.4249,43.4142,33.6251,37.7053,31.1035,26.017,19.5129,14.7374,15.9226,11.8424,9.29912,19.5129,14.7374,NULL),(268,93,'Afghooey','afghooey','Indica','Afy','<p>Also known as <a href=\"http://leafly.com/indica/afgoo\">Afgoo</a>, Afghooey buds are light,&nbsp;fluffy, and heavily laden with a crystal coating of trichomes. Working this marijuana in your hand can become a very sticky situation. Smoking Afghooey provides you with a best of both worlds <a href=\"/indica\">indica</a> &amp; <a href=\"/sativa\">sativa</a> high.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/afghooey_100x100_17f9.jpg','https://leafly.blob.core.windows.net/reviews/afghooey_100x100_b639.jpg','https://leafly.blob.core.windows.net/reviews/afghooey_100x100_91d0.jpg','https://leafly.blob.core.windows.net/reviews/afghooey_100x100_46d8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352890/b/afghooey__primary_b1c6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/340106/b/afghooey__primary_923a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326284/b/afghooey__primary_68a5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/292637/b/afghooey__primary_f709.jpg',NULL,77.5418,75.193,67.6641,44.4659,41.3771,67.7606,65.7979,56.3063,50.2252,47.8121,50.2252,50,29.2793,50.2252,47.8121,NULL),(269,1682,'Afgooey','afgooey','Indica','Af','<p>Afgooey, also known as <a href=\"http://leafly.com/indica/afgoo\">Afgoo</a>, is a potent <a href=\"http://leafly.com/indica\">indica</a> strain that is believed to descend from an <a href=\"http://leafly.com/indica/afghani\">Afghani</a> indica and Maui Haze. Its sativa parent may lend Afgoo some <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-creative\">creative</a> qualities, but this strain undoubtedly takes after its indica parent as it primarily delivers <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxing</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-sleepy\">sleepy</a> effects alongside its <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#/!/explore/flavors-pine\">pine</a> flavor. Growers hoping to cultivate Afgoo may have a better chance of success indoors, but this indica can also thrive in Mediterranean climates outdoors.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/afgooey/primary?width=200','https://leafly.blob.core.windows.net/reviews/afgooey_100x100_4dbc.jpg','https://leafly.blob.core.windows.net/reviews/afgooey_100x100_9532.jpg','https://leafly.blob.core.windows.net/reviews/afgooey_100x100_ef93.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/afgooey/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362829/b/afgooey__primary_fd5d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361835/b/afgooey__primary_25bd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/311288/b/afgooey__primary_99f1.jpg',NULL,69.4549,57.1883,56.3127,40.5437,40.5437,53.0518,49.5796,48.711,18.253,17.166,39.3209,19.5966,16.4716,18.253,17.166,NULL),(270,65455,'ACDC','acdc','Hybrid','Acd','<p class=\"p1\">ACDC is&nbsp;a sativa-dominant phenotype of the <span class=\"s1\"><a href=\"http://www.leafly.com/news/lifestyle/whats-the-deal-with-these-high-cbd-strains\">high-CBD</a>&nbsp;cannabis</span> strain, <a href=\"http://www.leafly.com/hybrid/cannatonic\"><span class=\"s1\">Cannatonic</span></a>. One remarkable characteristic of ACDC is its THC:CBD ratio of 1:20, meaning this strain induces no psychoactive effects. Tests have put ACDC&rsquo;s CBD content as high as 19%, which helps many patients treat pain, anxiety, epilepsy, multiple sclerosis, and the negative effects of chemotherapy, all without intoxication.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/acdc_100x100_95a4.jpg','https://leafly.blob.core.windows.net/reviews/acdc_100x100_2b31.jpg','https://leafly.blob.core.windows.net/reviews/acdc_100x100_5817.jpg','https://leafly.blob.core.windows.net/reviews/acdc_100x100_5af1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323761/b/acdc__primary_313c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/314551/b/acdc__primary_1659.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/299150/b/acdc__primary_80ff.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/298991/b/acdc__primary_52be.jpg','https://leafly.s3.amazonaws.com/strains/testing/I8baAGQGSpaCeoQGBeTN_acdc.png',85.8615,51.0609,38.1569,35.3556,26.5101,66.0714,54.9305,29.4586,27.1859,26.6989,38.9271,19.2049,15.6222,27.1859,26.6989,NULL),(271,78,'Sage N Sour','sage-n-sour','Sativa','Sns','<p><span style=\"line-height: 1.6em;\">Sage N Sour by T.H. Seeds is a 75%&nbsp;</span><a href=\"http://leafly.com/sativa\"><span style=\"line-height: 1.6em;\">sativa</span></a><span style=\"line-height: 1.6em;\">&nbsp;strain that unites the sharply <a href=\"http://www.leafly.com/explore#!/explore/flavors-pungent\">pungent</a></span><span style=\"line-height: 1.6em;\">&nbsp;<a href=\"http://leafly.com/sativa/sour-diesel\">Sour Diesel</a> with their <a href=\"http://www.leafly.com/hybrid/sage\">SAGE</a> <a href=\"http://leafly.com/hybrid\">hybrid</a>. With an aroma that closely matches the subtle <a href=\"http://www.leafly.com/explore#!/explore/flavors-spicyherbal\">herbal</a> notes of <a href=\"http://www.leafly.com/explore#!/explore/flavors-sage\">sage</a>, Sage N Sour delivers a perfect balance of <a href=\"http://www.leafly.com/explore#!/explore/tags-euphoric\">euphoria</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energy</a>, and <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happiness</a> to its consumer. Growers will appreciate the generous yields this sativa has to offer following its 60 to 65 day flowering cycle.</span></p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.2/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/sage-n-sour_100x100_e2df.jpg','https://leafly.blob.core.windows.net/reviews/sage-n-sour_100x100_8c00.jpg','https://leafly.blob.core.windows.net/reviews/sage-n-sour_100x100_adac.jpg','https://leafly.blob.core.windows.net/reviews/sage-n-sour_100x100_ff79.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365130/b/sage-n-sour__primary_749f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/365006/b/sage-n-sour__primary_a8e0.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358158/b/sage-n-sour__primary_9197.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355737/b/sage-n-sour__primary_e386.jpg',NULL,63.1627,53.0679,48.8158,39.2178,34.9206,38.948,28.8079,26.0452,25.758,19.3304,22.0867,8.86028,7.31707,25.758,19.3304,NULL),(272,6083,'Purple Dream','purple-dream','Hybrid','Pud','<p>Purple Dream is the mild child of <a href=\"http://www.leafly.com/indica/purple-kush\">Purple Kush</a> and <a href=\"http://www.leafly.com/hybrid/blue-dream\">Blue Dream</a>. Featuring a strong sour grape smell and musty taste, this hybrid is slightly indica dominant. Purple Dream provides users with a relaxing tingly body sensation and has moderate head-heavy effects. It allows patients to function yet acts as a gentle sedative. This strain is great for those suffering from pain or who just need help winding down.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/hybrid/purple-dream/primary?width=200','https://leafly.blob.core.windows.net/reviews/purple-dream_100x100_efd3.jpg','https://leafly.blob.core.windows.net/reviews/purple-dream_100x100_d54f.jpg','https://leafly.blob.core.windows.net/reviews/purple-dream_100x100_fe3f.jpg','https://d3h17ltqi8v019.cloudfront.net/hybrid/purple-dream/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330924/b/purple-dream__primary_459b.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330735/b/purple-dream__primary_6f91.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/319161/b/purple-dream__primary_1575.jpg',NULL,61.7154,47.9437,43.1277,30.8712,22.9437,39.7727,30.79,14.1775,13.1494,11.1742,13.447,10.4978,5.46537,13.1494,11.1742,NULL),(273,11047,'Trinity','trinity','Sativa','Tri','<p>A rumored hard to find strain, Trinity is known to have a strong skunk-like smell with an uplifting high.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/trinity_100x100_7267.jpg','https://leafly.blob.core.windows.net/reviews/trinity_100x100_86a5.jpg','https://leafly.blob.core.windows.net/reviews/trinity_100x100_144b.jpg','https://leafly.blob.core.windows.net/reviews/trinity_100x100_ab1c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358482/b/trinity__primary_860a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356461/b/trinity__primary_68f8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348499/b/trinity__primary_ad93.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/341294/b/trinity__primary_7c1a.jpg',NULL,82.7226,79.8654,61.2977,56.211,52.2455,59.0735,55.7372,31.0956,22.7194,20.6435,34.2692,20.6579,17.4699,22.7194,20.6435,NULL),(274,95,'M-39','m-39','Indica','M39','<p>The offspring of <a href=\"http://www.leafly.com/hybrid/northern-lights--5\">Northern Lights #5</a> and <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a>, M-39 is a difficult crop to grow properly. However, when grown correctly, the M-39 marijuana strain has a fruity and lemon taste with many trichomes and very visible crystals. The buds are very compact, heavy, and dense. Flowering time is about 45 days, with the strain&#39;s THC content measuring&nbsp;up to 16.5%.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/m-39_100x100_e489.jpg','https://leafly.blob.core.windows.net/reviews/m-39_100x100_3ab7.jpg','https://leafly.blob.core.windows.net/reviews/m-39_100x100_14cd.jpg','https://leafly.blob.core.windows.net/reviews/m-39_100x100_8f17.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/275594/b/m-39__primary_e56f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/272557/b/m-39__primary_79d3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/259250/b/m-39__primary_0578.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/243763/b/m-39__primary_ade2.jpg',NULL,86.9697,76.1688,54.8323,49.7132,38.1061,47.987,43.9394,9.98377,9.68615,9.38853,13.75,5,4.94048,9.68615,9.38853,NULL),(275,7981,'Black Diamond','black-diamond','Indica','Bdi','<p class=\"p1\">Black Diamond is a Northern California strain ideal for patients who need strong medication but still want to be active and sociable. A cross between <a href=\"http://www.leafly.com/indica/blackberry\"><span class=\"s1\">Blackberry</span></a> and <a href=\"http://www.leafly.com/indica/diamond-og\"><span class=\"s1\">Diamond OG</span></a>, its flowers have a glittery trichome covering and purple coloring that make it a beautiful gem to look at. The strain&rsquo;s aroma is musky and earthy, almost like a deep red wine. Black Diamond is known to cause fits of giggles and is a great strain for hanging out with friends or catching up on TV shows at home. This strain tends to make consumers&nbsp;extremely hungry, making it a good choice for those looking to increase their appetite (just make sure you have some snacks on hand).</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/black-diamond_100x100_602d.jpg','https://leafly.blob.core.windows.net/reviews/black-diamond_100x100_5be1.jpg','https://leafly.blob.core.windows.net/reviews/black-diamond_100x100_3d17.jpg','https://leafly.blob.core.windows.net/reviews/black-diamond_100x100_e398.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/364012/b/black-diamond__primary_b29f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/332981/b/black-diamond__primary_2a4c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330795/b/black-diamond__primary_296e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325866/b/black-diamond__primary_fade.jpg',NULL,80.6878,67.9894,55.8862,46.8915,40.9392,31.2169,22.4868,17.7249,15.5423,14.2196,18.5185,12.8307,9.98677,15.5423,14.2196,NULL),(276,141,'Hawaiian Snow','hawaiian-snow','Sativa','Hs','<p>Hawaiian Snow is a cross of Hawaiian Haze, Pure Haze and Neville&#39;s Haze. &nbsp;This trifecta of Hazes produces a light and fresh taste and radiant highs. &nbsp;This cannabis strain has been known to incite long rounds of giggles, great for hanging out with friends.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/sativa/hawaiian-snow/primary?width=200','https://leafly.blob.core.windows.net/reviews/hawaiian-snow_100x100_6fab.jpg','https://leafly.blob.core.windows.net/reviews/hawaiian-snow_100x100_3f1a.jpg','https://leafly.blob.core.windows.net/reviews/hawaiian-snow_100x100_d945.jpg','https://d3h17ltqi8v019.cloudfront.net/sativa/hawaiian-snow/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336874/b/hawaiian-snow__primary_706d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335803/b/hawaiian-snow__primary_be42.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/323260/b/hawaiian-snow__primary_77de.jpg',NULL,68.7986,60.7237,58.1493,54.2907,45.4342,38.3002,33.8234,22.531,18.2155,16.7411,28.1617,12.2539,10.3205,18.2155,16.7411,NULL),(277,11131,'Candy Jack','candy-jack','Sativa','Caj','<p>Candy Jack is a mostly <a href=\"http://leafly.com/sativa\">sativa</a> strain that provides a swift boost to your mood alongside a <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet/\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-citrus/\">citrus</a> aroma. The fragrant smell is inherited from its <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk #1</a> parent, while <a href=\"http://www.leafly.com/explore#!/explore/tags-creative/\">creative</a> and <a href=\"http://www.leafly.com/explore#!/explore/tags-focused/\">focused</a> effects stem from the <a href=\"http://leafly.com/sativa/jack-herer\">Jack Herer</a> side of the family. While its complex terpene profile may impress even the most hardened connoisseur, patients typically appreciate Candy Jack&rsquo;s ability to counter stress, depression, and appetite loss. With a few Cannabis Cup wins already under its belt, Candy Jack&rsquo;s potency, flavor, and effects have won this sativa a sterling reputation in the cannabis world.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/candy-jack_100x100_a7fd.jpg','https://leafly.blob.core.windows.net/reviews/candy-jack_100x100_3a6f.jpg','https://leafly.blob.core.windows.net/reviews/candy-jack_100x100_d744.jpg','https://leafly.blob.core.windows.net/reviews/candy-jack_100x100_e3e2.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356555/b/candy-jack__primary_eba4.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/342386/b/candy-jack__primary_0708.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/335153/b/candy-jack__primary_f2a7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/321206/b/candy-jack__primary_e427.jpg',NULL,84.0303,80.7879,80.4091,75.8636,67.8636,47.8636,42.3939,31.5303,24.7121,18.4394,24.8788,10.6515,10.6515,24.7121,18.4394,NULL),(278,687,'Bubba OG','bubba-og','Indica','Bog','<p>Tingly body and sleepy eyes, you will want to sit but your mind can remain focused or is free to wander. &nbsp;Great for relaxing, hanging out, and just enjoying life.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/bubba-og/primary?width=200','https://leafly.blob.core.windows.net/reviews/bubba-og_100x100_b424.jpg','https://leafly.blob.core.windows.net/reviews/bubba-og_100x100_f632.jpg','https://leafly.blob.core.windows.net/reviews/bubba-og_100x100_7c54.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/bubba-og/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362922/b/bubba-og__primary_92ac.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348428/b/bubba-og__primary_b80f.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/347889/b/bubba-og__primary_7d2d.jpg',NULL,79.813,64.3752,55.8069,55.5964,53.8288,41.7744,38.9738,33.7348,31.7421,28.021,23.7857,8.58304,7.32961,31.7421,28.021,NULL),(280,925,'Yoda OG','yoda-og','Indica','Yod','<p>Yoda OG, a descendant of the legendary <a href=\"http://www.leafly.com/hybrid/og-kush\">OG Kush</a>, is an indica-dominant strain that induces heavy relaxation of the mind and body. This strain boasts its OG genetics with chunky pale buds, a tangle of orange hairs, and a pungent citrus aroma. Its sedating, euphoric effects make it a popular medicine for anxiety and insomnia, and it also provides an extra kick to the appetite. Seasoned consumers may be able to withstand its heaviness during the day, but Yoda OG is most popularly chosen for nighttime consumption.</p>\n\n<p>&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/yoda-og_100x100_890c.jpg','https://leafly.blob.core.windows.net/reviews/yoda-og_100x100_b8fc.jpg','https://leafly.blob.core.windows.net/reviews/yoda-og_100x100_959c.jpg','https://leafly.blob.core.windows.net/reviews/yoda-og_100x100_a38d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363535/b/yoda-og__primary_b0f7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/363067/b/yoda-og__primary_b5fb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350676/b/yoda-og__primary_cd2e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345454/b/yoda-og__primary_d1f8.jpg',NULL,86.7121,63.8184,58.1091,43.705,36.3774,48.3974,47.6048,42.5682,39.7767,25.0111,32.1665,15.972,11.9,39.7767,25.0111,NULL),(281,540,'Pineapple Trainwreck','pineapple-trainwreck','Hybrid','Ptw','<p>Bring together the popular clear-headed effects of <a href=\"http://www.leafly.com/hybrid/pineapple-express\">Pineapple Express</a> and the pain relief qualities of <a href=\"http://www.leafly.com/hybrid/trainwreck\">Trainwreck</a> and you get this happy sativa. Pineapple Trainwreck has an earthy aroma and a fruity flavor that usually takes more after its pineapple parent. Long-lasting and potent, this strain hits hard at first, but mellows into a state where being sociable or getting things done is possible. The buzz tends to be more mellow than active, though, so don&rsquo;t be surprised if verbal activity is all you get around to.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pineapple-trainwreck_100x100_b995.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-trainwreck_100x100_6f95.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-trainwreck_100x100_1bda.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-trainwreck_100x100_304c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/356970/b/pineapple-trainwreck__primary_8b09.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/319018/b/pineapple-trainwreck__primary_35bd.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/306474/b/pineapple-trainwreck__primary_88e6.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/303880/b/pineapple-trainwreck__primary_f062.jpg',NULL,99.0906,77.4075,76.8818,59.1989,51.1985,54.7887,53.217,36.0387,14.6709,12.9468,16.3478,9.60366,8.27902,14.6709,12.9468,NULL),(282,1528,'White Berry','white-berry','Indica','Wb','<p>White Berry&#39;s hybridized genetics create a complex and versatile strain.&nbsp;The typical result is a sativa head effect with an indica-style body sensation when consumed in higher quantities.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/white-berry/primary?width=200','https://leafly.blob.core.windows.net/reviews/white-berry_100x100_4eb8.jpg','https://leafly.blob.core.windows.net/reviews/white-berry_100x100_c4ae.jpg','https://leafly.blob.core.windows.net/reviews/white-berry_100x100_6427.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/white-berry/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358459/b/white-berry__primary_a304.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/354123/b/white-berry__primary_2636.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/345226/b/white-berry__primary_21db.jpg',NULL,47.333,43.9141,37.6655,34.158,34.158,34.1289,25.4399,22.3476,9.22474,8.33188,21.2747,5.17567,5.08856,9.22474,8.33188,NULL),(283,19024,'Cali Kush','cali-kush','Hybrid','Cku','<p class=\"p1\">Cali Kush must have been a no-brainer when it came time to name this strain given the popularity of Kush varieties in The Golden State. Its buds are large and dense with few leaves and not many pistils. The flowers will be light green shot through with icy blue and packed with trichomes throughout. Cali Kush buds have a fruity citrus aroma with the darker coffee notes of a kush. Spicier tones and the coffee kushness are more apparent in the taste. The indica-dominant variation of this hybrid has been more popular, but a sativa-dominant version has also been spotted.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/cali-kush_100x100_790d.jpg','https://leafly.blob.core.windows.net/reviews/cali-kush_100x100_b11f.jpg','https://leafly.blob.core.windows.net/reviews/cali-kush_100x100_b160.jpg','https://leafly.blob.core.windows.net/reviews/cali-kush_100x100_7527.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/330695/b/cali-kush__primary_591a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325839/b/cali-kush__primary_4a21.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/325387/b/cali-kush__primary_d5cf.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/307564/b/cali-kush__primary_9b59.jpg',NULL,69.8495,43.6538,42.3541,41.1451,40.1691,24.2542,18.7997,17.8906,15.5539,14.2141,10.7516,8.67647,7.18205,15.5539,14.2141,NULL),(284,633,'Green Queen','green-queen','Hybrid','Gq','<p>Green Queen was bred by JB Dank Nugz from <a href=\"http://www.leafly.com/sativa/green-crack\">Green Crack</a> and <a href=\"http://www.leafly.com/hybrid/space-queen\">Space Queen</a>. It is gold and yellow in color and known to provide a strong body buzz, with THC up to 17%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/green-queen_100x100_0593.jpg','https://leafly.blob.core.windows.net/reviews/green-queen_100x100_8957.jpg','https://leafly.blob.core.windows.net/reviews/green-queen_100x100_ed33.jpg','https://leafly.blob.core.windows.net/reviews/green-queen_100x100_d506.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/326011/b/green-queen__primary_4d3e.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/297504/b/green-queen__primary_ed63.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/282731/b/green-queen__primary_1a01.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/276043/b/green-queen__primary_aae3.jpg',NULL,56.705,51.0536,49.2816,46.1686,44.0134,33.7644,24.6648,20.8094,12.1887,12.1648,22.9167,14.1044,14.1044,12.1887,12.1648,NULL),(285,102320,'Bubblegum Kush','bubblegum-kush','Indica','Bgk','<p>Bubblegum Kush is an 80% <a href=\"http://www.leafly.com/indica\">indica</a> bred by Bulldog Seeds. These sour buds offer relaxing effects true to its indica dominance. Growers will appreciate this plant&#39;s&nbsp;large yield, flowering around 8 weeks.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://d3h17ltqi8v019.cloudfront.net/indica/bubblegum-kush/primary?width=200','https://leafly.blob.core.windows.net/reviews/bubblegum-kush_100x100_82dc.jpg','https://leafly.blob.core.windows.net/reviews/bubblegum-kush_100x100_1781.jpg','https://leafly.blob.core.windows.net/reviews/bubblegum-kush_100x100_8c07.jpg','https://d3h17ltqi8v019.cloudfront.net/indica/bubblegum-kush/primary?width=1024','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/358193/b/bubblegum-kush__primary_048d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353149/b/bubblegum-kush__primary_15a7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352467/b/bubblegum-kush__primary_dcd2.jpg',NULL,80.0722,60.3203,57.8119,53.0914,29.304,24.4354,17.6601,16.2903,15.6053,12.2177,12.9026,12.9026,11.5328,15.6053,12.2177,NULL),(286,74,'Pot of Gold','pot-of-gold','Indica','Pog','<p>Pot of Gold comes from Flying Dutchmen Seed Company and won 2nd prize at the 2003 Cannabis Cup. &#160;Usually very sticky and hard to break up by hand, definitely use a grinder for this variety.</p><p>Has a somewhat hashy and fruity taste when smoked. &#160;High comes on quick and is very much a head stone.</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pot-of-gold_100x100_3ce4.jpg','https://leafly.blob.core.windows.net/reviews/pot-of-gold_100x100_998c.jpg','https://leafly.blob.core.windows.net/reviews/pot-of-gold_100x100_2544.jpg','https://leafly.blob.core.windows.net/reviews/pot-of-gold_100x100_97f3.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/308525/b/pot-of-gold__primary_d79d.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/261229/b/pot-of-gold__primary_f533.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/242203/b/pot-of-gold__primary_0132.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/239893/b/pot-of-gold__primary_26ba.jpg',NULL,66.875,58.3902,49.2614,49.1288,42.803,27.7841,16.572,16.1174,13.6932,13.2765,46.9318,10.7576,6.98864,13.6932,13.2765,NULL),(288,299,'Grapefruit Kush','grapefruit-kush','Hybrid','Gk','<p>This cannabis strain is a cross of BC Kush and Grapefruit, Grapefruit Kush is one of the classic old-school Afghani Kush strains. &#160;Large buds with a fruity hash taste, produces enjoyable smooth and creamy smoke with a great high.</p>','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/grapefruit-kush_100x100_98aa.jpg','https://leafly.blob.core.windows.net/reviews/grapefruit-kush_100x100_9770.jpg','https://leafly.blob.core.windows.net/reviews/grapefruit-kush_100x100_fabf.jpg','https://leafly.blob.core.windows.net/reviews/grapefruit-kush_100x100_b196.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362351/b/grapefruit-kush__primary_5812.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350346/b/grapefruit-kush__primary_0840.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/337755/b/grapefruit-kush__primary_1c77.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/337941/b/grapefruit-kush__primary_cdbf.jpg',NULL,67.6448,57.5997,55.7729,54.6893,31.0606,30.701,27.1768,26.3425,23.3074,13.272,20.4162,12.8165,5.62908,23.3074,13.272,NULL),(289,362,'Tangerine Kush','tangerine-kush','Indica','Tan','<p class=\"p1\">Tangerine Kush embodies the California sunshine. This cannabis&nbsp;strain got its name for both its citrusy flavor and its halo of bright orange hairs covering the bud. While the effects of this indica are particularly short-lasting, Tangerine Kush is potent with a quick onset. Providing consumers with a happy, body-heavy sensation, this strain is great for those looking for a lazy day at the beach. Tangerine Kush&rsquo;s effects are felt more in the head than many other indicas. Upon first taste, consumers may feel uplifted and energized. After a few minutes, however, a heavy, lazy sensation kicks in. If you&rsquo;re looking for a strain to help you relax, Tangerine Kush may be worth a try.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.9/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/tangerine-kush_100x100_436a.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-kush_100x100_5db9.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-kush_100x100_e0d0.jpg','https://leafly.blob.core.windows.net/reviews/tangerine-kush_100x100_fa79.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355894/b/tangerine-kush__primary_2d9c.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/352945/b/tangerine-kush__primary_0246.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/350977/b/tangerine-kush__primary_3023.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/351091/b/tangerine-kush__primary_fb2e.jpg',NULL,82.6892,73.6718,54.793,52.7852,50.7552,40.6539,28.5048,27.6875,25.0755,24.0494,36.4072,23.5119,19.1276,25.0755,24.0494,NULL),(290,76879,'Pineapple Chunk','pineapple-chunk','Hybrid','Pch','<p>Pineapple Chunk, bred by Barney&rsquo;s Farm, is an indica-leaning <a href=\"http://leafly.com/hybrid\">hybrid</a> that induces heavy full-body effects and a fast-paced head buzz. This THC-rich strain combines a <a href=\"http://www.leafly.com/indica/cheese\">Cheese</a> and <a href=\"http://www.leafly.com/sativa/skunk-1\">Skunk #1</a> cross with Barney&rsquo;s <a href=\"http://www.leafly.com/hybrid/pineapple\">Pineapple</a>, and you can almost smell its lineage through sour notes of tangy <a href=\"http://www.leafly.com/explore#!/explore/flavors-skunk\">skunk</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-earthy\">earthy</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-cheese\">cheese</a>, and <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a> <a href=\"http://www.leafly.com/explore#!/explore/flavors-pineapple\">pineapple</a>. Optimally, Pineapple Chunk will deliver a small dose of <a href=\"http://www.leafly.com/news/lifestyle/whats-the-deal-with-these-high-cbd-strains\">CBD</a> with its crushing THC content, resulting in powerful <a href=\"http://www.leafly.com/explore#!/explore/symptoms-pain\">painkilling</a> and <a href=\"http://www.leafly.com/explore#!/explore/symptoms-stress\">stress-relieving</a> properties. Some report a racing jolt of cerebral <a href=\"http://www.leafly.com/explore#!/explore/tags-energetic\">energy</a> with Pineapple Chunk, so this may not be the best strain for treating <a href=\"http://www.leafly.com/explore#!/explore/symptoms-insomnia\">sleeplessness</a> or <a href=\"http://www.leafly.com/explore#!/explore/conditions-anxiety\">anxiety</a>. Pineapple Chunk plants are resistant to mold and disease, and flower in 55 days indoors.&nbsp;</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/pineapple-chunk_100x100_3b2f.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-chunk_100x100_f7f9.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-chunk_100x100_fb53.jpg','https://leafly.blob.core.windows.net/reviews/pineapple-chunk_100x100_1ef5.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353440/b/pineapple-chunk__primary_4e89.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/346770/b/pineapple-chunk__primary_a3ab.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/344778/b/pineapple-chunk__primary_1c72.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/334814/b/pineapple-chunk__primary_75a2.jpg',NULL,66.3028,63.7022,49.2283,44.1428,39.8542,51.1149,45.083,35.4632,25.8095,19.7499,35.8308,17.6942,13.3032,25.8095,19.7499,NULL),(291,8831,'Green Ribbon','green-ribbon','Hybrid','Grr','<p>Green Ribbon is a 50/50 hybrid that tends towards the sativa side when it comes to effects; patients report an energetic, heady feeling when using it. Originating in San Jose, California, this strain includes some <a href=\"http://www.leafly.com/sativa/green-crack\" style=\"text-decoration:none;\">Green Crack</a> but the status of the other parent is unknown, with <a href=\"http://www.leafly.com/hybrid/trainwreck\" style=\"text-decoration:none;\">Trainwreck</a>, <a href=\"http://www.leafly.com/hybrid/afghanica\" style=\"text-decoration:none;\">Afghanica</a>, and <a href=\"http://www.leafly.com/hybrid/white-rhino\" style=\"text-decoration:none;\">White Rhino</a> all contenders. The light green buds have a subtle floral scent and are slightly fruity, lending to an earthy taste. Green Ribbon generally has a high THC content around 18-20%.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.3/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/green-ribbon_100x100_505f.jpg','https://leafly.blob.core.windows.net/reviews/green-ribbon_100x100_9894.jpg','https://leafly.blob.core.windows.net/reviews/green-ribbon_100x100_f730.jpg','https://leafly.blob.core.windows.net/reviews/green-ribbon_100x100_c399.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/362668/b/green-ribbon__primary_bda8.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/355057/b/green-ribbon__primary_ae1a.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/353303/b/green-ribbon__primary_1935.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/343024/b/green-ribbon__primary_2535.jpg',NULL,59.8292,50.9604,48.9057,39.1913,31.8502,39.6779,28.1553,16.1758,13.3308,11.5077,29.0987,9.16412,4.63836,13.3308,11.5077,NULL),(292,706,'G13 Haze','g13-haze','Hybrid','13h','<p>This hybrid of <a href=\"http://www.leafly.com/indica/g-13\">G13</a> has been crossed with an original <a href=\"http://www.leafly.com/sativa/haze\">Haze</a> to give it a more uplifting sensation while still retaining the heavy hitting <a href=\"/indica\">indica</a> undertones. G13 was bred for maximum potency and renowned for its medical use, and it&#39;s definitely not recommended for beginners.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.1/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/g13-haze_100x100_836f.jpg','https://leafly.blob.core.windows.net/reviews/g13-haze_100x100_3747.jpg','https://leafly.blob.core.windows.net/reviews/g13-haze_100x100_3f04.jpg','https://leafly.blob.core.windows.net/reviews/g13-haze_100x100_a652.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/361739/b/g13-haze__primary_44c1.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/339383/b/g13-haze__primary_e7cc.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/285355/b/g13-haze__primary_d267.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/256331/b/g13-haze__primary_d743.jpg',NULL,47.5733,41.3462,38.0037,36.4927,32.3718,32.5092,23.8095,23.0311,22.5733,20.4212,7.37179,5.35714,4.99084,22.5733,20.4212,NULL),(293,494,'AK-48','ak-48','Hybrid','A48','<p>Although it is a hybrid, the AK-48 high leans more towards typical <a href=\"/sativa\">sativa</a> effects. &nbsp;AK-48&#39;s parents are Ice and Jock Horror. &nbsp;Its Ice mother has ancestors of <a href=\"/indica/afghani\">Afghani</a>, <a href=\"http://www.leafly.com/hybrid/skunk-1\">Skunk</a>, <a href=\"/indica/northern-lights\">Northern Lights</a> and <a href=\"/hybrid/shiva-skunk\">Shiva</a> stock.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/3.8/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/ak-48_100x100_caf7.jpg','https://leafly.blob.core.windows.net/reviews/ak-48_100x100_cf1a.jpg','https://leafly.blob.core.windows.net/reviews/ak-48_100x100_beac.jpg','https://leafly.blob.core.windows.net/reviews/ak-48_100x100_1985.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/349873/b/ak-48__primary_6d67.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/348746/b/ak-48__primary_e9e7.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/336056/b/ak-48__primary_d8fb.jpg','https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/301745/b/ak-48__primary_07cb.jpg',NULL,81.598,63.951,59.6961,46.2647,30.8333,48.8431,41.0098,36.4314,34.3039,23.8922,20.951,15.0686,11.8039,34.3039,23.8922,NULL),(294,93007,'Stella Blue','stella-blue','Sativa','Sbl','<p>Stella Blue is a 70% <a href=\"http://leafly.com/sativa\">sativa</a> strain from Humboldt County, California, that is said to be a cross between <a href=\"http://www.leafly.com/indica/blueberry\">Blueberry</a> and an unknown sativa. Testament to its Blueberry parentage is Stella Blue&rsquo;s <a href=\"http://www.leafly.com/explore#!/explore/flavors-sweet\">sweet</a>, <a href=\"http://www.leafly.com/explore#!/explore/flavors-tree-fruit\">fruity</a> aroma, enriched by notes of <a href=\"http://www.leafly.com/explore#!/explore/flavors-orange\">orange</a> and <a href=\"http://www.leafly.com/explore#!/explore/flavors-berry\">berry</a>. Stella Blue&rsquo;s <a href=\"http://www.leafly.com/explore#!/explore/tags-happy\">happy</a>, <a href=\"http://www.leafly.com/explore#!/explore/tags-giggly\">giggly</a>, and <a href=\"http://www.leafly.com/explore#!/explore/tags-uplifted\">uplifting</a> sensations take over immediately, and can easily be used for either functional <a href=\"http://www.leafly.com/explore#!/explore/tags-focused\">focus</a> or lazy <a href=\"http://www.leafly.com/explore#!/explore/tags-relaxed\">relaxation</a>.</p>\n','https://d3h17ltqi8v019.cloudfront.net/stars/4.5/240?color=fcc91d','https://leafly.blob.core.windows.net/reviews/stella-blue_100x100_4dcc.jpg',NULL,NULL,NULL,'https://d3h17ltqi8v019.cloudfront.net/cdn/strain-photo/331409/b/stella-blue__primary_8042.jpg',NULL,NULL,NULL,NULL,56.3636,47.2727,47.2727,38.1818,33.6364,13.6364,13.6364,9.09091,9.09091,9.09091,24.5455,20,20,9.09091,9.09091,NULL),(295,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://www.thcfinder.com/uploads/files/dr-death-fullsize-largebud-thcfinder.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
